INSERT INTO `agreements` VALUES ('1', '854', '<p>CCT will submit Investigators credentials to the Sponsor of the Study.&nbsp;</p><p>• Sponsor will submit protocol to Investigator. CCT makes no guarantee that Sponsor will use\r\nInvestigator.&nbsp;</p><p>• Investigator will make a final determination on proceeding with the Study. If you do not\r\naccept the study, you owe nothing to CCT.&nbsp;</p><p>• If Sponsor does use Investigator for the Study, Investigator agrees to pay CCT in Newport Beach,\r\nCA the amount of $3,500 (“Marketing Fee”).&nbsp;</p><p>• The full amount of the Marketing Fee shall be due and payable upon receipt of study start up\r\npayments from Sponsor. Unpaid balances after 30 days shall accrue compound monthly interest at\r\nthe rate of 1.5%.&nbsp;</p><p>• If the Study is cancelled for reasons other than Investigator’s performance on Study and prior to\r\nInvestigator earning any funds from Sponsor, CCT will refund the Marketing Fee within 30 days\r\nnotice of same from Investigator.&nbsp;</p><p>• Except for the condition described in Number 6 above, the Marketing Fee shall be considered earned\r\nby CCT and therefore nonrefundable regardless of Investigator’s subsequent performance and\r\ncompensation received from Sponsor of the Study.&nbsp;</p><p>• No Marketing Fee is owed to CCT for extensions of the current study or any future studies sent\r\ndirectly to the Investigator by the sponsor or CRO.</p><p>• This Agreement shall remain in full force and effect for as long as Sponsor takes to select\r\nInvestigators for this Study.&nbsp;</p><p>• Additional services available (Please initial any additional services needed)\r\nInvestigator agrees to hold harmless CCT from and against any and all losses, claims, damages, liabilities\r\nand costs (including costs of defense and attorney’s fees) arising from Investigators performance of the\r\nStudy.&nbsp;</p><p>Investigator also agrees to hold harmless CCT from and against any and all losses, claims, damages,\r\nliabilities and costs (including costs of defense and attorney’s fees) arising from any subsequent cancellation\r\nof the Study.\r\nThis Agreement constitutes the entire agreement between Investigator and CCT with regard to the subject\r\nmatter hereof. Any modification or amendment of any provision of this Agreement must be in writing and\r\nsigned by Investigator and CCT. If either party becomes involved in litigation arising from this Agreement\r\nor the performance of it, the court in such litigation or in a separate suit shall award reasonable costs and\r\nexpenses of litigation, including attorney\'s fees, to the prevailing party or parties.\r\nThis Agreement shall inure to the benefit of Investigator and CCT and all successors and assigns. This\r\nAgreement shall be construed in accordance with, and governed by, the laws of the State of California. Any\r\nlitigation to enforce the terms of this Agreement shall be brought in Orange County, CA and subject the\r\nparties to the jurisdiction of the State of California regardless of the location of Investigator’s residence or\r\noffice.</p>', '2018-04-02 14:14:38', '2018-04-02 14:15:41');
