INSERT INTO `trials` VALUES ('44', '   PPD Pre Award Persistent Post-Traumatic Headache (pPTH) Trial - PTH-001-018   ', '   PPD is seeking sites for a pre award trial in patients with persistent post-traumatic headaches. These patients will likely have had a sports injury, car accident, work-related injury, etc. but the condition is persistent. Please see below for some information regarding the trial. If you are interested, and can confirm access to this patient population, please reply back by 3pm EST on Tuesday, March 27th. \r\n\r\n​\r\n\r\nInclusion Criteria:\r\n\r\n​​Ages 18-70/75\r\nICHD-3 criteria for pPTH\r\n​This includes meeting the criteria for mild TBI\r\n​No more than 12 months have elapsed since the TBI\r\nDuring 28-day baseline period patients must have\r\n &gt; 20 days of diary data recorded\r\n&gt; 8 moderate to severe headache days (defined as a calendar day (00:00 to 23:59) when the patient reports ≥4 continuous hours of a headache, per the patient diary)\r\nEach distinct episode must last &gt; 4 hours\r\n \r\n​A negative breath alcohol test and a negative urine drug screen for any illicit drug at screening\r\nMust be able to comply with study medication administration and adhere to protocol requirements\r\n \r\n\r\nExclusion Criteria:\r\n\r\nDo not exclude patients with continuous HA\r\nExclude:\r\n Active use of botulinum toxin within the past 6 months\r\nRecent peripheral nerve block\r\nPositive urine pregnancy test\r\nGreater than 2 moderate to severe headache days per month prior to the TBI\r\nBeck Depression Score ≥24\r\nPatients involved in litigation related to the TBI\r\nPatients with any acute or chronic medical or psychological condition that could interfere with neuromuscular function\r\nHistory of allergic reaction to DYSPORT or its components\r\nPrevious exposure to CGRP receptor antibodies\r\nHistory of illicit drug or alcohol abuse\r\nDo not test for marijuana use\r\nEquipment used:\r\n\r\n​Laptop\r\neDiary\r\nFridge\r\nThermometer\r\n*EMG will not be used*   ', 'a:1:{i:0;i:39;}', null, '1533081600', '32,44,38,83,', '1', '0', null, '2018-03-26 16:28:27', '2018-05-10 00:38:38', 'BTC', '0');
INSERT INTO `trials` VALUES ('45', 'Dxterity Ongoing Observational Radiation Toxicity and Sensitivity Blood Test - Radiation-001-018', 'Dxterity is seeking individuals to participate in their ongoing observational clinical study that is developing a rapid blood test to predict radiation toxicity and sensitivity to support individualized radiation treatment for cancer patients. They are seeking a site to catch a patient with pelvic cancer prior to radiation and take a finger stick sample.  The initial sample will be collected at the site and 6 months after. The follow up samples in between will be sent directly to the patient and coordinated with the sponsor directly. Please see documents attached for more information! If you are interested in being considered for this opportunity, please respond to this email by 4pm EST on Thursday, March 29th. ', 'a:2:{i:0;i:40;i:1;i:41;}', null, null, '', '0', '0', '1522097365', '2018-03-26 17:06:27', '2018-03-26 20:49:25', 'BTC', '0');
INSERT INTO `trials` VALUES ('46', ' Dxterity Ongoing Observational Radiation Toxicity and Sensitivity Blood Test - Radiation-001-018 ', ' Dxterity is seeking individuals to participate in their ongoing observational clinical study that is developing a rapid blood test to predict radiation toxicity and sensitivity to support individualized radiation treatment for cancer patients. They are seeking a site to catch a patient with pelvic cancer prior to radiation and take a finger stick sample.  The initial sample will be collected at the site and 6 months after. The follow up samples in between will be sent directly to the patient and coordinated with the sponsor directly. Please see documents attached for more information! If you are interested in being considered for this opportunity, please respond to this email by 4pm EST on Thursday, March 29th. \r\n\r\n ', 'a:1:{i:0;i:42;}', null, '', '83,32,38,81,36', '1', '0', null, '2018-03-26 17:21:26', '2018-04-16 20:43:57', 'BTC', '0');
INSERT INTO `trials` VALUES ('47', '   Janssen - Non-interventional Alzheimer\'s Study (Alzheimer\'s-006-018)   ', '   We\'re working with Janssen to identify sites to participate in a small non-interventional trial in patients who have amnestic MCI, Mild AD, or are Cognitively Normal. At this time, Janssen cannot share much information but the next steps will be for them to send an eFQ to sites, which will provide more information about the trial.\r\n\r\n\r\nIf you are interested in learning more about this opportunity, please respond with your PI Name and kindly answer the study questions below before 3pm EST Monday March 26th.\r\n\r\n    ', 'a:5:{i:0;i:43;i:1;i:44;i:2;i:45;i:3;i:46;i:4;i:47;}', null, '1522022400', '44,83', '1', '0', null, '2018-03-26 17:28:20', '2018-04-16 21:21:00', 'BTC', '0');
INSERT INTO `trials` VALUES ('48', '      ICON- Phase 3 Treatment of Subjects with Blepharitis -- Blepharitis-001-018      ', '     <p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"></p><p dir=\"ltr\" style=\"font-size: 12pt; color: rgb(0, 0, 0); font-family: Calibri, Arial, Helvetica, sans-serif;\"></p><p><span style=\"color: rgb(33, 33, 33); font-size: 12pt;\">We\'re working with ICON who is currently seeking sites for a&nbsp;</span><em>Phase 3 Treatment of Subjects with&nbsp;<span class=\"il\">Blepharitis</span>.&nbsp;</em><strong style=\"color: rgb(33, 33, 33); font-size: 12pt;\"><em>For sites to be considered they must have previous experience and be board-certified&nbsp;</em></strong><span lang=\"EN-IE\" style=\"color: rgb(33, 33, 33); font-size: 12pt;\"><strong><em>ophthalmologists along with a Sub-I who is also&nbsp;board-certified.</em></strong></span><br></p><p style=\"color: rgb(33, 33, 33);\"></p><p></p><p class=\"m_3031729611228622257m_5647866998901467498WordSection1\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Study Title:</u></strong>&nbsp;A Phase 3, Multicenter, Randomized, Double-Masked, Parallel-Group, Comparative Study to Evaluate the Clinical Efficacy and Safety of ISV-305 (0.1% Dexamethasone) Compared to Vehicle in the Treatment of Subjects with&nbsp;<span class=\"il\">Blepharitis</span></p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Study Design:</u></strong>&nbsp;Multicenter, randomized, double-masked, parallel-group study to evaluate the efficacy and safety of ISV-305 versus vehicle in subjects with&nbsp;<span class=\"il\">blepharitis</span>.</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Estimated Sample Size:</u></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Approximately 549 subjects with&nbsp;<span class=\"il\">blepharitis</span>&nbsp;will be randomized into the study in a 2:1 ratio:</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>ISV-305:&nbsp; 366 subjects</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Vehicle:&nbsp;&nbsp; 183 subjects</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Study Population:&nbsp;</u></strong>Subjects ≥ 1 year of age with active, symptomatic&nbsp;<span class=\"il\">blepharitis</span>&nbsp;(e.g., flare-up) defined by a minimum combined score of 6 for the following signs and symptom in at least one eye with a minimum score of 2 for eyelid redness and a minimum score of 1 for eyelid irritation.<strong><u></u></strong></p>&nbsp;<p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Eyelid redness</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Eyelid swelling</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Eyelid debris</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Eyelid irritation</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Inclusion Criteria:</u></strong></p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Are ≥ 1 years of age at Screening Visit (Day -10 to Day -7, Visit 1) of either sex and any race.</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Signature of the subject or legally authorized representative on the Informed Consent Form.</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Are willing and able to follow all instructions and attend all study visits.</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Are willing to avoid disallowed medication for the duration of the study.</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>If female is of childbearing potential, agree to and submit a urine sample for pregnancy testing prior to enrollment and use effective contraception for the duration of the study. Post menopausal is defined as having no menses for at least 12 consecutive months.Male subjects whose female partners are not post-menopausal must agree to one of the following: 1) completely abstain from sexual intercourse, 2) use a barrier method (condoms) with spermicide during sexual intercourse during the study, 3) document having had a vasectomy (with documented infertility).</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Exclusion Criteria:</u></strong></p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Have known sensitivity or poor tolerance to any component of the IP.</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Have had eyelid surgery in the study eye within twelve (12) months prior to the Screening visit (Day -10 to -7, Visit 1) or during the study that, in the investigator’s opinion, would interfere with the study parameters.</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Have an acute ocular infection (bacterial, viral or fungal) or active ocular inflammation other than&nbsp;<span class=\"il\">blepharitis</span>&nbsp;in the study eye.</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Have used topical corticosteroid medications or topical ophthalmic solutions that the investigator feels may interfere with the study parameters within 14 days of enrollment. Stable use (greater than one month prior to enrollment of an unchanged dose) of inhaled or nasal corticosteroids, topical dermal steroids (except on the eyelids), or topical antibiotics on the face is allowed.</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Have used any non-diagnostic topical ophthalmic solutions in the study eye including tear substitutes within 2 hours of enrollment.</p><p class=\"m_3031729611228622257m_5647866998901467498MsoListParagraph\">6.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Use of any eye make-up (including lid skin, lid margins, and lashes) during the 2-week dosing period of the study.</p>&nbsp;<p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"></p><p class=\"m_3031729611228622257gmail_signature\"></p><p dir=\"ltr\"></p><p dir=\"ltr\"></p><p dir=\"ltr\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@<wbr>conductclinicaltrials.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1524001370531000&amp;usg=AFQjCNFVNajgG5DmLVfeE0IZx9n3AwgqCA\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.<wbr>conductclinicaltrials.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\"></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p></p><p></p><p></p><p></p><p></p><p class=\"yj6qo\"></p><div class=\"yj6qo\"></div><p></p><br class=\"m_3031729611228622257gmail-Apple-interchange-newline\"><p></p><p class=\"adL\"></p><div class=\"adL\"></div><p></p><p></p><p class=\"adL\"></p><div class=\"adL\"></div><p></p><p></p><p class=\"adL\"></p><div class=\"adL\"></div><p></p><p></p><p class=\"adL\"></p><div class=\"adL\"></div><p></p><p></p>     ', null, null, '', '70,83', '1', '0', null, '2018-03-26 17:50:11', '2018-04-16 22:01:43', 'BTC', '0');
INSERT INTO `trials` VALUES ('49', ' PPD Upcoming Crohn\'s Disease Study - Crohn\'s-003-018 ', ' PPD is working on identifying sites for feasibility of an upcoming Crohn\'s Disease trial. They are specifically targeting PIs with specialties in Gastroenterology or Internal Medicine. There is limited information available at this time, but if you are interested, please respond to the study questions below.\r\n ', 'a:3:{i:0;i:48;i:1;i:49;i:2;i:50;}', null, '', '33,83,', '1', '0', null, '2018-03-26 18:20:08', '2018-04-16 22:27:35', 'BTC', '0');
INSERT INTO `trials` VALUES ('50', '     PreAward Novum  - Narcolepsy-002-018 (Pediatric Study)     ', '  &nbsp;<p><span style=\"background-color: rgb(0, 255, 255); color: rgb(33, 33, 33); font-family: Calibri, sans-serif; font-size: 12pt;\">PI must have experience with this indication.&nbsp;</span></p><p style=\"color: rgb(33, 33, 33);\"></p><p class=\"m_-7929681777698116695m_5199257262585946298WordSection1\"><span style=\"color: rgb(31, 73, 125);\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt;\">We\'re working with Novum on their&nbsp;<span class=\"il\">narcolepsy</span>&nbsp;study. This is a large trial that will be conducted on both adult and pediatric patients.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt;\">Please review the study information below and synopsis attached for more information. If you are interested in being considered for this opportunity, please respond with&nbsp; completed FQ and a signed CDA.</span></p><p class=\"MsoNormal\" style=\"margin-right: 5pt; margin-bottom: 0.0001pt; margin-left: 0in; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><strong><span style=\"font-size: 12pt; line-height: 17.6px; background: yellow;\">&nbsp;</span></strong></p><p class=\"MsoNormal\" style=\"margin-right: 5pt; margin-bottom: 0.0001pt; margin-left: 0in; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><strong><span style=\"font-size: 12pt; line-height: 17.6px; background: yellow;\">Pediatric Study</span></strong><strong><span style=\"font-size: 12pt; line-height: 17.6px;\"></span></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>Study Title:</strong><span style=\"font-size: 12pt;\">&nbsp;A Randomized, Double-blind, Parallel-group, Placebo-controlled study to test the efficacy and safety of test product extended release oral suspension in pediatric patients with&nbsp;<span class=\"il\">Narcolepsy</span>&nbsp;with Cataplexy.<span style=\"letter-spacing: -0.05pt;\"></span></span></p><p class=\"MsoNormal\" style=\"margin-right: 5pt; margin-bottom: 0.0001pt; margin-left: 0in; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Primary Objective:</span></strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">&nbsp;</span><span style=\"font-size: 12pt; line-height: 17.6px;\">To evaluate the therapeutic efficacy and safety of test product extended release oral suspension (Sun Pharmaceutical Industries Limited) compared to placebo in pediatric patients with&nbsp;<span class=\"il\">narcolepsy</span>&nbsp;with cataplexy.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>Abbreviated Inclusion Criteria:</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt;\">1. Patients aged 7 to 17 years, with a primary diagnosis of&nbsp;<span class=\"il\">narcolepsy</span>&nbsp;with cataplexy that ICSD-2 or ICSD-3 criteria, whichever was in effect at the time of the diagnosis OR, diagnosis of Type 1&nbsp;<span class=\"il\">narcolepsy</span>&nbsp;by ICSD-3 criteria (i.e., study participant meets all other ICSD-3 criteria for Type 1&nbsp;<span class=\"il\">narcolepsy</span>) confirmed with a Multiple Sleep Latency Test (MSLT) during screening.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt;\">2. Have given documented assent indicating that he/she was aware of the investigational nature of the study and the required procedures and restrictions before participation in any protocol-related activities.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt;\">3. Have parent(s)/guardian(s) who have given informed consent for his/her/their child\'s participation in the study.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt;\">4. Willing to spend the required number of nights in a sleep laboratory for polysomnogram (PSG) evaluations.</span></p><span style=\"font-size: 12pt;\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>Abbreviated Exclusion Criteria:</strong></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">1. Patient with a history of allergy or sensitivity to ior to any of the excipient(s) of this formulation or history of any drug hypersensitivity or intolerance that, in the opinion of the Investigator that could compromise the safety of the patient or the results of the study.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">2. Inability to understand or follow study instructions for any reason, in the opinion of the Investigator.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">3. Parent(s) or guardian(s) unable to comply with the requirements of the study for any reason, in the opinion of the Investigator.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">4. Other documented clinically significant condition(s) [including any other unstable medical condition(s), chronic disease(s) other than&nbsp;<span class=\"il\">narcolepsy</span>&nbsp;with cataplexy, or history or presence of another neurological disorder] that might affect the patient’s safety and/or interfere with the conduct of the study in the opinion of the Investigator.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">5. Treatment with benzodiazepines, non-benzodiazepine anxiolytics/ hypnotics/sedatives, neuroleptics, opioids, barbiturates, diclofenac, valproate, phenytoin, ethosuximide within 2 weeks prior to enrollment (discontinuation for the purpose of study enrollment is permitted only if considered safe by the Investigator).</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">6. Any use of the following prohibited medications for the duration of the clinical study:</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 48.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; font-family: Symbol; letter-spacing: -0.05pt;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Clonidine</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 48.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; font-family: Symbol; letter-spacing: -0.05pt;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Serotonin-specific reuptake inhibitors (SSRIs) and serotonin and norepinephrine re-uptake inhibitors (SNRIs)</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 48.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; font-family: Symbol; letter-spacing: -0.05pt;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Monamine oxidase inhibitors (MAOIs)</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 48.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; font-family: Symbol; letter-spacing: -0.05pt;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Tricyclic antidepressants (TCAs)</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 48.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; font-family: Symbol; letter-spacing: -0.05pt;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Sedating antihistamines</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 48.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; font-family: Symbol; letter-spacing: -0.05pt;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Other experimental medications designed to treat&nbsp;<span class=\"il\">narcolepsy</span>, cataplexy or any other condition</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 12.95pt; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">7. Unsafe for the subject to receive placebo treatment for 2 weeks, in the opinion of the investigator.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><br></p><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">&nbsp;</span><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\"></span><p style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"></p><p class=\"m_-7929681777698116695gmail_signature\"></p><p dir=\"ltr\"></p><p dir=\"ltr\"></p><p dir=\"ltr\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@<wbr>conductclinicaltrials.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1524005585002000&amp;usg=AFQjCNHGzUIitgOBg3bNskkWgFOMBM9lMQ\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.<wbr>conductclinicaltrials.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\"></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p><font face=\"verdana, sans-serif\" size=\"2\"><br></font></p><p></p><p></p><p></p><p></p><p></p><p class=\"yj6qo\" style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"></p><div class=\"yj6qo\" style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"></div><p></p><p></p><p></p>  ', 'a:1:{i:0;i:51;}', null, '', '32', '1', '1', null, '2018-03-26 18:42:07', '2018-05-01 18:08:17', 'BTC', '0');
INSERT INTO `trials` VALUES ('51', '   PreAward Novum - Narcolepsy-002-018 (Adult Study)   ', '  <p> working with Novum on their narcolepsy study. This is a large trial that will be conducted on both adult and pediatric patients.\r\n\r\nPlease review the study information below and synopsis attached for more information. If you are interested in being considered for this opportunity, please respond with  completed questionnaire and signed CDA. </p><br><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt; background: yellow;\">Adult Study</span></strong><strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\"></span></strong></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Study Title:&nbsp;</span></strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">A Multicentric, Randomized, Double Blind, Parallel-group, Placebo-controlled study to test the efficacy and safety of test product for extended release oral suspension for treatment of cataplexy in narcolepsy and excessive daytime sleepiness (EDS)</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Primary Objective</span></strong></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">To evaluate the efficacy and safety of test product for extended release oral suspension for treatment of cataplexy in narcolepsy and excessive daytime sleepiness (EDS)</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Abbreviated Inclusion Criteria</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">&nbsp;</span></strong></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Inclusion Criteria</span></strong></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">1. Male or female subjects 18 years of age or older.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">2. Willing and able to give written informed consent for study participation.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">3. Subjects with a documented evidence of a diagnosis of NT1 or NT2 as, in part, determined by an overnight polysomnography (PSG) and next-day multiple sleep latency test (MSLT) with 2 or more sleep-onset rapid eye movement periods (SOREMPs) with mean sleep latency in the pathological range i.e. &lt; 8 minutes and meeting the NT1 and NT2 as defined by the International Classification of Sleep Disorders -3 criteria (ICSD-3).</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">4. Current continuing presence of EDS as defined by subject report for the last 3 months and an Epworth Sleepiness Scale (ESS) &gt; 10</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">5. For NT1 only, current continuing presence of cataplexy as defined by subject report for the last 3 months</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">6. Subjects may use concomitant stimulants, but must comply with the following:</span></p><ul type=\"disc\" style=\"margin-bottom: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Subjects must be on a stable dose of stimulants for at least 3 weeks prior to starting the screening process for this study; and</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Subjects must use the same stimulant regimen throughout the entire study period, including during screening and post-treatment periods.</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Subjects must discontinue all anti-cataplexy drugs.</span></li></ul><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><strong><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Abbreviated Exclusion Criteria</span></strong></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">1. Patient has a history of allergy or sensitivity to study drugor to any excipient(s) of this formulation or history of any drug hypersensitivity or intolerance that, in the opinion of the Investigator, would compromise the safety of the patient or the results of the study.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">2. Any prior use of sodium oxybate.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">3. Current use of sodium valproate.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">4. Any use of the following prohibited medications for the duration of the clinical study:</span></p><ul type=\"disc\" style=\"margin-bottom: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Anticonvulsants</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Clonidine</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Serotonin-specific reuptake inhibitors (SSRIs) and serotonin and norepinephrine re-uptake inhibitors (SNRIs)</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Monamine oxidase inhibitors (MAOIs)</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Tricyclic antidepressants (TCAs)</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Hypnotics</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Anxiolytics</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Sedating antihistamines</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Antipsychotics</span></li><li class=\"MsoNormal\" style=\"margin: 3.7pt 12.45pt 0px 15px; text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">Other experimental medications designed to treat narcolepsy, cataplexy or any other condition</span></li></ul><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">5. Treatment with any investigational products&nbsp;<span class=\"aBn\" data-term=\"goog_364549190\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 3 months</span></span>&nbsp;before study enrolment.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">6. Any drug known to affect sleep-wake function. Concomitant stimulant use is permitted.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12.45pt; margin-bottom: 0.0001pt; margin-left: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255); text-align: justify; line-height: 17.6px;\"><span style=\"font-size: 12pt; line-height: 17.6px; letter-spacing: -0.05pt;\">7. Other documented clinically significant condition(s) (including an unstable medical condition, chronic disease other than narcolepsy with cataplexy, or history or presence of another neurological disorder) that might affect the subject\'s safety and/or interfere with the conduct of the study</span></p>  ', null, null, '', '56', '1', '1', null, '2018-03-26 18:45:18', '2018-05-01 18:04:45', 'BTC', '0');
INSERT INTO `trials` VALUES ('52', 'PPD Awarded Study: BC#80447-01/03 MS with Walking Impairment', 'Please see attached blinded synopsis and if interested respond to the questions for submission.', 'a:7:{i:0;i:55;i:1;i:56;i:2;i:57;i:3;i:58;i:4;i:59;i:5;i:60;i:6;i:61;}', null, '1522281600', '44,83', '0', '0', '1522170938', '2018-03-27 16:56:19', '2018-03-27 17:15:38', 'CCT BD - Ron', '0');
INSERT INTO `trials` VALUES ('53', '   PPD Awarded Study: BC#80447-01/03 MS with Walking Impairment   ', '  Please see attached synopsis and if interested reply with the study questions below.  ', 'a:4:{i:0;i:62;i:1;i:63;i:2;i:64;i:3;i:65;}', 'a:1:{i:0;i:18;}', '1522281600', '44,83', '1', '0', null, '2018-03-27 17:23:00', '2018-04-16 23:56:09', 'CCT BD - Ron', '0');
INSERT INTO `trials` VALUES ('54', '  Aldeyra - Phase 3 Non-infectious Anterior-uveitis  ', ' <p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"></p><p dir=\"ltr\" style=\"font-size: 12pt; color: rgb(0, 0, 0); font-family: Calibri, Arial, Helvetica, sans-serif;\"></p><p style=\"color: rgb(33, 33, 33);\"></p><p class=\"m_6251584436960019361m_8989924946417963867WordSection1\"></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span class=\"il\">Aldeyra</span>&nbsp;Therapeutics is seeking additional sites for a&nbsp;<span class=\"il\">Phase</span>&nbsp;III&nbsp;<span class=\"il\">Non</span>-<span class=\"il\">infectious</span>&nbsp;<span class=\"il\">Anterior</span>-<span class=\"il\">Uveitis</span>&nbsp;Study.&nbsp; Please see the details below, as well as on&nbsp;<a href=\"http://clinicaltrials.gov/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://clinicaltrials.gov&amp;source=gmail&amp;ust=1524009522744000&amp;usg=AFQjCNGYkrydYcJAU7Dq35tU4dPa9KQtng\" style=\"color: rgb(17, 85, 204); background-color: rgb(255, 255, 255);\">clinicaltrials.gov</a>, and if you are interest in participating please answer the study questions below and provide any appropriate metrics from previous trials in this indication<span style=\"background-color: rgb(255, 255, 0);\">.</span></p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"background: yellow;\">Study questions:</span></strong></p><p class=\"m_6251584436960019361m_8989924946417963867MsoListParagraph\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>How many previous&nbsp;<span class=\"il\">non</span>-<span class=\"il\">infectious</span>&nbsp;<span class=\"il\">anterior</span>-<span class=\"il\">uveitis</span>&nbsp;trials have you conducted?</p><p class=\"m_6251584436960019361m_8989924946417963867MsoListParagraph\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>How many patients with this indication do you have access to?</p><p class=\"m_6251584436960019361m_8989924946417963867MsoListParagraph\"><span class=\"il\">3</span>.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Previous metrics:</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><a href=\"https://clinicaltrials.gov/ct2/show/study/NCT03131154?term=aldeyra&amp;rank=4#locn\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://clinicaltrials.gov/ct2/show/study/NCT03131154?term%3Daldeyra%26rank%3D4%23locn&amp;source=gmail&amp;ust=1524009522744000&amp;usg=AFQjCNFAfOL9bc6k9RHhwuBlss_Lup3tFw\" style=\"color: rgb(17, 85, 204);\">https://clinicaltrials.gov/ct2<wbr>/show/study/NCT03131154?term=<wbr><span class=\"il\">aldeyra</span>&amp;rank=4#locn</a></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Official Title:&nbsp;</strong>A&nbsp;<span class=\"il\">Phase</span>&nbsp;<span class=\"il\">3</span>, Randomized, Double-masked, Vehicle-controlled Trial to Evaluate the Safety and Efficacy of ADX-102 Ophthalmic Solution in Subjects with&nbsp;<span class=\"il\">Non</span>-<span class=\"il\">infectious</span>&nbsp;<span class=\"il\">Anterior</span>-<span class=\"il\">uveitis</span>.</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Estimated Enrollment:&nbsp;</strong>100 Participants</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Study Start Date:&nbsp;</strong>April 26, 2018</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Estimated Completion date:&nbsp;</strong>December 2018</p>&nbsp;<p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-right: 0in; margin-bottom: 6pt; margin-left: 0in;\"><strong><span style=\"color: black;\">Inclusion Criteria:</span></strong></p><p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-right: 0in; margin-bottom: 3pt; margin-left: 12pt;\"><span style=\"font-size: 10pt; font-family: Symbol; color: black;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black;\">Male or female subjects aged ≥ 18 years and ≤ 85 years.</span></p><p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-right: 0in; margin-bottom: 3pt; margin-left: 12pt;\"><span style=\"font-size: 10pt; font-family: Symbol; color: black;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black;\">Subjects with acute&nbsp;<span class=\"il\">non</span>-<span class=\"il\">infectious</span>&nbsp;<span class=\"il\">anterior</span>&nbsp;<span class=\"il\">uveitis</span>&nbsp;with onset of symptoms within the previous 2 weeks.</span></p><p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-right: 0in; margin-bottom: 3pt; margin-left: 12pt;\"><span style=\"font-size: 10pt; font-family: Symbol; color: black;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black;\">Best corrected visual acuity (BCVA) better than or equal to 35 letters in the study eye and 65 letters in the&nbsp;<span class=\"il\">non</span>-study eye using ETDRS testing.</span></p><p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-bottom: 6pt;\"><strong><span style=\"color: black;\">Exclusion Criteria:</span></strong></p><p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-right: 0in; margin-bottom: 3pt; margin-left: 12pt;\"><span style=\"font-size: 10pt; font-family: Symbol; color: black;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black;\">Have severe/serious ocular pathology in the study eye(s) which may preclude study completion, in the judgement of the Investigator.</span></p><p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-right: 0in; margin-bottom: 3pt; margin-left: 12pt;\"><span style=\"font-size: 10pt; font-family: Symbol; color: black;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black;\">Active intermediate or posterior&nbsp;<span class=\"il\">uveitis</span>&nbsp;in the study eye(s).</span></p><p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-right: 0in; margin-bottom: 3pt; margin-left: 12pt;\"><span style=\"font-size: 10pt; font-family: Symbol; color: black;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black;\">Previous&nbsp;<span class=\"il\">anterior</span>&nbsp;<span class=\"il\">uveitis</span>&nbsp;episode in the study eye ≤ 4 weeks prior to screening.</span></p><p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-right: 0in; margin-bottom: 3pt; margin-left: 12pt;\"><span style=\"font-size: 10pt; font-family: Symbol; color: black;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black;\">Have participated in another investigational device or drug study within 30 days prior to screening.</span></p><p class=\"m_6251584436960019361m_8989924946417963867MsoNormalCxSpMiddle\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-right: 0in; margin-bottom: 3pt; margin-left: 12pt;\"><span style=\"font-size: 10pt; font-family: Symbol; color: black;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"color: black;\">Participation in a prior ADX-102 study.</span></p>&nbsp;<p></p><p></p><p></p><p></p><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@<wbr>conductclinicaltrials.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1524009522744000&amp;usg=AFQjCNG5Jy9dAYlIceMrIpBHFFwtOnvRkA\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.<wbr>conductclinicaltrials.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; background-color: rgb(255, 255, 255);\"></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p><font face=\"verdana, sans-serif\" size=\"2\"><br></font></p><p></p><p class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"></p><div class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"></div><p></p> ', 'a:3:{i:0;i:66;i:1;i:67;i:2;i:68;}', null, '', '70,83', '1', '0', null, '2018-03-27 17:28:27', '2018-04-17 00:00:02', 'BTC', '0');
INSERT INTO `trials` VALUES ('55', '    Sanofi Upcoming Pediatric Meningitis Vaccine - Meningitis-001-018    ', ' <p style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(33, 33, 33); font-family: Calibri, sans-serif; font-size: 11pt;\">Good morning!</span><br></p><p dir=\"ltr\" style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 12pt; background-color: rgb(255, 255, 255);\"></p><p dir=\"ltr\" style=\"font-size: 12pt;\"></p><p style=\"color: rgb(33, 33, 33);\"></p><p class=\"m_-4753040868525554747WordSection1\">&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-family: Calibri, sans-serif; font-size: 14.6667px;\">Sanofi Pasteur is working on a quadrivalent meningococcal conjugate pediatric&nbsp;vaccine Phase III program and is in the process of identifying potential study sites. This program will evaluate the safety and immunogenicity of this vaccine in the prevention of Invasive Meningococcal Disease.</span>&nbsp;&nbsp;If you are interested in learning more about this exciting opportunity.</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Link to survey:&nbsp;<a href=\"https://www.surveymonkey.com/r/MET41\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://www.surveymonkey.com/r/MET41&amp;source=gmail&amp;ust=1524009865340000&amp;usg=AFQjCNHwF-dss3wAAfYO6UgaJPQHSYczFQ\" style=\"color: rgb(17, 85, 204);\">https://www.surveymonkey.com/<wbr>r/MET41</a></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Please confirm once link is complete.</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">​</p><p></p><p></p><p></p><p></p> ', 'a:2:{i:0;i:69;i:1;i:70;}', null, '', '54,83,32', '1', '0', null, '2018-03-27 17:36:26', '2018-04-17 00:11:51', 'BTC', '0');
INSERT INTO `trials` VALUES ('56', '   Rexahn Pharmaceuticals_Upcoming Triple Negative Breast Cancer Study  -Breast Cancer-001-018', '  <p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\">Rexahn Pharmaceuticals. We’d like to inform you of an a Phase 1 Multi-Center, Dose Finding, Open Label, Study of RX-5902 in Subjects with Advanced or Metastatic Solid Tumors, currently recruiting sites for&nbsp;<span class=\"il\">Triple</span>&nbsp;<span class=\"il\">Negative</span>&nbsp;<span class=\"il\">Breast</span><span class=\"il\">Cancer</span>&nbsp;(TNBC). As you may be aware, RX-5902 is currently in development as an oral anticancer agent, which targets the phosphorylated p68 RNA helicase, locking the nuclear translocation of β-catenin and&nbsp; subsequently inhibiting DNA and RNA synthesis, thereby&nbsp; leading to&nbsp;<span class=\"il\">cancer</span>cell death.&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\">&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 0.5in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 10.5pt; font-family: Wingdings; color: rgb(68, 68, 68);\">ü</span><span style=\"font-size: 7pt; color: rgb(68, 68, 68);\">&nbsp;&nbsp;</span>For more information regarding RX-5902 &nbsp;please find the following resources:<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 0.5in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 10.5pt; font-family: Helvetica, sans-serif; color: rgb(68, 68, 68);\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 1in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 10.5pt; font-family: \" courier=\"\" new\";=\"\" color:=\"\" rgb(68,=\"\" 68,=\"\" 68);\"=\"\">o</span><span style=\"font-size: 7pt; color: rgb(68, 68, 68);\">&nbsp;&nbsp;&nbsp;&nbsp;</span>The attached ESMO abstract, which overviews the activation pathway for RX-5902<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\">&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 1in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: \" courier=\"\" new\";\"=\"\">o</span><span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;</span>A link to an overview of Rexahn’s development RX-5902:&nbsp;<a href=\"https://urldefense.proofpoint.com/v2/url?u=https-3A__rexahn.com_cms_portfolio_rx-2D5902_&amp;d=DwMFaQ&amp;c=QDAGguV2Ep0jBgIJ8rwZP5LLaDgQ632cwswS2BKiO6k&amp;r=yHrwXlHlAf1EWI8494lbfMI4tj7Ll0GOmn5Qhih8OrI&amp;m=iu8OzcfNwLjZah-sH6O2ULu-xFWk2xwgGIgMu0UXNW4&amp;s=-ru5xUiJpY60hqtBhyGyrUC2T1LH_X5l5dD6T3oz2wc&amp;e=\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://urldefense.proofpoint.com/v2/url?u%3Dhttps-3A__rexahn.com_cms_portfolio_rx-2D5902_%26d%3DDwMFaQ%26c%3DQDAGguV2Ep0jBgIJ8rwZP5LLaDgQ632cwswS2BKiO6k%26r%3DyHrwXlHlAf1EWI8494lbfMI4tj7Ll0GOmn5Qhih8OrI%26m%3Diu8OzcfNwLjZah-sH6O2ULu-xFWk2xwgGIgMu0UXNW4%26s%3D-ru5xUiJpY60hqtBhyGyrUC2T1LH_X5l5dD6T3oz2wc%26e%3D&amp;source=gmail&amp;ust=1524081695791000&amp;usg=AFQjCNEA7U5HMj87iv7sWSR8MEdfdts_vQ\" style=\"color: rgb(17, 85, 204);\">https://rexahn.com/cms/<wbr>portfolio/rx-5902/</a><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 0.5in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\">&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 1in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: \" courier=\"\" new\";\"=\"\">o</span><span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;</span>A study overview, as posted to Clinicaltrials.org:&nbsp;<a href=\"https://urldefense.proofpoint.com/v2/url?u=https-3A__clinicaltrials.gov_ct2_show_NCT02003092-3Fterm-3DRX-2D5902-26rank-3D1&amp;d=DwMFaQ&amp;c=QDAGguV2Ep0jBgIJ8rwZP5LLaDgQ632cwswS2BKiO6k&amp;r=yHrwXlHlAf1EWI8494lbfMI4tj7Ll0GOmn5Qhih8OrI&amp;m=iu8OzcfNwLjZah-sH6O2ULu-xFWk2xwgGIgMu0UXNW4&amp;s=0q5ngrjYH1qQPgUz58ZfdGenBNC0qheDjXcekCJYde8&amp;e=\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://urldefense.proofpoint.com/v2/url?u%3Dhttps-3A__clinicaltrials.gov_ct2_show_NCT02003092-3Fterm-3DRX-2D5902-26rank-3D1%26d%3DDwMFaQ%26c%3DQDAGguV2Ep0jBgIJ8rwZP5LLaDgQ632cwswS2BKiO6k%26r%3DyHrwXlHlAf1EWI8494lbfMI4tj7Ll0GOmn5Qhih8OrI%26m%3Diu8OzcfNwLjZah-sH6O2ULu-xFWk2xwgGIgMu0UXNW4%26s%3D0q5ngrjYH1qQPgUz58ZfdGenBNC0qheDjXcekCJYde8%26e%3D&amp;source=gmail&amp;ust=1524081695791000&amp;usg=AFQjCNEaXdlpffOnRnpIlY508kjo5uwqmg\" style=\"color: rgb(17, 85, 204);\">https://clinicaltrials.gov/<wbr>ct2/show/NCT02003092?term=RX-<wbr>5902&amp;rank=1</a><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"><br></p>  ', 'a:7:{i:0;i:71;i:1;i:72;i:2;i:73;i:3;i:74;i:4;i:75;i:5;i:76;i:6;i:77;}', null, '', '81,38,46,83', '1', '1', null, '2018-03-29 17:37:43', '2018-05-01 17:17:29', 'CCT BD - Shilo', '0');
INSERT INTO `trials` VALUES ('57', 'Vanda- Phase 2 Relieving Symptoms of Gastroparesis - gastroparesis-001-017', '<p id=\":3hn\" class=\"ii gt \" style=\"font-size: 12.8px; direction: ltr; margin: 5px 15px 0px 0px; padding-bottom: 5px; position: relative; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"><p id=\":3fm\" class=\"a3s aXjCH m1626e780a37da0ae\" style=\"overflow: hidden;\"><p dir=\"ltr\"><p class=\"gmail_quote\"><p dir=\"ltr\" style=\"font-size: 12pt; color: rgb(0, 0, 0); font-family: Calibri, Arial, Helvetica, sans-serif;\"><p><span style=\"color: rgb(33, 33, 33); font-size: 12pt;\">STILL LOOKING FOR SITES!!!</span></p><p><span style=\"color: rgb(33, 33, 33); font-size: 12pt;\">Vanda Pharmaceuticals is looking to add a few additional sites to their Ongoing Phase 2 Gastroparesis Study that they are running with Medpace as the CRO. The study team is looking for sites that are specifically focused and specialized in gastroenterology. Please review the information provided below.</span><br></p><p style=\"color: rgb(33, 33, 33);\"><p><p class=\"m_-36495403288620682m_-7984671080711077333WordSection1\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><em>&nbsp;</em></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Please see study information listed below or&nbsp;<a href=\"http://clincialtrials.gov/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://clincialtrials.gov&amp;source=gmail&amp;ust=1522435052875000&amp;usg=AFQjCNEoeM0N634ZAEAP_U8cuRpSsnJdfw\" style=\"color: rgb(17, 85, 204);\">clincialtrials.gov</a>&nbsp;link below for further information. If you are interested in pursuing this this study, please&nbsp;<strong><span style=\"color: red; background: yellow;\">reply back with interest by COB Friday 3/30.</span></strong><span style=\"color: red;\">&nbsp;</span>Feel free to reach out with any questions.</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Study Title:&nbsp;</u></strong>A Multicenter, Randomized, Double-Blind, Placebo-Controlled Proof of Concept Study to Assess the Efficacy of VLY-686 (Tradipitant) in Relieving Symptoms of Gastroparesis</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Inclusion Criteria:</u></strong></p>&nbsp;<ol start=\"1\" type=\"1\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Diagnosed with gastroparesis;</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Subjects must agree to the use of contraception</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Ability and acceptance to provide written informed consent;</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Willing to participate in the pharmacogenomics sample collection;</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Willing and able to comply with all study requirements and restrictions</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Willing to not participate in any other interventional trial for the duration of their participation.</span></li></ol>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Exclusion Criteria:</u></strong></p>&nbsp;<ol start=\"1\" type=\"1\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Another active disorder or treatment which could explain or contribute to symptoms in the opinion of the Investigator (including but not limited to gastric malignancy, neurological disorder, or heavy doses of strong anticholinergics);</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Pregnancy or nursing;</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">History of intolerance and/or hypersensitivity to medications similar to VLY-686 (Tradipitant) and its accompanying excipients;</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Use of another NK1 antagonist or palonosetron;</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Exposure to any investigational medication, including placebo, within 60 days of the Baseline Visit;</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN\">Any other reason as determined by the Investigator which may lead to an unfavorable risk-benefit of study participation, may interfere with study compliance, or may confound study results.</span></li></ol><span lang=\"EN\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u><span lang=\"EN\">Clinical Trials Link:</span></u></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span lang=\"EN\"><a href=\"https://clinicaltrials.gov/ct2/show/NCT02970968?term=Vanda+Pharmaceuticals&amp;recrs=a&amp;rank=4\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://clinicaltrials.gov/ct2/show/NCT02970968?term%3DVanda%2BPharmaceuticals%26recrs%3Da%26rank%3D4&amp;source=gmail&amp;ust=1522435052876000&amp;usg=AFQjCNEAsF_WlExbOhziV91agTlSomhmQQ\" style=\"color: rgb(17, 85, 204);\">https://clinicaltrials.gov/ct2<wbr>/show/NCT02970968?term=Vanda+<wbr>Pharmaceuticals&amp;recrs=a&amp;rank=4</a></span></p>&nbsp;<p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T:&nbsp;<a href=\"tel:(888)%20635-0552\" value=\"+18886350552\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">888-635-0552</a>&nbsp;- F:&nbsp;<a href=\"tel:(888)%20979-8260\" value=\"+18889798260\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">888-979-8260</a>&nbsp;- M:&nbsp;<a href=\"tel:(702)%20720-7323\" value=\"+17027207323\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">702-720-7323</a></span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@<wbr>conductclinicaltrials.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1522435052876000&amp;usg=AFQjCNEilRjelaHe-jnS8HXRn_y2-LC3rw\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.<wbr>conductclinicaltrials.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number&nbsp;<a href=\"tel:(702)%20720-7323\" value=\"+17027207323\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">702-720-7323</a></span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p></p><p class=\"yj6qo\"><div class=\"yj6qo\"></div></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><br></p><p class=\"adL\"><div class=\"adL\"></div></p></p></p><p class=\"hq gt\" id=\":3zm\" style=\"margin: 15px 0px; clear: both; font-size: 12.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"><div class=\"hq gt\" id=\":3zm\" style=\"margin: 15px 0px; clear: both; font-size: 12.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"></div></p>', null, null, null, '33,83,38', '0', '1', '1522351521', '2018-03-29 18:58:21', '2018-03-29 19:25:21', 'BTC', '0');
