ifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p></p><p></p><p></p>   ', null, 'a:2:{i:0;i:58;i:1;i:59;}', '', '33,83,38', '1', '1', null, '2018-03-29 19:28:02', '2018-04-24 18:01:18', 'BTC', '0');
