INSERT INTO `trials` VALUES ('64', 'Pfizer - Phase 2 Pneumococcal Conjugate Vaccine in Healthy Infants -- Ped Vaccine-001-018', 'Pfizer is seeking sites for their Phase 2 pneumococcal conjugate vaccine in healthy infants. They are looking for pediatricians with access to their own patient population. PIs also need to have conducted prior infant vaccine studies. If you are interested in being included in the feasibility process, please respond to the below questions by Wednesday 3pm EST, 4/4.\r\n\r\n \r\n\r\nProtocol Title: A Phase 2, Randomized, Open-Label Trial To Evaluate the Safety and Immunogenicity of a Multivalent Pneumococcal Conjugate  Vaccine Given With, or Separately From, 13-valent Pneumococcal Conjugate Vaccine in Healthy Infants\r\n\r\n \r\n\r\nStudy Design Summary:  The purpose of this Phase 2 study is to describe the safety and immunogenicity of c7vPnC to inform further clinical development of c7vPnC in pediatric populations.  A target of 690 healthy infants 2 months of age will be randomized (1:1:1) to:\r\n\r\n·         c7vPnC coadministered with Prevnar 13 in infants at 2, 4, 6, and 12 months of age (Coadministration),\r\n\r\n·         c7vPnC given 1 month after Prevnar 13 at 3, 5, 7, and 13 months of age (Staggered),\r\n\r\n·         c7vPnC administered at 13 months of age, after a full 4-dose series of Prevnar 13 at 2, 4, 6, and 12 months of age (Control and Supplemental Dose group)\r\n\r\n \r\n\r\nInclusion Criteria\r\n\r\n·         Subjects whose legally acceptable representative is willing and able to comply with scheduled visits, treatment plan, laboratory tests, and other study procedures.\r\n\r\n·         Male or female infant born at >36 weeks of gestation and aged 2 months (42 to 98 days) at the time of consent (the day of birth is considered day of life 1).\r\n\r\n·         Healthy infant determined by medical history, physical examination, and clinical judgment.\r\n\r\n·         Expected to be available for the duration of the study and whose legally acceptable representative can be contacted by telephone during study participation.\r\n\r\n \r\n\r\nExclusion Criteria\r\n\r\n·         Subjects who are direct descendants (child or grandchild) of: investigational site staff members directly involved in the conduct of the study; site staff members otherwise supervised by the investigator; or Pfizer employees directly involved in the conduct of the study.\r\n\r\n·         Previous vaccination with licensed or investigational pneumococcal vaccine.\r\n\r\n·         Prior receipt of routine pediatric vaccines, with the exception of hepatitis B vaccine.\r\n\r\n·         Previous receipt of >1 dose of hepatitis B vaccine.\r\n\r\n·         Prior hepatitis B vaccine must have been administered at age <30 days.\r\n\r\n ', 'a:3:{i:0;i:78;i:1;i:79;i:2;i:80;}', null, null, '54,83,32', '1', '0', null, '2018-04-02 15:56:13', '2018-04-02 15:56:13', 'BTC', '0');
INSERT INTO `trials` VALUES ('65', ' Roche- Phase III Pediatric Influenza - influenza-003-018 ', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt;\">Genentech/Hoffman La Roche is looking to identify sites for a Phase III Pediatric&nbsp;<span class=\"il\">Influenza</span>&nbsp;Study.&nbsp; Information included below. If you are interested in learning more about this exciting opportunity, please respond by&nbsp;<strong><span style=\"background: yellow;\">COB&nbsp;<span class=\"aBn\" data-term=\"goog_1484145751\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Wednesday, 4/4</span></span></span><span style=\"color: black;\"></span></strong></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><strong><span style=\"color: rgb(31, 73, 125);\">&nbsp;</span></strong></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><strong><span style=\"font-size: 12pt;\">Study Design</span></strong></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt;\">This is a multicenter, randomized, double-blind, active-controlled (i.e., oseltamivir) study to assess the safety, pharmacokinetics, and efficacy of baloxavir marboxil compared with oseltamivir in pediatric patients 1 to &lt;12 years of age with&nbsp;<span class=\"il\">influenza</span>-like symptoms.</span></p><span style=\"font-size: 12pt;\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><strong><span style=\"font-size: 12pt;\">Objectives</span></strong></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt;\">To compare the safety of a single dose of baloxavir marboxil with 5 days of oseltamivir administered twice daily.</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><strong><span style=\"font-size: 12pt;\">&nbsp;</span></strong></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><strong><span style=\"font-size: 12pt;\">Abbreviated Inclusion Criteria:</span></strong></p><p class=\"m_3863765542694866523Default\" style=\"margin: 0in 0in 0.15pt; font-size: 12pt; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif;\"><span style=\"font-family: Calibri, sans-serif;\">• Written informed consent/assent for study participation obtained from patient’s parents or legal guardian, with assent as appropriate by the patient, depending on the patient’s level of understanding</span></p><p class=\"m_3863765542694866523Default\" style=\"margin: 0in 0in 0.15pt; font-size: 12pt; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif;\"><span style=\"font-family: Calibri, sans-serif;\">• Aged 1 to &lt;12 years at randomization (Day 1)</span></p><p class=\"m_3863765542694866523Default\" style=\"margin: 0in 0in 0.15pt; font-size: 12pt; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif;\"><span style=\"font-family: Calibri, sans-serif;\">• Parent/guardian willing and able to comply with study requirements, in the investigator’s judgment</span></p><p class=\"m_3863765542694866523Default\" style=\"margin: 0in 0in 0.15pt; font-size: 12pt; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif;\"><span style=\"font-family: Calibri, sans-serif;\">• Patient able to comply with study requirements, depending on the patient’s level of understanding</span></p><p class=\"m_3863765542694866523Default\" style=\"margin: 0in 0in 0.15pt; font-size: 12pt; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif;\"><span style=\"font-family: Calibri, sans-serif;\">• Patient with a diagnosis of&nbsp;<span class=\"il\">influenza</span>&nbsp;virus infection confirmed by the presence of all of the following:</span></p><p class=\"m_3863765542694866523Default\" style=\"margin: 0in 0in 0.15pt; font-size: 12pt; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; text-indent: 0.5in;\"><span style=\"font-family: Calibri, sans-serif;\">− Fever ≥38°C (tympanic temperature) at screening</span></p><p class=\"m_3863765542694866523Default\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif; text-indent: 0.5in;\"><span style=\"font-family: Calibri, sans-serif;\">− At least one respiratory symptom (either cough or nasal congestion)</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• The time interval between the onset of symptoms and screening is ≤48 hours (the onset of symptoms is defined as the time when body temperature first exceeded 37.5ºC if known, or the time when the first symptom was noticed by patient, parent or caregiver)</span></p><span style=\"font-family: Calibri, sans-serif;\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><strong><span style=\"font-size: 12pt;\">Abbreviated Exclusion Criteria:</span></strong></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Severe symptoms of&nbsp;<span class=\"il\">influenza</span>&nbsp;virus infection requiring inpatient treatment</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Concurrent infections requiring systemic antiviral therapy at screening</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Require, in the opinion of the investigator, any of the prohibited medication during the study</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Previous treatment with peramivir, laninamivir, oseltamivir, zanamivir, or amantadine&nbsp;<span class=\"aBn\" data-term=\"goog_1484145752\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 2 weeks</span></span>&nbsp;prior to screening</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Immunization with a live/attenuated&nbsp;<span class=\"il\">influenza</span>&nbsp;vaccine in the 2 weeks prior to randomization</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Concomitant treatment with steroids or other immuno-suppressant therapy</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Known HIV infection or other immunosuppressive disorder</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Uncontrolled renal, vascular, neurologic, or metabolic disease (e.g., diabetes, thyroid disorders, adrenal disease), hepatitis, cirrhosis, or pulmonary disease or patients with known chronic renal failure</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Active cancer at any site</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• History of organ transplantation</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Known allergy to either study drug (i.e., baloxavir marboxil and oseltamivir) or to acetaminophen</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.15pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Females who have commenced menarche (i.e., child-bearing potential)</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-size: 12pt; color: black;\">• Participation in a clinical trial&nbsp;<span class=\"aBn\" data-term=\"goog_1484145753\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 4 weeks</span></span>&nbsp;or 5 half-lives of exposure to an investigational drug prior to screening</span><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: black;\"></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 8pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><strong><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: black;\">&nbsp;</span></strong></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 8pt; background-color: rgb(255, 255, 255); font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><strong><span style=\"font-size: 12pt;\">Study Duration - 9 Months</span></strong></p>', 'a:1:{i:0;i:81;}', null, '', '54,83,32', '1', '0', null, '2018-04-02 15:59:32', '2018-04-03 23:01:02', 'BTC', '0');
INSERT INTO `trials` VALUES ('66', '       Roche- Phase III Pediatric Influenza -- influenza-004-018       ', '      <p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt;\">Genentech/Hoffman La Roche is looking to identify sites for a Phase III Pediatric&nbsp;<span class=\"il\">Influenza</span>&nbsp;Study.&nbsp; Information included below. If you are interested in learning more about this exciting opportunity, please respond by&nbsp;<strong><span style=\"background: yellow;\">COB&nbsp;<span class=\"aBn\" data-term=\"goog_1484145747\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Wednesday, 4/4</span></span></span><span style=\"color: black;\"></span></strong></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>Study Design</strong></p><p class=\"m_-4746968795897844313Default\" style=\"margin: 0in 0in 0.0001pt; font-size: 16px; font-family: Arial, sans-serif; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Calibri, sans-serif;\">This is a multicenter, single-arm, open-label study to assess the safety, pharmacokinetics, and efficacy of baloxavir marboxil in otherwise healthy pediatric patients from birth to &lt;1 year with&nbsp;<span class=\"il\">influenza</span>-like symptoms.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt;\">This study is designed to enroll 20 otherwise healthy male and female pediatric patients with&nbsp;<span class=\"il\">influenza</span>-like symptoms presenting&nbsp;<span class=\"aBn\" data-term=\"goog_1484145748\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 96 hours</span></span>&nbsp;of symptom onset.</span><span style=\"font-size: 12pt;\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>Objectives</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt;\">To evaluate the safety of a single dose of baloxavir marboxil</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>Abbreviated Inclusion Criteria:</strong></p><p class=\"m_-4746968795897844313Default\" style=\"margin: 0in 0in 0.0001pt; font-size: 16px; font-family: Arial, sans-serif; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Calibri, sans-serif;\">Patients must meet the following criteria for study entry:</span></p><p class=\"m_-4746968795897844313Default\" style=\"margin: 0in 0in 0.15pt; font-size: 16px; font-family: Arial, sans-serif; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Calibri, sans-serif;\">• Written informed consent for study participation obtained from patient’s parents or legal guardian</span></p><p class=\"m_-4746968795897844313Default\" style=\"margin: 0in 0in 0.15pt; font-size: 16px; font-family: Arial, sans-serif; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Calibri, sans-serif;\">• Age from birth to &lt;1 year at screening</span></p><p class=\"m_-4746968795897844313Default\" style=\"margin: 0in 0in 0.15pt; font-size: 16px; font-family: Arial, sans-serif; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Calibri, sans-serif;\">• Parent/guardian willing and able to comply with study requirements, in the investigator’s judgment</span></p><p class=\"m_-4746968795897844313Default\" style=\"margin: 0in 0in 0.15pt; font-size: 16px; font-family: Arial, sans-serif; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Calibri, sans-serif;\">• Patients with a diagnosis of&nbsp;<span class=\"il\">influenza</span>&nbsp;virus infection confirmed by the presence of all of the following:</span></p><p class=\"m_-4746968795897844313Default\" style=\"margin: 0in 0in 0.15pt; font-size: 16px; font-family: Arial, sans-serif; background-color: rgb(255, 255, 255);\"><strong><span style=\"font-family: Calibri, sans-serif;\">–&nbsp;</span></strong><span style=\"font-family: Calibri, sans-serif;\">Fever ≥38°C (tympanic temperature) at screening</span></p><p class=\"m_-4746968795897844313Default\" style=\"margin: 0in 0in 0.15pt; font-size: 16px; font-family: Arial, sans-serif; background-color: rgb(255, 255, 255);\"><strong><span style=\"font-family: Calibri, sans-serif;\">–&nbsp;</span></strong><span style=\"font-family: Calibri, sans-serif;\">At least one respiratory symptom (either cough or coryza)</span></p><p class=\"m_-4746968795897844313Default\" style=\"margin: 0in 0in 0.0001pt; font-size: 16px; font-family: Arial, sans-serif; background-color: rgb(255, 255, 255);\"><span style=\"font-family: Calibri, sans-serif;\">• The time interval between the onset of symptoms and screening is ≤96 hours (the onset of symptoms is defined as the time when body temperature first exceeded 37.5°C if known, or the time when the first symptom was noticed by the parent or caregiver)</span></p><span style=\"font-family: Calibri, sans-serif;\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>Abbreviated Exclusion Criteria:</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Severe symptoms of&nbsp;<span class=\"il\">influenza</span>&nbsp;virus infection requiring inpatient treatment</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Concurrent infections requiring systemic antiviral therapy at screening</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Require, in the opinion of the investigator, any of the prohibited medication during the study</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Preterm neonates (born at &lt;37 weeks gestation) and/or weighing &lt;2.5 kg at screening</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Previous treatment with peramivir, laninamivir, oseltamivir, zanamivir, or amantadine&nbsp;<span class=\"aBn\" data-term=\"goog_1484145749\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 2 weeks</span></span>&nbsp;prior to screening</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Immunization with a live/attenuated&nbsp;<span class=\"il\">influenza</span>&nbsp;vaccine during the 2 weeks prior to screening</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Concomitant treatment with steroids or other immuno-suppressant therapy</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Known HIV infection or other immunosuppressive disorder</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Uncontrolled renal, vascular, neurologic or metabolic disease (e.g., diabetes, thyroid disorders, adrenal disease), hepatitis, cirrhosis or pulmonary disease, or patients with known chronic renal failure</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Active cancer at any site</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• History of organ transplant</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.15pt; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Known allergy to study drug (i.e., baloxavir marboxil) or to acetaminophen</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 12pt; color: black;\">• Participation in a clinical trial with an investigational drug&nbsp;<span class=\"aBn\" data-term=\"goog_1484145750\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 4 weeks</span></span>&nbsp;prior to screening</span></p><span style=\"font-size: 12pt;\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><strong>Study Duration – 9 Months</strong></p>      ', null, null, '', '54,83,32', '1', '0', null, '2018-04-02 16:11:30', '2018-04-23 22:05:16', 'BTC', '0');
INSERT INTO `trials` VALUES ('67', '     Neuropathic pain from lumbosacral radiculopathy -- neuropathic pain-002-018     ', '     <p style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><span style=\"font-size: 12pt;\">Paraxel is currently identifying sites for a Pre-Award &nbsp;Phase I/II&nbsp;<span class=\"il\">neuropathic</span>&nbsp;<span class=\"il\">pain</span>&nbsp;study.&nbsp; Information included below, but they have asked that interested PIs submit metrics and CV, as they are looking for PIs with previous experience for this large trial&nbsp;If you are interested in learning more about this exciting opportunity, please respond with metrics and an updated CV.</span><br></p><p style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; color: rgb(33, 33, 33);\"></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172WordSection1\"></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_MsoNormal\"><strong><span style=\"color: rgb(31, 73, 125);\">&nbsp;</span></strong></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_MsoNormal\"><strong>Study Design:</strong><span style=\"font-size: 12pt;\">&nbsp;This is a first in human, escalating single dose design study to determine the safety, tolerability, and analgesic activity of IMP administered by transforaminal epidural injection to subjects aged 18 to 75 years with&nbsp;<span class=\"il\">neuropathic</span>&nbsp;<span class=\"il\">pain</span>&nbsp;due to lumbosacral radiculopathy</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_MsoNormal\"><span style=\"font-size: 12pt;\">Subjects who meet the criteria for randomization will be randomized to IMP or placebo, and be enrolled into 1 of 3 dose-level cohorts (each cohort comprise 6 patients). During the 7-14 days period prior to randomization (day -14 to day -1), the subjects will be required to discontinue use of gabapentin, pregabalin, duloxetine and any agents that could impact coagulation such as aspirin (&gt;81mg/day) and NSAIDs.</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_MsoNormal\"><span style=\"font-size: 12pt;\">The Subjects will be admitted to an inpatient or overnight facility the day before administration of the IMP treatment and will remain as inpatients for 7 days following the treatment.</span></p><span style=\"font-size: 12pt;\">&nbsp;</span><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_MsoNormal\"><strong>Abbreviated Inclusion Criteria:</strong></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpFirst\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">Between the ages of 18 and 75 years, inclusive</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">Body mass index (BMI) of ≤38</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">Subjects must have a diagnosis of&nbsp;<span class=\"il\">pain</span>&nbsp;due to LSR, with following characteristics:</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">Perceive&nbsp;<span class=\"il\">pain</span>&nbsp;in one or both lower limbs at areas that are consistent with area innervated by the L4, L5 or S1&nbsp;<span class=\"il\">nerve</span>&nbsp;roots, with or without other sensory symptoms in the affected areas</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\"><span class=\"il\">Pain</span>&nbsp;in the leg radiates to below the knee</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\"><span class=\"il\">Pain</span>&nbsp;in the leg is worse during rest and/or at night not solely present upon walking</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">The history of the&nbsp;<span class=\"il\">pain</span>&nbsp;suggests that the cause of the LSR is due to injury of the lumbosacral&nbsp;<span class=\"il\">nerve</span>&nbsp;root by degenerative disease of the vertebrae in the lumbosacral spine or associated soft issue</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">The duration of&nbsp;<span class=\"il\">pain</span>&nbsp;since onset is ≥6 months</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">Based on clinical history, the insensitivity of&nbsp;<span class=\"il\">neuropathic</span>&nbsp;<span class=\"il\">pain</span>&nbsp;has been stable during the 4week period before screening</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">Subject has failed to respond to:</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">Two previous treatments with different classes of clinically acceptable analgesic medications for an adequate treatment period, clinically acceptable medications are those indicated by evidence based research for LSR and do not include NSAIDs, skeletal muscle relaxants, opioids, anticonvulsants, and antidepressants</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">Prior spinal surgery</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpLast\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">At screening subjects has an average daily&nbsp;<span class=\"il\">pain</span>&nbsp;score for&nbsp;<span class=\"il\">neuropathic</span>&nbsp;<span class=\"il\">pain</span>&nbsp;due to LSR of ≥4 and ≤9 on the PI-NRS and reports an average daily&nbsp;<span class=\"il\">pain</span>&nbsp;score of ≥4 and ≤9 in the PI-NRS during 4 of the last 7 days prior to randomization</span></p><span style=\"font-size: 12pt;\">&nbsp;</span><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_MsoNormal\"><strong>Abbreviated Exclusion Criteria:</strong></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpFirst\" style=\"margin-bottom: 8pt;\"><span style=\"font-family: Symbol; letter-spacing: -0.05pt;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif; letter-spacing: -0.05pt;\">Has lumbar stenosis with&nbsp;<span class=\"il\">pain</span>&nbsp;present solely upon walking</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\" style=\"margin-bottom: 8pt;\"><span style=\"font-family: Symbol; letter-spacing: -0.05pt;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif; letter-spacing: -0.05pt;\">Has missed more that 3 of 7 daily&nbsp;<span class=\"il\">neuropathic</span>&nbsp;<span class=\"il\">pain</span>&nbsp;score entries during last 7 days</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpLast\" style=\"margin-bottom: 8pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif; letter-spacing: -0.05pt;\">Has a daily&nbsp;<span class=\"il\">neuropathic</span>&nbsp;<span class=\"il\">pain</span>&nbsp;score ≤2 on 1 or more days during the last 7 days prior randomization</span><strong><span style=\"font-family: Calibri, sans-serif;\"></span></strong></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_MsoNormal\" style=\"margin-bottom: 8pt;\"><strong>Study Duration</strong></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_MsoNormal\" style=\"margin-bottom: 8pt;\"><strong>Patients will participate in this study for up to ~ 2 years</strong></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpFirst\" style=\"margin-bottom: 8pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">Screening 28 days</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpMiddle\" style=\"margin-bottom: 8pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">12-week double blind treatment period, and 40-week open-label period; for the subjects receiving placebo, the duration of study participation will be 16 weeks</span></p><p class=\"m_1250350113835684840x_m_-362032691624755869m_-6587281756467772186aolmail_m_-4901342278714087172MsoListParagraphCxSpLast\" style=\"margin-bottom: 8pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: Calibri, sans-serif;\">After 52 weeks subjects will be invited to extended follow-up study for an additional 1 year (monitored for SAEs)</span></p><p></p><p></p>     ', null, null, '', '83,53,32,38', '1', '0', null, '2018-04-06 17:15:47', '2018-04-23 22:29:22', 'BTC', '0');
INSERT INTO `trials` VALUES ('68', ' Parexel Upcoming HDM Allergic Asthma Study (Kids age 5-17 Asthma-007-017) ', ' <p class=\"MsoNormal\" style=\"position: relative; margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\">THIS STUDY IS NO LONGER LOOKING FOR SITES!</p><p class=\"MsoNormal\" style=\"position: relative; margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\"><br></p><p class=\"MsoNormal\" style=\"position: relative; margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\">Parexel is working to identify additional sites and investigators who may be interested in participating in an upcoming House Dust Mite (HDM) Allergic Asthma Study. We have very limited information at this time, but if you are interested in learning more and receiving an eCDA and Feasibility, please let me know at your earliest convenience.<o:p></o:p></p><p class=\"MsoNormal\" style=\"position: relative; margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"position: relative; margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\"><strong>Study Information:<o:p></o:p></strong></p><p class=\"MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 11pt; font-family: Calibri, sans-serif; text-indent: -0.25in;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>They will be reviewing 300 feasibilities and initiating 64 sites.<o:p></o:p></p><p class=\"MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 11pt; font-family: Calibri, sans-serif; text-indent: -0.25in;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Sites must have a&nbsp; fairly large Pediatric Population Ages 5-17.</p> ', null, null, '1522540800', '28,83', '1', '0', null, '2018-04-06 18:00:23', '2018-05-01 17:13:27', 'BTC', '0');
INSERT INTO `trials` VALUES ('69', '   Medpace-Phase II Alzheimer\'s Study - Alzheimer\'s-007-018   ', '   <p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 12pt;\">Medpace is looking to identify sites for a Phase II Alzheimer’s Study. Very little Information is available at this time, but If you are interested in learning more about this exciting opportunity.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><span style=\"font-size: 12pt;\"><u></u>&nbsp;<u></u></span></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><span style=\"font-size: 12pt;\">Abbreviated Study Details</span></strong><span style=\"font-size: 12pt;\"><u></u><u></u></span></p><p class=\"m_7889499935494746432MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(34, 34, 34);\"><u></u><span style=\"font-size: 12pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 12pt;\">The patients cannot be taking donepezil or memantine<u></u><u></u></span></p><p class=\"m_7889499935494746432MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(34, 34, 34);\"><u></u><span style=\"font-size: 12pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 12pt;\">Population can either be treatment naïve or patients that are washed out of one or both of these medication at least 3 months prior to screening.&nbsp;<u></u><u></u></span></p><p class=\"m_7889499935494746432MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(34, 34, 34);\"><u></u><span style=\"font-size: 12pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 12pt;\">Targeting FPFV in very late May or early June.&nbsp;<u></u><u></u></span></p><p class=\"m_7889499935494746432MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(34, 34, 34);\"><u></u><span style=\"font-size: 12pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 12pt;\">Looking for sites to enroll 6-7 patients or more over 6 months</span></p>   ', 'a:2:{i:0;i:82;i:1;i:83;}', null, '1524787200', '44,83,32', '1', '0', null, '2018-04-11 22:04:54', '2018-04-23 22:10:49', 'BTC', '0');
INSERT INTO `trials` VALUES ('70', '  Confidence Pharmaceutical Research Phase 2 Endometriosis- endometriosis-001-018  ', '  <p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\">Confidence Pharmaceutical Research is seeking sites for their Upcoming Phase 2&nbsp;<span class=\"il\">Endometriosis</span>&nbsp;Study. There is limited information at this time, but &nbsp;If you are interested in learning more please complete the CDA attached and let me know&nbsp;<strong><span style=\"background: yellow;\">by end of week</span></strong>.<br></p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><strong>Study Details:</strong></p>&nbsp;<ul type=\"disc\" style=\"margin-bottom: 0in; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: black;\">Industry Sponsored</li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: black;\">Sirte will be provided a fully executed CDA followed by synopsis and survey</li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: black;\">The<span class=\"m_-6896536395628409863apple-converted-space\">&nbsp;</span><strong>Study start</strong><span class=\"m_-6896536395628409863apple-converted-space\">&nbsp;</span>is planned for<span class=\"m_-6896536395628409863apple-converted-space\">&nbsp;</span><strong>July 2018</strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: black;\"><strong>Study Phase:</strong><span class=\"m_-6896536395628409863apple-converted-space\">&nbsp;</span>Phase II</li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: black;\"><strong>Indication:</strong><span class=\"m_-6896536395628409863apple-converted-space\">&nbsp;</span><span class=\"il\">Endometriosis</span>-<wbr>related pain</li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: black;\"><strong>Patient Population:</strong>&nbsp;Premenopausal women with surgically diagnosed&nbsp;<span class=\"il\">endometriosis</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: black;\"><strong>Length of patient participation:</strong><span class=\"m_-6896536395628409863apple-converted-space\">&nbsp;</span>20 weeks</li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: black;\"><strong>Number of on-site visits:</strong><span class=\"m_-6896536395628409863apple-converted-space\">&nbsp;</span>9 visits</li></ul><span style=\"color: black;\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\">As always please let me know if you have any questions!</p>  ', 'a:1:{i:0;i:84;}', 'a:1:{i:0;i:15;}', '1523577600', '46,32,83', '1', '1', null, '2018-04-11 23:02:39', '2018-04-13 22:18:28', 'BTC', '0');
INSERT INTO `trials` VALUES ('71', ' Parexel Upcoming Bladder Cancer Study- Bladder Cancer-001-018 ', ' <p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">Must have a board certified Urologists as PI and or Sub-I to be considered.&nbsp;</span></p><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">&nbsp;</span><br><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Parexel is seeking experienced Urologists with a fairly large population for an Upcoming&nbsp;<span class=\"il\">Bladder</span>&nbsp;<span class=\"il\">Cancer</span>&nbsp;Study (</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">metastatic or unresectable) with subjects having progressed after a first line of treatment .There is limited information at this time, but if you are interested in learning more please let me know&nbsp;<strong>no later than Thursday April 5<sup>th</sup>.</strong></span></p><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Site Requirements:</span></strong></p><p class=\"m_-5305935011113101953MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 16px; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(33,=\"\" 33,=\"\" 33);\"=\"\"><span style=\"font-size: 11pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Site Pharmacy</span></p><p class=\"m_-5305935011113101953MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 16px; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(33,=\"\" 33,=\"\" 33);\"=\"\"><span style=\"font-size: 11pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Radiology affiliation on or offsite to&nbsp;</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">conduct a complex &nbsp;&amp; demanding study that will include PK/PD assessments</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"></span></p><p class=\"m_-5305935011113101953MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 16px; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(33,=\"\" 33,=\"\" 33);\"=\"\"><span style=\"font-size: 11pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Study drug under evaluation is an monoclonal antibody</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"></span></p><p class=\"m_-5305935011113101953MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 16px; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(33,=\"\" 33,=\"\" 33);\"=\"\"><span style=\"font-size: 11pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Fairly large population</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"></span></p><p class=\"m_-5305935011113101953MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 16px; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(33,=\"\" 33,=\"\" 33);\"=\"\"><span style=\"font-size: 11pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Extensive Experience</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"></span></p><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(33, 33, 33); font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">As always please let me know if you have any questions!</span></p> ', 'a:1:{i:0;i:85;}', null, '1523577600', '50,83', '1', '0', null, '2018-04-11 23:07:02', '2018-04-17 17:20:15', 'BTC', '0');
INSERT INTO `trials` VALUES ('72', 'Parexel Moderate to Severe Inflammatory Hand OA (OA-007-018)', '<p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p dir=\"ltr\" style=\"font-size: 12pt; color: rgb(0, 0, 0); font-family: Calibri, Arial, Helvetica, sans-serif;\"><p style=\"color: rgb(33, 33, 33);\"><p><p class=\"m_6106832537239400247m_5028603403689712933WordSection1\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Parexel is seeking experienced sites for their Upcoming&nbsp;</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Moderate to Severe Inflammatory Hand Osteoarthritis Study. Please find study details below and if you are interested in receiving a survey please let me know&nbsp;<strong><span style=\"background-color: rgb(255, 255, 0);\">no later than 12PM Noon Friday April 13th.</span>&nbsp;</strong>Please let me know if you have any questions!<strong><strong><b></b></strong></strong></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</span></strong></p><p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">The study drug is a biologic treatment, a fully human antibody that is currently being studied to demonstrate therapeutic benefit in hand OA through inhibition of proliferation and activation of inflammatory cells and development of an inflammatory response. The drug will be administered by subcutaneous injection, once weekly, at the study&nbsp;site&nbsp;by a member of the&nbsp;site&nbsp;staff who is unblinded and independent from the other study assessments.</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"><br><br><br><em>A multi-center, Double-Blind, Placebo-Controlled, Dose Response Study that is focusing on the efficacy and safety of the study drug in Subjects with Moderate to Severe Inflammatory Hand Osteoarthritis</em><br><br><strong>Study overview:</strong><br>This is a 6-arm dose ranging study with a screening period, the option of either 12 or 24 weeks treatment duration and a follow-up period of 7 weeks. Weekly dosing visits at the&nbsp;site&nbsp;will be necessary throughout the treatment period.<br><br><strong>Primary Study Objectives:&nbsp;</strong><br>To assess dose-efficacy response of the drug in subjects with moderate to severe inflammatory Hand OA.<br><br><strong>Key Inclusion Criteria:</strong></span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Meets ACR clinical classification criteria of hand OA (index joint).</span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Must have at least two inflamed IP joints (DIP and/or PIP) in the same hand characterised by soft tissue swelling and/or tenderness). At least one of those inflamed joints must have both soft tissue swelling AND tenderness.&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Must have a moderate to severe Hand OA with self-assessed hand pain intensity of at least 5 on an 11 point NRS (0-10) during screening and confirmed at baseline (Day 1) prior to randomisation. This is recorded by daily ePRO diary question and calculated as an average using data from the seven days prior to assessment.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Inadequately controlled, or inability to tolerate, or contraindication to oral NSAIDs.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Willing to and able to discontinue all pain medication (except Paracetamol rescue medication) following first screening visit until completion of week 12 visit. Pain medication washout time will be the longest of 30 days, 5 half-lives or twice the duration of biological effect.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">6.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Diffusing capacity of the lung for carbon monoxide (DLCO) ≥70 % predicted and forced vital capacity (FVC) ≥70 % predicted.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Key Exclusion Criteria:&nbsp;</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"></span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Diagnosis or history of any clinically significant inflammatory disease other than OA, including but not limited to: rheumatoid arthritis, spondyloarthropathies, gout, calcium pyrophosphate deposition disease (CPPD), pseudogout, and hemochromatosis.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Subjects with fibromyalgia or current regional pain syndromes or regional pain caused by lumbar or cervical compressions with radiculopathy or at risk of developing radiculopathy.</span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Chest X-ray with no clinically significant abnormalities and no evidence of current or previous pulmonary tuberculosis (patients must also have negative TB test).</span></p><p class=\"MsoNormal\" style=\"margin-right: 12pt; margin-bottom: 0px; margin-left: 48pt;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">History of any clinically-significant respiratory disease.</span></p><br></p><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(31, 73, 125);\">&nbsp;</span><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@<wbr>conductclinicaltrials.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1523575343767000&amp;usg=AFQjCNEUM5ieH985O1-CLTej3GjChOyotg\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.<wbr>conductclinicaltrials.com</a></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><br></span><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"background-color: rgb(255, 255, 0);\">If you\'re a site partnered with CCT log into&nbsp;<a href=\"http://www.cctclient.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.cctclient.com/&amp;source=gmail&amp;ust=1523575343767000&amp;usg=AFQjCNHHdWCk9vD3GF2ET6TXOAej1QWyIw\" style=\"color: rgb(17, 85, 204);\">www.cctclient.com</a>&nbsp;and register today!</span><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p><font face=\"verdana, sans-serif\" size=\"2\"><br></font></p></p><p class=\"yj6qo\"><div class=\"yj6qo\"></div></p><p class=\"adL\"></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p>', 'a:1:{i:0;i:86;}', null, '1523577600', '53,83,32,47,', '0', '0', null, '2018-04-11 23:23:43', '2018-04-13 20:31:29', 'BTC', '0');
INSERT INTO `trials` VALUES ('73', '    Pivotal BE with Paliperidone Palmitate in Schizo #18-1230    ', '    <p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">We have a CRO who is bidding on a pre-award bioavailability/bio equivalency study for a long acting injectable drug for treating patients with schizophrenia/schizoaffective disorder.&nbsp; We need feasibility on sites that could enroll in this Phase 3 study with the ability to keep overnight if necessary.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Please see attached synopsis with schedule of events and respond by EOB&nbsp;</span><span class=\"aBn\" data-term=\"goog_350425243\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Friday 13Apr2018</span></span><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;with your interest.</span></p>    ', 'a:3:{i:0;i:87;i:1;i:88;i:2;i:89;}', null, '1523577600', '56,83', '1', '0', null, '2018-04-12 15:01:17', '2018-04-16 20:10:58', 'InSearch', '0');
INSERT INTO `trials` VALUES ('74', '    Novum-Dental Caries Prevention   ', '    <p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"></p><p><span class=\"il\">Novum</span>&nbsp;PRS has been awarded a&nbsp;<span class=\"il\">dental</span>&nbsp;caries study.<br></p><br><p>They are seeking sites who can run this study.&nbsp; In any investigator is interested in this study, attached please protocol synopsis and CDA.&nbsp; &nbsp;Please return the completed&nbsp; CDA to me at the earliest convenience.&nbsp;</p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><br></span><p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><strong>Study summary:</strong></span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">To compare the safety and efficacy of test product and reference product in the prevention of&nbsp;<span class=\"il\">dental</span>&nbsp;caries.</span></p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><br></span><p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">25% of subjects will be between 6-12 years old.&nbsp;</span></p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><br></span><p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><strong>Study information</strong>:</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Study start: unknown at this point.</span></p><br><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><br></span><p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">I<strong>nclusion:</strong></span></p><p></p><p><font color=\"#000000\" face=\"Verdana\"><span style=\"font-size: 13.3333px;\">1. ≥6 years of age</span></font></p><p><font color=\"#000000\" face=\"Verdana\"><span style=\"font-size: 13.3333px;\">2. 10 or more natural, uncrowned teeth</span></font></p><p><font color=\"#000000\" face=\"Verdana\"><span style=\"font-size: 13.3333px;\">3. Prior history of&nbsp;<span class=\"il\">dental</span>&nbsp;caries</span></font></p><p></p><p><font color=\"#000000\" face=\"Verdana\"><span style=\"font-size: 13.3333px;\"><strong><br></strong></span></font></p><p><font color=\"#000000\" face=\"Verdana\"><span style=\"font-size: 13.3333px;\"><strong>Exclusion:</strong></span></font></p><p><font color=\"#000000\" face=\"Verdana\"><span style=\"font-size: 13.3333px;\"></span></font></p><p><font color=\"#000000\" face=\"Verdana\">Presence of open and active coronal decay</font></p><p><font color=\"#000000\" face=\"Verdana\">2. Use of any other fluoride-containing product during the study</font></p><p><font color=\"#000000\" face=\"Verdana\">3. Use of high-fluoride dentifrice within 6 months prior to study enrollment</font></p><p><font color=\"#000000\" face=\"Verdana\">4. Use of local or systemic antibiotic treatment within 6 months of study enrollment</font></p><p><font color=\"#000000\" face=\"Verdana\">5. Presence of orthodontic devices</font></p><p><font color=\"#000000\" face=\"Verdana\">6. Presence or history of other comorbidities that could affect the results of the study (e.g., acute progressive peridontitis, fungal infections of the mouth, oral or esophageal cancer)</font></p><p><font color=\"#000000\" face=\"Verdana\">7. For women, pregnancy or breast-feeding</font></p><p><font color=\"#000000\" face=\"Verdana\">8. Undergoing radiation therapy</font></p><p></p><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"></span><p></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"></p><p class=\"m_5483752694935861924m_-7433845707941716900m_-7870040957004544603m_-3088087213278475183m_4435673221737710440m_-7005316207789985324gmail_signature\"></p><p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T:&nbsp;<a href=\"tel:(888)%20635-0552\" value=\"+18886350552\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">888-635-0552</a>&nbsp;- F:&nbsp;<a href=\"tel:(888)%20979-8260\" value=\"+18889798260\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">888-979-8260</a>&nbsp;- M:&nbsp;<a href=\"tel:(702)%20720-7323\" value=\"+17027207323\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">702-720-7323</a></span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@conductclinicaltrials<wbr>.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1523663446407000&amp;usg=AFQjCNFEZaWuPuyK8_Qd98iaTEoXyORTpQ\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.conductclinicaltrial<wbr>s.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number&nbsp;<a href=\"tel:(702)%20720-7323\" value=\"+17027207323\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">702-720-7323</a></span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p><font face=\"verdana, sans-serif\" size=\"2\"><br></font></p><p></p><p></p><p></p>    ', null, null, '1524182400', '27', '1', '1', null, '2018-04-13 00:28:12', '2018-05-01 17:04:12', 'CCT BD - Shilo', '0');
