INSERT INTO `trials` VALUES ('81', '                   IBS; in vitro diagnostic test; ALPCOCAL, #18-1236                   ', '                   <p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"></p><p lang=\"EN-US\" link=\"#0563C1\" vlink=\"#954F72\"></p><p class=\"m_40750247700978095m_-1442678414927834550WordSection1\"></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">This is an observational study to assess the below referenced information. Please respond with your interested PI’s.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">The ALPCO Calprotectin ELISA is an in vitro diagnostic test intended to quantitatively measure concentrations of fecal calprotectin in human stool samples. Calprotectin is a protein biomarker of mucosal inflammation. Measurement of calprotectin can aid in the diagnosis of Inflammatory Bowel Diseases (IBD), specifically Crohn\'s Disease (CD) and Ulcerative Colitis (UC), as well as aid in the differentiation of IBD from Irritable Bowel Syndrome (IBS) when used in conjunction with other diagnostic testing and the total clinical picture. This study will estimate the predictive values of a negative (NPV) and positive (PPV) test by utilizing the assay outcomes of the ALPCO Calprotectin ELISA.</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><a href=\"https://clinicaltrials.gov/ct2/show/NCT03082287?term=%22NCT03082287%22&amp;rank=1\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://clinicaltrials.gov/ct2/show/NCT03082287?term%3D%2522NCT03082287%2522%26rank%3D1&amp;source=gmail&amp;ust=1523728593230000&amp;usg=AFQjCNFegWV81R7fuh_RJpoowsoDkBRK7g\" style=\"color: rgb(17, 85, 204);\"><span style=\"color: rgb(5, 99, 193);\">https://clinicaltrials.gov/ct2<wbr>/show/NCT03082287?term=%22NCT0<wbr>3082287%22&amp;rank=1</span></a><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p></p><p></p><p></p><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@<wbr>conductclinicaltrials.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1523728593230000&amp;usg=AFQjCNFtN_CcuRw1j6YeH9n6vmKgD_C2rg\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.<wbr>conductclinicaltrials.com</a></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><br></span><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"background-color: rgb(255, 255, 0);\">If you\'re a site partnered with CCT log into&nbsp;<a href=\"http://www.cctclient.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.cctclient.com/&amp;source=gmail&amp;ust=1523728593230000&amp;usg=AFQjCNEUQtC8A5GP4l-VDT1XyVulETIlvg\" style=\"color: rgb(17, 85, 204);\">www.cctclient.com</a>&nbsp;and register today!</span><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p><font face=\"verdana, sans-serif\" size=\"2\"><br></font></p><p></p><p class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"></p><div class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"></div><p></p>                   ', 'a:1:{i:0;i:90;}', null, '1524182400', '33,83,38,32', '1', '0', null, '2018-04-13 17:58:29', '2018-04-16 22:39:49', 'InSearch', '0');
