INSERT INTO `trials` VALUES ('95', '       IPF and Photosensitivity Study    IPF-001-018   ', '       <p>We\'re working with Evidera in identifying 1-2 more sites to assist with recruitment for the IPF photo-sensitivity study.&nbsp; They\'d like to focus on the following states but if you have the patient population it\'s not a deal breaker.</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">West coast: California, Arizona, New Mexico<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Midwest: Minnesota, Wisconsin, Michigan, Ohio, Indiana, Illinois, Iowa, Missouri, Kansas, Nebraska, South Dakota, North Dakota<u></u><u></u></p><br><blockquote type=\"cite\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"><p dir=\"ltr\"></p><p class=\"gmail_quote\"></p><p dir=\"ltr\"></p><p class=\"gmail_quote\"></p><p dir=\"ltr\" style=\"font-size: 12pt; font-family: Calibri, Arial, Helvetica, sans-serif;\"></p><p style=\"color: rgb(33, 33, 33);\"></p><p class=\"m_3613964513209513668m_-4675740388682193144m_4798249342662561913WordSection1\"></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">A few key points to note about this study:</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u>&nbsp;</u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u>Study Details</u></p><ul type=\"disc\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">This is an&nbsp;<u>observational</u>&nbsp;study to better understand patients’ experience with&nbsp;<span class=\"il\">photosensitivity</span>&nbsp;as a result of taking pirfenidone (i.e. duration, severity, management) and the impacts of the disorder on patients’ quality of life.</li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">We are hoping to recruit 30 adult patients.</li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">This study involves a&nbsp;<u>one-time</u>&nbsp;telephone interview lasting around 60-90 minutes that will be conducted over the phone by Evidera staff.</li></ul>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u>Site Responsibilities</u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Sites will be responsible for:</p><ul type=\"disc\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Study start-up activities</li></ul><ul type=\"disc\" style=\"margin-top: 0in;\"><ul type=\"circle\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Completing IRB paperwork</li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Attending an online 60-minute training session, for applicable staff (Note: PI only needs to attend for the first 15-20 minutes)</li></ul></ul><ul type=\"disc\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Screening potential participants for eligibility</li></ul><ul type=\"disc\" style=\"margin-top: 0in;\"><ul type=\"circle\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Sending Evidera participants’ contact info, with their permission</li></ul></ul><ul type=\"disc\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Filling out a case report form based on patients’ charts (Note: To be determined)</li></ul>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u>Budget</u></p><ul type=\"disc\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Each site will be compensated $1,500 for initial start-up activities and $700 for each patient that is recruited and successfully completes an interview.</li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Patients will receive a $100 ClinCard gift card by Evidera staff for completing an interview.</li></ul><p></p><p></p><p></p><p></p><p></p><p></p><p></p></blockquote><br><p>I\'ve attached the synopsis and questionnaire.&nbsp; If you\'re interested please complete the questionnaire and send it to me for full submission.&nbsp;&nbsp;</p><br>       ', null, 'a:2:{i:0;i:16;i:1;i:17;}', '1532995200', '57,83,38,32', '1', '1', null, '2018-04-16 17:11:42', '2018-05-09 16:06:26', 'CCT Sales - Shilo', '0');
INSERT INTO `trials` VALUES ('96', '    Compensated Cirrhosis; NASH; 747-304 #18-1169    ', '    <p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">We have a sponsor looking for site interest in the above referenced study. Please review and let me know if you are interested. Bear in mind the fact that this study is in the late stages of site selection, time is of the essence.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 12.8px;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"color: rgb(0, 0, 0); font-family: Khula, sans-serif; font-size: 20px;\">Please review below and let me know if you\'re interested.</span><br></p><br><table summary=\"Layout table for eligibility information\" class=\"layout_table\" cellpadding=\"0\" cellspacing=\"0\" style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" roboto,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><tbody><tr style=\"line-height: 1.6;\"><td headers=\"elgType\" style=\"line-height: 1.6; text-align: right; white-space: nowrap;\">Ages Eligible for Study: &nbsp;</td><td headers=\"elgData\" style=\"line-height: 1.6; padding-left: 1em;\">18 Years and older &nbsp; (Adult, Senior)</td></tr><tr style=\"line-height: 1.6;\"><td headers=\"elgType\" style=\"line-height: 1.6; text-align: right; white-space: nowrap;\">Sexes Eligible for Study: &nbsp;</td><td headers=\"elgData\" style=\"line-height: 1.6; padding-left: 1em;\">All</td></tr><tr style=\"line-height: 1.6;\"><td headers=\"elgType\" style=\"line-height: 1.6; text-align: right; white-space: nowrap;\">Accepts Healthy Volunteers: &nbsp;</td><td headers=\"elgData\" style=\"line-height: 1.6; padding-left: 1em;\">No</td></tr></tbody></table><p class=\"header3\" style=\"font-family: sans-serif; font-size: small; line-height: 1.6; font-weight: bolder; margin-top: 2ex;\">Criteria</p><p class=\"indent2\" style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" roboto,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 15px;=\"\" line-height:=\"\" 1.6;=\"\" clear:=\"\" both;=\"\" margin-left:=\"\" 1em;\"=\"\"></p><p style=\"line-height: 1.6; margin-top: 1ex; margin-bottom: 1ex;\">Key inclusion criteria:</p><p style=\"line-height: 1.6; margin-top: 0ex; margin-bottom: 1ex;\">1. Subjects with a confirmed diagnosis of NASH and a fibrosis score of 4 based upon the NASH CRN scoring system determined by central reading</p><p style=\"line-height: 1.6; margin-top: 0ex; margin-bottom: 1ex;\">Key exclusion criteria:</p><ol style=\"margin-top: 1ex; margin-bottom: 1ex;\"><li style=\"line-height: 1.6; margin-top: 0.7ex;\">Current or past history of hepatic decompensation such as clinically significant ascites, hepatic encephalopathy (HE), or variceal bleeding</li><li style=\"line-height: 1.6; margin-top: 0.7ex;\">Current or past history of CP score ≥7 points</li><li style=\"line-height: 1.6; margin-top: 0.7ex;\">Model for End-stage Liver Disease (MELD) score &gt; 12</li><li style=\"line-height: 1.6; margin-top: 0.7ex;\">ALT ≥ 5 X ULN</li><li style=\"line-height: 1.6; margin-top: 0.7ex;\">Calculated creatinine clearance &lt;60mL/min using Cockcroft-Gault method</li><li style=\"line-height: 1.6; margin-top: 0.7ex;\">Hemoglobin A1c ≥ 9.5 %</li><li style=\"line-height: 1.6; margin-top: 0.7ex;\">Evidence of other known forms of chronic liver disease such as alcoholic liver disease, hepatitis B, hepatitis C, PBC, PSC, autoimmune hepatitis, Wilson disease, iron overload, alpha-1-antitrypsin deficiency, drug-induced liver injury, known or suspected hepatocellular carcinoma (HCC)</li><li style=\"line-height: 1.6; margin-top: 0.7ex;\">History of liver transplant, or current placement on a liver transplant list</li></ol><p></p>    ', 'a:2:{i:0;i:91;i:1;i:92;}', null, '1524009600', '33,83,32', '1', '0', null, '2018-04-16 18:55:15', '2018-04-23 21:46:36', 'InSearch', '0');
INSERT INTO `trials` VALUES ('97', '  PPD  – BC#82081-02_ Mild/Moderate Psoriasis   ', '  <p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"color: rgb(31, 73, 125);\">PPD has been awarded a study in mild to moderate psoriasis, and we are reaching out to you for interest.&nbsp; The FPI is targeted for December 2018, with an enrollment period of 12 months.&nbsp;<u></u><u></u></span></p><span style=\"color: rgb(31, 73, 125);\"><u></u>&nbsp;<u></u></span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"color: rgb(31, 73, 125);\">The sponsor is seeking investigators in: Dermatology with experience in immunology</span></p>  ', 'a:3:{i:0;i:94;i:1;i:95;i:2;i:96;}', 'a:1:{i:0;i:20;}', '', '28,83', '1', '0', null, '2018-04-17 18:48:04', '2018-04-23 21:05:03', 'CCT BD - Ron', '0');
INSERT INTO `trials` VALUES ('98', ' Key Clinical; Infant Formula study #17-0543 ', ' Please see attached synopsis and if interested complete the attached CDA and questionnaire and return. ', null, 'a:3:{i:0;i:21;i:1;i:22;i:2;i:23;}', '1524009600', '54,83', '1', '1', null, '2018-04-18 16:29:41', '2018-05-10 19:42:47', 'InSearch', '0');
INSERT INTO `trials` VALUES ('99', 'Catawaba - Tinea Pedis July 2018 (Tinea Pedis-001-017)  #18-0565      ', '              <p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"></p><p></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail_signature\">We\'re working with Catawba Research who is currently seeking sites for an awarded Tinea Pedis study. &nbsp;<br></p><p></p><p class=\"gmail_quote\"></p><p lang=\"EN-US\"></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643WordSection1\"></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>Please see study information listed below and synopsis attached for further information and if interested complete the attached signed CDA and send it back.</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">They\'re looking for sites to enroll 50 subjects in 4 months</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Study Title:</u></strong>&nbsp;A MULTI-CENTER, DOUBLE-BLIND, RANDOMIZED, PLACEBO CONTROLLED, PARALLEL-GROUP STUDY, COMPARING TEST TOPICAL PRODUCT TO BRAND TOPICAL PRODUCT AND BOTH ACTIVE TREATMENTS TO A PLACEBO CONTROL IN THE TREATMENT OF TINEA PEDIS<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Objectives:<u></u><u></u></u></strong></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>To evaluate the therapeutic equivalence and safety of Test topical product and Brand topical product in the treatment of tinea pedis.&nbsp;&nbsp;&nbsp;<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>To demonstrate the superiority of the efficacy of the test and reference products over that of the placebo control in the treatment of tinea pedis.&nbsp;&nbsp;&nbsp;<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>To demonstrate the superiority of the efficacy of the test and reference products over that of the placebo control in the treatment of tinea pedis.&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Inclusion Criteria:<u></u><u></u></u></strong></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Subjects must have provided IRB approved written informed consent and sign a HIPAA authorization.&nbsp;<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Female Subjects of childbearing potential (excluding women who are or premenarchal, surgically sterilized or postmenopausal for at least 1 year), in addition to having a negative urine pregnancy test, must be willing to use an acceptable form of birth control during the study from the day of the first dose administration to 30 days after the last administration of study drug.&nbsp; For the purpose of this study the following are considered acceptable methods of birth control: oral or injectable contraceptives, contraceptive patches, Depo-Provera® (stabilized for at least 3 months), NuvaRing® (vaginal contraceptive), Implanon™ (contraceptive implant), double barrier methods (e.g. condom and spermicide), IUD, or abstinence with a 2nd acceptable method of birth control should the Subject become sexually active.&nbsp; A sterile sexual partner is NOT considered an adequate form of birth control.<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>All male Subjects must agree to use accepted methods of birth control with their partners, from the day of the first dose administration to 30 days after the last administration of study drug. Abstinence is an acceptable method of birth control.&nbsp; Female partners should use an acceptable method of birth control as described in the above Item Number 3.&nbsp;<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Subjects must be willing and able to understand and comply with the requirements of the protocol, including attendance at the required study visits.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><u>Exclusion Criteria:<u></u><u></u></u></strong></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Subjects with a history of hypersensitivity or allergy to luliconazole and/or any of the study medication ingredients and its excipients.&nbsp;&nbsp;<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Use of antipruritics, including antihistamines, within 72 hours prior to the Baseline Visit.<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Use of topical corticosteroids, antibiotics or antifungal therapies within 2 weeks prior to the Baseline Visit.<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Use of systemic corticosteroids, antibiotics or antifungal therapy within 1 month prior to the Baseline Visit.&nbsp; Systemic corticosteroids do not include intranasal, inhaled, and ophthalmic corticosteroids used for the management of allergies, pulmonary disorders or other conditions.&nbsp;<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Use of oral terbinafine or itraconazole within 2 months prior to the Baseline Visit.<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>6.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Use&nbsp; of&nbsp; immunosuppressive&nbsp; medication&nbsp; or&nbsp; radiation&nbsp; therapy within 3 months prior to the Baseline Visit.<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>7.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Any&nbsp; known hypersensitivity to Nafitifine HCI, or any component of the formulation.<u></u><u></u></p><p class=\"m_-2469980180740194851m_4571159446155641843m_6562504178531184441m_1665588689577001123gmail-m_-7852618906406788643MsoListParagraph\"><u></u>8.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Confluent, diffuse moccasin-type tinea pedis of the entire plantar surface<u></u><u></u></p><p></p><p class=\"m_-2469980180740194851m_4571159446155641843gmail_signature\"></p><p dir=\"ltr\"></p><p dir=\"ltr\"></p><p dir=\"ltr\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\"><br class=\"m_-2469980180740194851m_4571159446155641843gmail-Apple-interchange-newline\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T:&nbsp;<a href=\"tel:(888)%20635-0552\" value=\"+18886350552\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">888-635-0552</a>&nbsp;- F:&nbsp;<a href=\"tel:(888)%20979-8260\" value=\"+18889798260\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">888-979-8260</a>&nbsp;- M:&nbsp;<a href=\"tel:(702)%20720-7323\" value=\"+17027207323\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">702-720-7323</a></span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@conductclinicaltrials<wbr>.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1524167332890000&amp;usg=AFQjCNH41mH9n6UpmlXolnQ-XOWnQO4Cxw\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.conductclinicaltrial<wbr>s.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number&nbsp;<a href=\"tel:(702)%20720-7323\" value=\"+17027207323\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">702-720-7323</a></span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\"></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p></p><p></p><p></p><p></p><p></p><br class=\"m_-2469980180740194851m_4571159446155641843gmail-Apple-interchange-newline\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"></span><br><p></p><p></p><p></p><p></p>              ', null, 'a:2:{i:0;i:24;i:1;i:25;}', '1524787200', '55,83,28,32', '1', '1', null, '2018-04-18 20:12:46', '2018-04-26 21:27:52', 'CCT Sales - Shilo', '0');
INSERT INTO `trials` VALUES ('100', '   Hallux Upcoming Onychomycosis Device/Drug Combo Study (Onychomycosis-002-017)   ', '   <p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"background-color: rgb(255, 255, 0);\">Please note this trial is looking for experienced podiatrist.&nbsp; If you\'ve never done research I need to know how many patients you have that might qualify.&nbsp; In addition if you\'ve done research but not in this indication please let us know which Phase and add the name of the trial.</span><br></p><p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"></p><p dir=\"ltr\"></p><p class=\"gmail_quote\"></p><p dir=\"ltr\"></p><p class=\"gmail_quote\"></p><p lang=\"EN-US\"></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673WordSection1\"></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-MsoNormal\"><span style=\"font-family: Verdana, sans-serif; font-size: 10pt;\">Hallux Inc. is currently in the planning stages for their upcoming&nbsp;<span class=\"il\">Onychomycosis</span>&nbsp;trial and is interested in reviewing our experienced podiatrists.</span></p><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\"><u></u>&nbsp;</span><strong style=\"font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Study information:</span></strong><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Podiatrists are required to perform the procedure, no dermatologists will be accepted unfortunately<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Must be high volume site that does not need advertising and can rely on their EMR to identify potential subjects<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">The company’s flagship product, the HTS-519 Micro-Insert, is biodegradable and delivers high concentrations of terbinafine hydrochloride directly and selectively to the site of infection without introducing it systemically, where it can affect the liver and interact with other drugs that patients may be taking.<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Please visit their website for more information:&nbsp;<a href=\"http://halluxinc.com/overview-2/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://halluxinc.com/overview-2/&amp;source=gmail&amp;ust=1524176918089000&amp;usg=AFQjCNEBwCLUaQ8G_eivzWsuGcc2VK633A\" style=\"color: rgb(17, 85, 204);\">http://halluxinc.com/overview-<wbr>2/</a><u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Phase 2 study:&nbsp;<a href=\"https://clinicaltrials.gov/ct2/show/NCT02798380\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://clinicaltrials.gov/ct2/show/NCT02798380&amp;source=gmail&amp;ust=1524176918089000&amp;usg=AFQjCNEjpr-lmCOeQP-WI4AVPoYfp6LgWg\" style=\"color: rgb(17, 85, 204);\">ct.gov trial link</a><u></u><u></u></span></p><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\"><u></u>&nbsp;<u></u></span><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-MsoNormal\"><strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Inclusion Criteria:<u></u><u></u></span></strong></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Male and females 18 - 74 years of age inclusive<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Fungal toenail infection of one or both of the large (great) toenails<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">The nail infection must be due to a dermatophyte, (mixed infections [dermatophyte and non-dermatophyte] are not allowed)<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Willingness not to have professional pedicures or application of any nail polish product or nail cosmetics to the toenails after the screening visit<u></u><u></u></span></p><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\"><u></u>&nbsp;<u></u></span><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-MsoNormal\"><strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Exclusion Criteria:<u></u><u></u></span></strong></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">History of any significant chronic fungal disease other than&nbsp;<span class=\"il\">onychomycosis</span>&nbsp;or immunocompromised condition<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Any abnormalities of the nail or previous surgery of the toenail that could prevent a normal appearing nail if clearing of infection is achieved<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Significant confounding conditions as assessed by the study doctor<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Participation in any other trial of an investigational drug or device within 30 days or participation in a research study concurrent with this study<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">No administration of systemic antifungal medications within 6 months prior to screening visit<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">No application of prescription topical antifungal medications for toenail fungus within 3 months or other commercially available topical medications for toenail fungus applied directly to the toenails within 1 month prior to screening visit<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Tinea pedis (athlete\'s foot) that would require systemic treatment<u></u><u></u></span></p><p class=\"m_-3248786987184022392m_8790557900993477959m_7982349251697878298gmail-m_4555295621990673MsoListParagraph\"><u></u><span style=\"font-size: 10pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Other protocol-defined inclusion/exclusion criteria may apply<u></u><u></u></span></p><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\"><u></u>&nbsp;<u></u></span><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;