INSERT INTO `trials` VALUES ('101', 'Vaccine - Influenza, healthies #18-1241', '<p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">We currently have an opportunity for the study noted above. Please respond by the due date as this study will not be extended.&nbsp;<span style=\"color: red;\">&nbsp;<u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><span style=\"font-size: 12pt; background: yellow;\">STUDY:&nbsp;&nbsp;</span></strong><strong><span style=\"font-size: 14pt;\">This is a monoclonal antibody, for prevention/prophylaxis of Flu A</span></strong><strong><span style=\"font-size: 12pt;\"><u></u><u></u></span></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">On behalf of our Sponsor, and in order to assist with clinical site selection going forward, Pharm-Olam would like to request your participation in the study below via an online/electronic feasibility questionnaire.&nbsp;<em>&nbsp;<span style=\"color: red;\">&nbsp;</span></em><strong><span style=\"font-size: 10pt; color: red; background: yellow;\">PLEASE NOTE WE ARE NOW USING SURVEY MONKEY WITH ONLY A LINK REQUIRED</span></strong><strong><span style=\"font-size: 10pt; background: yellow;\">&nbsp;<span style=\"color: red;\">BELOW.&nbsp;&nbsp;</span></span></strong><strong><span style=\"font-size: 10pt;\">&nbsp;</span></strong><span style=\"font-size: 10pt;\"><u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Following your review of the study information sheet attached, and should you consider this trial may be of interest to you and your team, please find below further details to assist in the completion of the online project specific feasibility questionnaire.&nbsp; We currently only have the limited information available.&nbsp; The PDF of study information attached also includes the online form to assist you to complete the questionnaire online.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; line-height: 14.72px;\">•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Web Link:&nbsp;<span style=\"font-family: &quot;Century Gothic&quot;, sans-serif;\"><a href=\"https://www.research.net/r/006122_Flu-PreventionVaccine_11Apr2018\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://www.research.net/r/006122_Flu-PreventionVaccine_11Apr2018&amp;source=gmail&amp;ust=1524183293343000&amp;usg=AFQjCNEbXRNH_fFWIwO4HimJwCcDinYDJQ\" style=\"color: rgb(17, 85, 204);\">https://www.research.net/r/<wbr>006122_Flu-PreventionVaccine_<wbr>11Apr2018</a></span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Feasibility Questionnaire Deadline:&nbsp;&nbsp;<strong><span style=\"color: red;\">COB,&nbsp;<span class=\"aBn\" data-term=\"goog_1876653599\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Thursday, 19 Apr 2018</span></span><u></u><u></u></span></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong>If you have other colleagues that you would like to recommend for this study please let me know and I will pass along th