INSERT INTO `trials` VALUES ('103', ' Theravance Biopharma: Phase 2 - Crohn\'s Disease Study with a GI-Restricted JAK Inhibitor -- Crohn\'s-002-018 ', ' <p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><span style=\"color: rgb(33, 33, 33);\">PRA Health Sciences (PRA is working with Theravance Biopharma to identify qualified sites to participate in a Phase 2 study of a novel, potent, orally administered and intestinally restricted pan-Janus kinase (JAK) inhibitor in subjects with moderately to severely active Crohn’s Disease (CD). Your site has been identified as one that could potentially participate in this clinical trial.<u></u><u></u></span></p><span style=\"color: rgb(33, 33, 33);\">&nbsp;<u></u><u></u></span><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><strong><u><span style=\"color: rgb(33, 33, 33);\">Background</span></u></strong><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><span style=\"color: rgb(33, 33, 33);\">There is a current unmet need in CD treatment for an effective, but safer oral agent. Janus kinases (JAKs) play a central role in transmitting the pro-inflammatory effects of multiple cytokines that result in chronic inflammation. Systemic pan-JAK inhibitors have demonstrated therapeutic benefit for patients, leading to remission in subjects with moderately to-severely active CD. However, systemic pan-JAK inhibitors are associated with a risk of immunosuppressive side effects.<u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><strong><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span></strong><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><strong><u><span style=\"color: rgb(33, 33, 33);\">Why is this study so exciting?</span></u></strong><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><span style=\"color: rgb(33, 33, 33);\">1.)</span><span style=\"font-size: 7pt; color: rgb(33, 33, 33);\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"color: rgb(33, 33, 33);\">Theravance Biopharma has developed an oral pan-JAK inhibitor designed to inhibit the JAK family of enzymes&nbsp;<strong>directly&nbsp;</strong></span><strong><span lang=\"EN\" style=\"color: rgb(33, 33, 33);\">at the site of inflammation</span></strong><span lang=\"EN\" style=\"color: rgb(33, 33, 33);\">&nbsp;in the intestinal wall&nbsp;</span><span style=\"color: rgb(33, 33, 33);\">while minimizing systemic exposure.<u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><span style=\"color: rgb(33, 33, 33);\">2.)</span><span style=\"font-size: 7pt; color: rgb(33, 33, 33);\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"color: rgb(33, 33, 33);\">While relying on the established mechanism of action of a JAK inhibitor, this intestinally-restricted JAK inhibitor may have the potential to treat CD with&nbsp;<strong>minimal</strong>&nbsp;<strong>immunosuppressive effects</strong>.<u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><span style=\"color: rgb(33, 33, 33);\">3.)</span><span style=\"font-size: 7pt; color: rgb(33, 33, 33);\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"color: rgb(33, 33, 33);\">The data from the first cohort of UC patients in the Company’s Phase 1b study evaluating this pan-JAK inhibitor have provided encouraging initial evidence of localized biological activity with a favorable tolerability profile that is consistent with the desired target product profile given the shared pathogenic immunologic processes between CD and UC.<u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><strong><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span></strong><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><strong><u><span style=\"color: rgb(33, 33, 33);\">Our Objective</span></u></strong><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><span style=\"color: rgb(33, 33, 33);\">To assess the efficacy, safety, and tolerability of this oral pan-JAK inhibitor designed to distribute adequately and predominantly to the tissues of the intestinal tract, treating inflammation in those tissues while minimizing systemic exposure and associated side effects.</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><span style=\"color: rgb(33, 33, 33);\"><br></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);\"=\"\"><span style=\"color: rgb(33, 33, 33);\">If interested please apply below.</span></p> ', null, null, '', '33,32,83', '1', '0', null, '2018-04-19 18:08:08', '2018-04-23 21:43:26', 'BTC', '0');
