INSERT INTO `trials` VALUES ('114', ' Catawaba - Atopic Dermatitis (17-0285) AtopicDermatitis-005-017', ' <p style=\"background-color: rgb(238, 238, 238);\">Catawaba has an Atopic Dermatitis study that\'s scheduled to start in May 2018</p><ul type=\"disc\" style=\"margin-top: 0in; margin-bottom: 0in; background-color: rgb(238, 238, 238); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><li class=\"m_-1785849827712571092MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 31.5pt; font-size: 11pt; font-family: Calibri, sans-serif;\">They\'re requiring a minimum of 30 patients enrolled over 4 months.</li></ul><p style=\"background-color: rgb(238, 238, 238);\"><font color=\"#222222\" face=\"Calibri, sans-serif\"><span style=\"font-size: 14.6667px;\">If interested please apply here.</span></font></p><p style=\"background-color: rgb(238, 238, 238);\">Protocol Synopsis attached for review</p> ', null, 'a:1:{i:0;i:33;}', '1525046400', '28,32,83', '1', '0', null, '2018-04-20 01:28:11', '2018-05-01 16:25:00', 'InSearch', '0');
INSERT INTO `trials` VALUES ('115', 'BC#839144-01 Hypothyroidism Pre Award', '   <p>This is a Pre-Award but will be moving forward faster than most.</p><br><blockquote type=\"cite\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"m_-5875127058148581692WordSection1\"></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Sponsor is looking for sites that can get up and running ASAP.&nbsp; Attached is the blinded synopsis for review.&nbsp; I don’t have much I/E criteria.&nbsp;&nbsp; Looking for a FPI for July of this year.&nbsp; I don’t have an enrollment time frame yet but will let you know as soon as I get it.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Any data you have that can support your sites would be great to include.&nbsp;&nbsp;<u></u></p><p class=\"MsoNormal\"><u></u>&nbsp;</p><p></p></blockquote>   ', 'a:4:{i:0;i:99;i:1;i:100;i:2;i:101;i:3;i:102;}', 'a:1:{i:0;i:37;}', '1524441600', '31,32,38,83', '1', '0', null, '2018-04-20 03:34:59', '2018-05-01 16:20:56', 'CCT BD - Ron', '0');
INSERT INTO `trials` VALUES ('116', 'GSK - Prostate Cancer-001-017 (003-017)', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Phase I, open-label, dose-finding study for Drug-X when administered in combination with Drug-Y in male subjects with metastatic castration-resistant&nbsp;<span class=\"il\">prostate</span>&nbsp;<span class=\"il\">cancer</span>&nbsp;(mCRPC).&nbsp;</p>&nbsp;<p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Following this initial outreach, the protocol has undergone a major amendment and will now include dose escalation and expansion cohorts to include&nbsp;<span class=\"il\">Prostate</span>&nbsp;<span class=\"il\">Cancer</span>&nbsp;&amp; Solid Tumors (listed below)</p>&nbsp;<p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">You will be considered if you show any population to&nbsp;<span class=\"il\">Prostate</span>&nbsp;<span class=\"il\">Cancer</span>&nbsp;or any of the Solid Tumors.</p>&nbsp;<p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Study Information:</p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Phase 1</p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span class=\"il\">Prostate</span>&nbsp;<span class=\"il\">Cancer</span></p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 1in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: &quot;Courier New&quot;;\">o<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;</span></span>Metastatic&nbsp; Castration-resistant&nbsp;<span class=\"il\">Prostate</span>&nbsp;<span class=\"il\">Cancer</span>&nbsp;(mCRPC)</p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 0.5in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>Solid Tumor</p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 1in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: &quot;Courier New&quot;;\">o<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;</span></span>Triple Negative Breast&nbsp;<span class=\"il\">Cancer</span>&nbsp;<em>[ER, PR and HER2 negative, TNBC],</em></p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 1in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: &quot;Courier New&quot;;\">o<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;</span></span>Gastric Adenocarcinoma</p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 1in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: &quot;Courier New&quot;;\">o<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;</span></span>Colorectal Carcinoma&nbsp;<em>[CRC]</em></p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 1in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: &quot;Courier New&quot;;\">o<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;</span></span>Non-Small Cell Lung&nbsp;<span class=\"il\">Cancer</span>&nbsp;<em>[NSCLC]</em></p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 1in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: &quot;Courier New&quot;;\">o<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;</span></span>Endometroid&nbsp;<span class=\"il\">Cancer</span></p><p class=\"m_-1647273122490279395MsoListParagraph\" style=\"margin: 0in 0in 0.0001pt 1in; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\"><span style=\"font-family: &quot;Courier New&quot;;\">o<span style=\"font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;</span></span>Head &amp; Neck Squamous&nbsp;<span class=\"il\">Cancer</span>&nbsp;<em>[HNSCC]</em></p>', null, null, '1514678400', '50', '1', '0', null, '2018-04-20 04:48:17', '2018-04-20 04:48:17', 'BTC', '1');
INSERT INTO `trials` VALUES ('117', 'Symbio - Scalp Psoriasis Study', '<p style=\"color: rgb(34, 34, 34); font-family: &quot;Segoe UI&quot;; font-size: 13.3333px;\">Please find synopsis, CDA and feasibility questionnaire for a&nbsp;currently running&nbsp;<span class=\"il\">Scalp</span>&nbsp;<span class=\"il\">Psoriasis</span>&nbsp;<span class=\"il\">Study</span>.</p><p style=\"color: rgb(34, 34, 34); font-family: &quot;Segoe UI&quot;; font-size: 13.3333px;\">The sponsor potentially will be adding additional sites.</p><p style=\"color: rgb(34, 34, 34); font-family: &quot;Segoe UI&quot;; font-size: 13.3333px;\">The enrollment goal for each site is&nbsp;<strong>21</strong>&nbsp;subjects.&nbsp;</p>&nbsp;<p style=\"color: rgb(34, 34, 34); font-family: &quot;Segoe UI&quot;; font-size: 13.3333px;\"><font face=\"Segoe UI\"><font size=\"4\"><strong><span style=\"font-size: 8pt; font-family: Verdana, sans-serif; color: red;\">Note: This is a generic&nbsp;<span class=\"il\">study</span>, it is required that your site be self-identified with the FDA to participate</span></strong><span style=\"font-size: 8pt; font-family: Verdana, sans-serif; color: red;\">.<u></u><u></u></span></font></font></p>&nbsp;<p style=\"color: rgb(34, 34, 34); font-family: &quot;Segoe UI&quot;; font-size: 13.3333px;\">If interested in being considered for this&nbsp;<span class=\"il\">study</span>,&nbsp;<u>and self identified with the FDA</u>, please send back the completed questionnaire, signed CD, 483 if&nbsp;<span class=\"aBn\" data-term=\"goog_1869010769\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 5 years</span></span>&nbsp;and PI CV/Lic.&nbsp;</p>&nbsp;<p style=\"color: rgb(34, 34, 34); font-family: &quot;Segoe UI&quot;; font-size: 13.3333px;\">If you need more time to complete, please advise when you would be able to return the information to us.</p>', null, 'a:3:{i:0;i:39;i:1;i:40;i:2;i:41;}', '1524441600', '28,32,83', '1', '1', null, '2018-04-20 16:54:55', '2018-04-20 16:54:55', 'Western', '0');
INSERT INTO `trials` VALUES ('118', 'Corrona Combined RA / PsA-SpA Registry Study (2 study opportunities)', '<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\">Corrona, LLC is an independent research company collecting\r\nobservational registry data. Corrona’s mission is to advance medical research\r\nand improve patient care by providing unique, proprietary data regarding\r\ntreatment efficacy and outcomes of patients with autoimmune diseases in analyses\r\nof real-world settings.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\">Protocol synopsis is attached for your review on both the RA &amp; PsA/SpA.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><strong><u>Rheumatoid Arthritis Registry\r\nResearch Opportunity<o:p></o:p></u></strong></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;tab-stops:list .75in\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">The\r\nCorrona® Rheumatoid Arthritis (RA) Registry is the largest RA real world\r\nprospective cohort study in the world. Data is collected from both physicians\r\nand patients at the time of a routine clinical encounter. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;tab-stops:list .75in\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">The\r\nCorrona® RA Registry has provided major contributions to the following: <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.75in;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;tab-stops:list .75in\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN\" style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">Greater understanding of the comparative\r\neffectiveness and safety of biologic or small molecule DMARD drugs.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.75in;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;tab-stops:list .75in\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN\" style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">Effects of biologic or small molecule\r\nDMARD drugs on risk of cardiovascular, infectious, and malignancy outcomes.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.75in;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;tab-stops:list .75in\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN\" style=\"mso-fareast-font-family:&quot;Times New Roman&quot;;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">Biologic and small molecule DMARD\r\nprescribing patterns, including the real world impact of the ACR RA DMARD\r\nguidelines on clinical care provided by rheumatologists.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;line-height:normal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;line-height:normal\"><u><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">Key facts about\r\nthe Corrona® RA Registry<o:p></o:p></span></u></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;\r\nmso-list:l0 level1 lfo2;tab-stops:list .75in\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">Currently\r\n&gt;23,000 RA patients followed with a mean length of follow-up of 4.41 years\r\n(median 3.46 years). Ability to query data on all products in the market space\r\nis unique to Corrona.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;\r\nmso-list:l0 level1 lfo2;tab-stops:list .75in\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">Open\r\nenrollment for all biologic, biosimilar, JAK inhibitor and conventional DMARD\r\nusers.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;\r\nmso-list:l0 level1 lfo2;tab-stops:list .75in\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">Physician\r\ndata collected at visit used to calculate clinical disease activity measures\r\nsuch as CDAI, DAS-28 and HAQ scores. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;\r\nmso-list:l0 level1 lfo2;tab-stops:list .75in\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#262626;\r\nletter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">Physician\r\nand patient questionnaires are completed at follow-up visits every 6 months.<o:p></o:p></span></p>\r\n\r\n<p><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\"><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\"><br></span>&nbsp;</span><strong><u><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">Psoriatic\r\nArthritis and Spondyloarthritis Registry Research Opportunity</span></u></strong></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:.25in;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN\" style=\"color:#262626;letter-spacing:\r\n.4pt;mso-ansi-language:EN\">The Corrona® Psoriatic Arthritis (PsA) and\r\nSpondyloarthritis (SpA/AS) registry was launched in March 2013 under the guidance\r\nof Dr. Philip Mease. </span>Corrona “re-launched” the registry in April 2017\r\nwith a protocol amendment and revised questionnaires, and is looking to build\r\nupon its current national network of rheumatology sites to grow the registry.<u><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\"><o:p></o:p></span></u></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:.25in;margin-bottom:.0001pt;mso-add-space:auto;\r\nline-height:normal\"><u><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;\r\nmso-ansi-language:EN\">&nbsp;</span></u></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;line-height:normal\"><u><span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">Key facts about\r\nthe Corrona® PsA-SpA Registry<o:p></o:p></span></u></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:.25in;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN\" style=\"color:#262626;letter-spacing:\r\n.4pt;mso-ansi-language:EN\">Currently, approximately 3,000 PsA-SpA patients are\r\nin the registry.<u><o:p></o:p></u></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:.25in;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#262626;letter-spacing:.4pt;mso-ansi-language:EN\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN\" style=\"color:#262626;letter-spacing:\r\n.4pt;mso-ansi-language:EN\">Open enrollment is for p</span>atients with a\r\ndiagnosis of psoriatic arthritis (PsA) and/or who meet the modified New York\r\ncriteria for ankylosing spondylitis (AS) and are newly prescribed (i.e.\r\nfirst-time user) an FDA-approved eligible biologic for the treatment of PsA or\r\nAS at the time of enrollment.<u><span lang=\"EN\" style=\"color:#262626;letter-spacing:\r\n.4pt;mso-ansi-language:EN\"><o:p></o:p></span></u></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->Physician and patient questionnaires are\r\ncompleted at routine clinical visits every 6 months. Data collected includes\r\npatient demographics and lifestyle factors, disease duration and characteristics,\r\nmedical history including prior and current PsA-SpA therapy, clinical outcome\r\nassessments (COA), and targeted safety events. <o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><br></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level1 lfo1\">If interested I\'ll send you the online link to complete.</p>\r\n\r\n<span lang=\"EN\" style=\"color:#262626;letter-spacing:.4pt;\r\nmso-ansi-language:EN\">&nbsp;</span>', 'a:2:{i:0;i:103;i:1;i:104;}', 'a:2:{i:0;i:42;i:1;i:43;}', '1525651200', '38,58,32,83', '1', '0', null, '2018-04-20 17:18:23', '2018-04-20 17:18:23', 'CCT Sales - Shilo', '0');
INSERT INTO `trials` VALUES ('119', '    Corrona IBD Registry Study    ', '    <p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Study Title: Corrona Inflammatory Bowel Disease (IBD) Registry</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Study Design: The Corrona IBD Registry is a prospective, non-interventional, research study for patients with IBD under the care of a certified gastroenterologist. Target enrollment is approximately 1,000 patients in the first year with no defined upper limit on enrollment after year one.</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Additional Information on Corrona IBD registry</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">This registry is sponsored by Corrona, an independent research company, in the autoimmune space that collects data on treatment efficacy and safety outcomes in a real-world patient setting. They are looking to build a national network of gastroenterology sites to grow the registry.</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Their new IBD registry is a non-interventional study for patients with a confirmed diagnosis of Crohn’s disease, ulcerative colitis, or indeterminate colitis. Data collection generally occurs at the time of routine clinical encounters approximately every 6 months. Blood collection and other diagnostic tests are not required; however, relevant standard of care test results should be reported when available.</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Registry questionnaires are completed by study staff and patient at every registry visit. Registry forms collect patient demographics and lifestyle factors, disease duration and characteristics, medical history, past and current IBD therapy, clinical outcome assessments (COA), and targeted safety events.</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">There is no upper limit on target enrollment or study duration. Practitioners are encouraged to enroll roughly 40 to 50 patients per year from their established patient population. Payment is provided for enrollment and follow-up visits, as well as for the completion of targeted adverse event forms.</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Registry Visits and TAE Questionnaire Completion</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Reimbursement (USD) $1015.00 per patient</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Enrollment</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">$450</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Follow-up</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">$300</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">TAE questionnaire</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">$50</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Supporting source documentation for TAE</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">$200</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Exit</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Will remain $15</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Also, patient stipends of 25.00 in the form of an AMEX GC is available.</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">For more information regarding the Corrona IBD registry please visit:</span></p><p><a style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 255); text-decoration-line: underline; font-family: arial, sans-serif; font-size: 13.3333px;\" href=\"http://www.prnewswire.com/news-releases/corrona-announces-first-patient-has-enrolled-in-its-inflammatory-bowel-disease-registry-300467326.html\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.prnewswire.com/news-releases/corrona-announces-first-patient-has-enrolled-in-its-inflammatory-bowel-disease-registry-300467326.html&amp;source=gmail&amp;ust=1524331862290000&amp;usg=AFQjCNFYOVghlyUHzWo3Xbfnbyetjs2K0w\">http://www.prnewswire.com/<wbr>news-releases/corrona-<wbr>announces-first-patient-has-<wbr>enrolled-in-its-inflammatory-<wbr>bowel-disease-registry-<wbr>300467326.html</a></p><br><p>If interested complete the attached feasibility questionnaire and send it back for full submission.</p>    ', null, 'a:3:{i:0;i:44;i:1;i:45;i:2;i:46;}', '1527465600', '33,32,38,83', '1', '1', null, '2018-04-20 17:40:18', '2018-05-02 15:18:52', 'BTC', '0');
INSERT INTO `trials` VALUES ('120', 'Knee Arthroplasty-001-017', '<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">We\'re working with Pacira to identify sites for a Phase 2 Total&nbsp;<span class=\"il\">Knee</span>&nbsp;<span class=\"il\">Arthroplasty</span>&nbsp;study.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Please see the additional study information listed below, and protocol attached. If you are interested in pursuing the study, please respond with interest by&nbsp;<strong><u><span style=\"color: red; background: yellow;\">3pm Tuesday September 19<sup>th</sup>&nbsp;and complete the attached FQ.</span></u></strong><span style=\"color: red;\"></span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258Default\"><strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Study Title:&nbsp;</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">A Randomized, Single-Blind, Active-Controlled, Dose-Ranging Study to Evaluate the Pharmacokinetics, Safety, and Efficacy of Local Administration of DepoTXA for Reduced Postsurgical Bleeding in Subjects Undergoing Total&nbsp;<span class=\"il\">Knee</span>&nbsp;<span class=\"il\">Arthroplasty</span><u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Patient Population</strong>:<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraph\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Approximately 60 patients (15 per treatment group) are planned for enrollment.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 0.5in;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Inclusion Criteria:<u></u><u></u></strong></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpFirst\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Male or female, ≥18 years of age at screening.<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Scheduled to undergo elective unilateral open TKA under general, spinal, or regional anesthesia.<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>American Society of Anesthesiology (ASA) physical status 1, 2, or 3.<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Female patient must be surgically sterile; or at least 2 years postmenopausal; or have a monogamous partner who is surgically sterile; or practicing double-barrier contraception; or practicing abstinence (must agree to use double-barrier contraception in the event of sexual activity); or using an insertable, injectable, or transdermal, contraceptive approved by the FDA for greater than 2 months prior to screening. All women of childbearing potential (ie, premenopausal without permanent sterilization) must commit to the use of an acceptable form of birth control for the duration of the study and for 30 days after completion of the study.<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Able to provide informed consent, adhere to the study visit schedule, and complete all study assessments.<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpLast\" style=\"margin-left: 0.75in;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Exclusion Criteria:</strong><u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpFirst\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Currently pregnant, nursing, or planning to become pregnant during the study or within 30 days after study drug administration.<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Planned concurrent surgical procedure (eg, bilateral TKA).<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Prior open&nbsp;<span class=\"il\">knee</span>&nbsp;surgery on ipsilateral&nbsp;<span class=\"il\">knee</span>. Prior arthroscopy is permitted.<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Patients taking a medication with a known procoagulant effect (eg, combination hormonal contraceptives, Factor IX complex concentrates or anti-inhibitor coagulant concentrates, or all-trans retinoic acid).<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Contraindication or hypersensitivity to TXA.<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpLast\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>History of thrombosis or prior VTE.<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258Default\"><strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"><u></u>&nbsp;<u></u></span></strong></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258Default\"><strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Study information:&nbsp;</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Patients will be randomized in a 1:1:1:1 ratio to receive either DepoTXA 400 mg, DepoTXA 800 mg, DepoTXA 1200 mg, or IV TXA (CYKLOKAPRON® 1 gram).<u></u><u></u></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258Default\"><strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Objectives:</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"><u></u><u></u></span></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpFirst\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Primary objective: The primary objective of this study is to evaluate the pharmacokinetics of DepoTXA compared to intravenous (IV) tranexamic acid (TXA).<u></u><u></u></p><p class=\"m_-1443692160462395468gmail-m_2525112252025863258MsoListParagraphCxSpLast\" style=\"margin-left: 0.75in;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Secondary objectives: The secondary objectives of this study are (1) to evaluate the safety of DepoTXA, (2) to evaluate the efficacy of DepoTXA (over 5 days) compared to IV TXA, and (3) to evaluate DepoTXA for a dose-related response at 400, 800, and 1200 mg (33 mg/mL).<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><br><u></u></p><p><p class=\"m_-1443692160462395468gmail_signature\"><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0); font-size: 10pt;\">Respectfully,<br><br>Shilo West<br><br>Managing Director<br>Administrative Clinical Study Start-up Services<br>Conduct Clinical Trials<br><br>T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323<br>E:&nbsp;<a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">Shilo@<wbr>conductclinicaltrials.com</a><br><br>Internet Site:&nbsp;<a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1524579272256000&amp;usg=AFQjCNEVHUtZndOIwTI3UCkQr_ItqcBcOQ\" style=\"color: rgb(17, 85, 204);\">www.<wbr>conductclinicaltrials.com</a><br><br><strong><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br>Conduct Clinical Trials<br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0); font-size: 10pt;\"><br></span><p class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><div class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"></div></p></p></p>', null, null, '1521763200', '47,83', '1', '0', null, '2018-04-23 14:19:33', '2018-04-23 14:19:33', 'BTC', '1');
INSERT INTO `trials` VALUES ('121', 'Pediatric Tourette Syndrome Study - TS2005', ' Please review clinical trial outline that is attached and if interested download the questionnaire and return for submission. ', null, 'a:2:{i:0;i:56;i:1;i:57;}', '1525046400', '84,83', '1', '1', null, '2018-04-23 23:49:11', '2018-05-01 15:51:21', 'Western', '0');
INSERT INTO `trials` VALUES ('122', ' CIRT - NHLBI Cardiovascular Inflamation Reduction Trial ', ' <p><font color=\"#222222\" face=\"arial, sans-serif\"><span style=\"font-size: 13.3333px;\"><strong>Study closed due to safety reasons by sponsor</strong></span></font><br></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">NHLBI in collaboration with Brigham and Women’s Hospital is still seeking sites for an ongoing Cardiovascular Inflammation Reduction Trial (CIRT). The aim is to test the inflammatory hypothesis of atherosclerosis.</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Please find some information pasted from the LOI attached:</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">In a double-blind fashion, CIRT is randomizing stable atherosclerosis patients to either a common anti-inflammatory therapy routinely used for rheumatoid arthritis (low dose methotrexate) or to placebo. CIRT will determine whether this anti-inflammatory treatment will reduce the rate of MI, stroke or cardiovascular death among stable atherosclerosis patients with either diabetes or metabolic syndrome, a group with a known persistent pro-inflammatory response.</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">They welcome the participation of any clinical site that can enroll at least 20 patients. A total of 7,000 patients will be enrolled.</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">The following is an abbreviated list of the CIRT inclusion criteria:</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">• Age &gt; 18 years</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">• Myocardial infarction and/or evidence of multi-vessel coronary artery disease by angiography in the past 5 years</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">• Type 2 diabetes and/or metabolic syndrome</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">• No contraindication to low-dose methotrexate</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">They have increased the budget- so now they are at $6,250.0 per participant – (a little better), I have attached the protocol summary along with the site evaluation, FDA1572 and W-9; don’t hesitate with any questions! They are hoping sites can randomize and follow 20 participants.</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Clinical Trials.gov link: BWH CIRT Study Link</span></p><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\">Attached, please find a protocol summary, site evaluation form, and letter of interest. If interested, please send the site evaluation form back to me.</span></p> ', null, null, '1522627200', '59,26,38,32,83', '1', '0', null, '2018-04-24 00:18:01', '2018-04-24 00:41:07', 'BTC', '1');
INSERT INTO `trials` VALUES ('123', '  Vanda Pharma- Phase 2b/3 Atopic Dermatitis Study -- Atopic Dermatitis-006-018  ', '  <p id=\":ws\" class=\"ii gt \" style=\"font-size: 12.8px; direction: ltr; margin: 5px 15px 0px 0px; padding-bottom: 5px; position: relative; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"></p><p id=\":q8\" class=\"a3s aXjCH m161df7e765bd5810\" style=\"overflow: hidden;\"></p><p dir=\"ltr\"></p><p class=\"gmail_quote\"></p><p dir=\"ltr\" style=\"color: rgb(0, 0, 0); font-family: Calibri, Arial, Helvetica, sans-serif;\"></p><p style=\"color: rgb(33, 33, 33);\"></p><p class=\"m_-5683786236131211528m_-8703705896768513020WordSection1\"></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-size: 12pt;\"><span style=\"font-size: 12pt;\">We\'re working with&nbsp;<span class=\"il\">Vanda</span>&nbsp;Pharmaceuticals who is currently seeking sites for their upcoming&nbsp;</span><em><span class=\"il\">Phase</span>&nbsp;2b/3 in Subjects with Treatment-Resistant Pruritus Associated with Atopic Dermatitis.</em><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-size: 12pt;\"><em>&nbsp;</em></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-size: 12pt;\">Please see additional study information listed below. If you are interested in being considered for this study, please&nbsp;<strong><span style=\"background: yellow;\">complete both feasibility sections attached (short, full) and respond back with interest by COB Friday March 2<sup>nd</sup></span></strong>!</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"background-color: rgb(255, 255, 0);\"><strong><u><font size=\"6\">This form can be submitted online however, we prefer it to be printed and sent back so we can make sure it\'s sent in.&nbsp; If you complete it online please let me know so we can get your CV over right away.</font></u></strong></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-size: 12pt;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-size: 12pt;\"><strong><u>Title of Study:</u>&nbsp;</strong>A Randomized, Double-Blind, Placebo-Controlled, Efficacy Study of the Neurokinin-1 Receptor Antagonist VLY-686 in Subjects with Treatment-Resistant Pruritus Associated with Atopic Dermatitis (VP-VLY-686-3101)<strong><strong><strong><strong><b></b></strong></strong></strong></strong></p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-size: 12pt;\"><strong><u>Studied period:&nbsp;</u></strong></p><p class=\"m_-5683786236131211528m_-8703705896768513020MsoListParagraph\" style=\"font-size: 12pt;\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Date first subject enrolled: April 2018<strong><strong><strong><strong><b></b></strong></strong></strong></strong></p><p class=\"m_-5683786236131211528m_-8703705896768513020MsoListParagraph\" style=\"font-size: 12pt;\">-<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Estimated study duration: 18-24 months</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-size: 12pt;\"><strong><u>Number of subjects (planned):</u>&nbsp;</strong>500 subjects randomized (250 per arm, 1:1 randomization scheme), diagnosed with atopic dermatitis with treatment-resistant pruritus (i.e. pruritus duration of &gt; 6 weeks despite the use of antihistamines or corticosteroids)&nbsp;</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-size: 12pt;\"><strong><u>Inclusion Criteria:</u></strong></p><ol start=\"1\" type=\"1\" style=\"font-size: 12pt; margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Male and non-pregnant, non-lactating female subjects aged 18 – 70 years (inclusive);<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Diagnosed with atopic dermatitis<strong><strong><strong><strong><b></b></strong></strong></strong></strong><ol start=\"1\" type=\"a\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">with a SCORAD index&nbsp; ≤ 80 at the screening and baseline visits;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">≥ 5% body surface area (BSA) of&nbsp;<span class=\"il\">AD</span>&nbsp;involvement at the screening and baseline visits<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li></ol></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Suffering from chronic pruritus with pruritus being actively present for at least 6 weeks prior to screening despite the use of antihistamines or corticosteroids;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Worst Itch Numerical Rating Score (NRS<sub>)&nbsp; ≥</sub>&nbsp;7-points&nbsp;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Subjects with Body Mass Index (BMI) of ≥18 and ≤35 kg/m<sup>2</sup>&nbsp;(BMI = weight (kg)/ [height (m)]<sup>2</sup>);&nbsp;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li></ol>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px; font-size: 12pt;\"><strong><u>Exclusion Criteria:</u></strong></p><ol start=\"1\" type=\"1\" style=\"font-size: 12pt; margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Chronic pruritus due to condition other than atopic dermatitis (<span class=\"il\">AD</span>)&nbsp;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Superinfection of&nbsp;<span class=\"il\">AD</span>;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Unwilling or unable to follow medication restrictions described in Section 7.2, or unwilling or unable to sufficiently washout from use of restricted medication. &nbsp;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Under medical treatment for a skin disease with a therapy listed in the prohibited medications section that may influence the results of the study;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Recent history (within six months of screening) of drug or alcohol abuse as defined in DSM-5 Diagnostic Criteria for Drug and Alcohol Abuse and/or a positive drug or alcohol screen at the Screening visit and Baseline;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Subject has ever made a suicide attempt and/or had suicidal ideation of type 4 or 5 on the Columbia Suicide Severity Rating Scale (C-SSRS) or subject is at risk of suicide at Screening or Baseline, in the opinion of the investigator;&nbsp;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Any medical procedure requiring general anesthetic within three months of the Baseline Visit or any procedure requiring sedation within one month of the baseline visit;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Current clinically significant cardiovascular, respiratory, neurologic, hepatic, hematopoietic, renal, gastrointestinal or metabolic dysfunction unless currently controlled and stable, including (but not limited to) the following:<strong><strong><strong><strong><b></b></strong></strong></strong></strong><ol start=\"1\" type=\"a\" style=\"margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Uncontrolled diabetes mellitus defined as HbA1c &gt;7%;<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Positive hepatitis C antibody test (anti-HCF);<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\">Positive hepatitis B surface antigen (HBsAg);<strong><strong><strong><strong><b></b></strong></strong></strong></strong></li></ol></li></ol>&nbsp;<p></p><p></p><p></p><p></p><p dir=\"ltr\" style=\"font-size: small;\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\"><br class=\"m_-5683786236131211528gmail-Apple-interchange-newline\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@<wbr>conductclinicaltrials.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1524765640473000&amp;usg=AFQjCNH2inN7GAyv0gSDo-sWlBY6TIpGpQ\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.<wbr>conductclinicaltrials.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\" style=\"font-size: small;\"></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical&nbsp;<span class=\"il\">trial</span>&nbsp;teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p></p><p class=\"yj6qo\"></p><div class=\"yj6qo\"></div><p></p><br><p></p><p class=\"adL\"></p><div class=\"adL\"></div><p></p><p></p><p></p><p class=\"hq gt\" id=\":19z\" style=\"margin: 15px 0px; clear: both; font-size: 12.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"></p><div class=\"hq gt\" id=\":19z\" style=\"margin: 15px 0px; clear: both; font-size: 12.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"></div><p></p>  ', null, 'a:5:{i:0;i:70;i:1;i:71;i:2;i:72;i:3;i:73;i:4;i:74;}', '', '28,83,', '1', '1', null, '2018-04-25 18:43:33', '2018-04-30 16:47:06', 'BTC', '0');
INSERT INTO `trials` VALUES ('124', 'Parexel Upcoming Bladder Cancer Study- Bladder Cancer-001-018', '<p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p dir=\"ltr\" style=\"font-size: 12pt; color: rgb(0, 0, 0); font-family: Calibri, Arial, Helvetica, sans-serif;\"><p style=\"color: rgb(33, 33, 33);\"><p class=\"m_4071672864724971513m_-5305935011113101953WordSection1\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">Urologists only!&nbsp;</span><br></p><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">&nbsp;</span><br><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Parexel is seeking experienced Urologists with a fairly large population for an Upcoming&nbsp;<span class=\"il\">Bladder</span>&nbsp;<span class=\"il\">Cancer</span>&nbsp;Study (</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">metastatic or unresectable) with subjects having progressed after a first line of treatment .There is limited information at this time, but if you are interested in learning more please let me know&nbsp;<strong>no later than Friday April 13<sup>th</sup>.</strong></span></p><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</span><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Site Requirements:</span></strong></p><p class=\"m_4071672864724971513m_-5305935011113101953MsoListParagraph\"><span style=\"font-size: 11pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Site Pharmacy</span></p><p class=\"m_4071672864724971513m_-5305935011113101953MsoListParagraph\"><span style=\"font-size: 11pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Radiology affiliation on or offsite to&nbsp;</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">conduct a complex &nbsp;&amp; demanding study that will include PK/PD assessments</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"></span></p><p class=\"m_4071672864724971513m_-5305935011113101953MsoListParagraph\"><span style=\"font-size: 11pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Study drug under evaluation is an monoclonal antibody</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"></span></p><p class=\"m_4071672864724971513m_-5305935011113101953MsoListParagraph\"><span style=\"font-size: 11pt; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">Fairly large population</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"></span></p><p class=\"m_4071672864724971513m_-5305935011113101953MsoListParagraph\"><span style=\"font-size: 11pt; font