lion dollars and costs society the loss of human lives.</font></p></p></p></p></p></p></p><p class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><div class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"></div></p><br class=\"m_4071672864724971513gmail-Apple-interchange-newline\">', null, null, null, '50', '0', '0', '1524692105', '2018-04-25 19:56:59', '2018-04-25 21:35:05', 'BTC', '0');
INSERT INTO `trials` VALUES ('125', 'Parexel Upcoming Phase 2b Moderate to Severe Crohn\'s Study- Crohn\'s-004-018', '<p style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><span style=\"font-family: Calibri, sans-serif; font-size: 11pt; color: rgb(33, 33, 33);\">Good Morning,</span></p><p style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; color: rgb(33, 33, 33);\"><p class=\"m_4476552458290566139WordSection1\">&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">I hope you had a nice weekend! Parexel is working with Janssen on an Upcoming Phase IIb study in patients with Moderate to Severe Crohn’s Disease. Please find study details below and if you are interested in receiving a CDA to learn more please let me know no later than<span style=\"background-color: rgb(255, 255, 0);\">&nbsp;</span><strong><span class=\"aBn\" data-term=\"goog_1323661724\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">3PM</span></span>&nbsp;Wednesday March 28<sup>th</sup>. Study is starting up quickly with FPI April.&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span lang=\"FR\">Study Title<em>: &nbsp;&nbsp;</em></span></strong>A Phase 2b, Randomized, Double-blind Placebo-controlled, Parallel-group, Multicenter Protocol to Evaluate the Safety and Efficacy of JNJ64304500 in Subjects with Moderately to Severely Active Crohn’s Disease<strong><em><span lang=\"FR\"></span></em></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Key Information about the study drug:&nbsp;</strong><span lang=\"EN-GB\">Biological Agent</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Study Type</strong>: Interventional<strong><strong><b></b></strong></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Study Design:&nbsp;</strong>Allocation: Randomized Intervention Model - Parallel Assignment Masking: Double Blind (Subject, Investigator) Primary Purpose: Treatment</p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Benefits of the Study Drug:</strong>&nbsp;<span lang=\"EN-GB\">Offers patient access to latest treatment</span></p>&nbsp;<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>General Enrollment Study Timelines:&nbsp;</strong>Apr 2018 to Sep 2019</p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>&nbsp;</strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"background: yellow;\">Study Questions:</span></strong><strong><strong><b></b></strong></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>&nbsp;</strong></p><ol start=\"1\" type=\"1\" style=\"margin-bottom: 0in; margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN-GB\">Will you be interested in a Phase II/III Crohn’s disease trial?</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN-GB\">If yes, do you treat Crohn’s Disease patients that have demonstrated an inadequate response to, or have failed to tolerate biological treatments?</span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><span lang=\"EN-GB\">Do you also treat Crohn’s Disease patients that have demonstrated an inadequate response to or have failed to tolerate conventional treatments such as corticosteroids or immunomodulators (6-MP, AZA, or MTX)?</span></li></ol></p></p>', null, null, null, '83', '0', '0', '1524757766', '2018-04-26 15:38:25', '2018-04-26 15:49:26', 'BTC', '0');
