INSERT INTO `trials` VALUES ('128', '  Jazz Pharmaceuticals - Upcoming Trials in Hypersomnia- Hypersomnia-003-018  ', '  <p style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\">&nbsp;They haven\'t specified whether a sleep lab is required but I would assume so. Only for sites who have a sleep lab affiliation! (:&nbsp;<br></p><br><p dir=\"ltr\" style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 12pt;\"></p><p style=\"margin-bottom: 0px;\"><span style=\"text-decoration-line: underline;\"><strong><span class=\"il\">HYPERSOMNIA</span>&nbsp;IN MDD:&nbsp;<span class=\"il\">Hypersomnia</span>-<span class=\"il\">003</span>-<span class=\"il\">018</span></strong></span></p><br><p style=\"margin-bottom: 0px;\">Good morning/afternoon,&nbsp;<br></p><br><p style=\"margin-bottom: 0px;\">Jazz Pharmaceuticals is&nbsp;working on identifying sites for an upcoming trial for&nbsp;<strong><span class=\"il\">hypersomnia</span>&nbsp;in MDD patients</strong>. There is not much information available at this time, but if you are interested, please respond to this email .&nbsp;More information will be sent as it is received and the trial moves forward.&nbsp;&nbsp;If you have any database numbers for patients in this indication, please send over as well!&nbsp;</p><p></p>  ', null, null, '', '90,56,44,38', '1', '0', null, '2018-04-27 16:18:20', '2018-04-27 20:35:36', 'BTC', '0');
INSERT INTO `trials` VALUES ('129', '  Jazz Pharmaceuticals - Upcoming Trials in Hypersomnia- Hypersomnia-004-018 ', ' <p style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\">They haven\'t specified whether a sleep lab is required but I would assume so. Only for sites who have a sleep lab affiliation! (:&nbsp;<br></p><p><strong style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px; text-decoration-line: underline;\"><span class=\"il\">HYPERSOMNIA</span>&nbsp;IN MS:&nbsp;<span class=\"il\">Hypersomnia</span>-004-<span class=\"il\">018</span></strong><br></p><p style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><br class=\"m_-8481600741569006412Apple-interchange-newline\">Jazz Pharmaceuticals is&nbsp;working on identifying sites for an upcoming trial for&nbsp;<strong><span class=\"il\">hypersomnia</span>&nbsp;in multiple sclerosis</strong>&nbsp;patients.&nbsp;There is not much information available at this time,&nbsp;but if you are interested, please respond to this email.&nbsp;More information will be&nbsp;sent as it is received and the trial moves forward.&nbsp;&nbsp;If you have any&nbsp;database numbers&nbsp;for patients in this indication, please send over as well!&nbsp;<br></p><br><p style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\">​<br></p><p style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\">As always, feel free to reach out with any questions you may have.&nbsp;</p> ', null, null, '', '44,38,90,56', '1', '0', null, '2018-04-27 16:21:44', '2018-04-27 20:35:12', 'BTC', '0');
INSERT INTO `trials` VALUES ('130', ' PPD - BC#82580-01 Primary Progressive Multiple Sclerosis (PPMS) ', ' <p>Please see attached synopsis and respond to the questions if interested.&nbsp; Sponsor is specifically looking for investigators in neurology or neuromuscular medicine.</p><br><p><span style=\"color: rgb(34, 34, 34); font-family: tahoma, sans-serif; font-size: small;\">Ph3 study in Primary Progressive MS (PPMS).&nbsp; Anticipated FPI is December with a 24 month enrollment period.</span><br></p> ', 'a:6:{i:0;i:105;i:1;i:106;i:2;i:107;i:3;i:108;i:4;i:109;i:5;i:110;}', 'a:1:{i:0;i:68;}', '', '44,38', '1', '0', null, '2018-04-30 15:42:44', '2018-04-30 15:43:52', 'CCT BD - Ron', '0');
INSERT INTO `trials` VALUES ('131', 'Novum - Two Awarded Acne Vulgaris Trials (Acne-004-017)/Acne Vulgaris ', '<br><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"m_9063112386813480024gmail_signature\"><p dir=\"ltr\"><span style=\"background-color: yellow;\">Novum states they will only accept submission from PI’s who have trial experience in this indication with a history of high enrollment (20+). 1 FQ for both studies.</span><br></p></p></p><p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p lang=\"EN-US\"><p class=\"m_9063112386813480024gmail-m_7302842803294121513WordSection1\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Good afternoon,<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Novum has been awarded two upcoming&nbsp;<span class=\"il\">Acne</span>&nbsp;Vulgaris opportunities and is working to identify sites with prior trial experience in this indication. Please find attached synopsis and required documents for consideration.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">Please see study information listed below or synopsis attached for further information. If you are interested in pursuing this study<strong><u><span style=\"background: yellow;\">, please complete the following and respond with interest .</span></u></strong>&nbsp;Feel free to reach back out with any questions!<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u>1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Completed FQ<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u>2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Up to Date CLIA- Address must match what is provided on the FQ<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u>3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>Any FDA Audits from the last 5 years for the PI and/or site<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u>4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><u></u>A partially executed CDA (if you have not executed a CDA within the past 9 months with Novum)<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Study Summary:&nbsp;</strong>A Randomized, Double-Blind, Multiple Site, Placebo-Controlled, Parallel-Design Study Comparing a Test Drug to a Reference Drug in the Treatment of&nbsp;<span class=\"il\">Acne</span>&nbsp;Vulgaris.<strong><u></u><u></u></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Study Population:</strong>&nbsp;Healthy male or non-pregnant female patients 12 to 40 years of age with a clinical diagnosis of&nbsp;<span class=\"il\">Acne</span>&nbsp;Vulgaris.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Route of Administration:&nbsp;</strong>Topical application twice daily, in the morning and evening, to the face as a thin film for 12 weeks.<strong><u></u><u></u></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Inclusion Criteria:<u></u><u></u></strong></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>On the face, ≥ 25 non-inflammatory lesions (i.e., open and closed comedones) AND ≤ 2 nodulocystic lesions (i.e., nodules and cysts) AND ≥20 inflammatory lesions (i.e., papules and pustules)<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Investigator’s Global Assessment (IGA) of&nbsp;<span class=\"il\">acne</span>&nbsp;severity grade 2, 3, or 4 (per Table 1).&nbsp;<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Willing and able to refrain from use of all other topical products, all&nbsp;<span class=\"il\">acne</span>&nbsp;medications, and all antibiotics (other than study treatment) during the 12-week treatment period.&nbsp;<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Willing to maintain constant any estrogen or oral contraceptive therapy during the 12-week treatment period.&nbsp;<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>If female and of child-bearing potential, have a negative urine pregnancy test at the baseline/randomization visit and prepared to abstain from sexual intercourse or use a reliable method of contraception during the study (e.g., condom with spermicide, IUD, oral, injected, transdermal or implanted hormonal contraceptives).&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong>Exclusion Criteria:<u></u><u></u></strong></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Presence of any skin condition that would interfere with the diagnosis or assessment of&nbsp;<span class=\"il\">Acne</span>&nbsp;Vulgaris (e.g., on the face: rosacea, dermatitis, psoriasis, squamous cell carcinoma, eczema, acneform eruptions caused by medications, steroid&nbsp;<span class=\"il\">acne</span>, steroid folliculitis, or bacterial folliculitis)<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Excessive facial hair (e.g., beards, sideburns, moustaches, etc.) that would interfere with the diagnosis or assessment of&nbsp;<span class=\"il\">Acne</span>&nbsp;Vulgaris.&nbsp;<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>History of hypersensitivity or allergy to any of the study medication ingredients.&nbsp;<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>History of regional enteritis or ulcerative colitis, or a history of antibiotic-associated colitis.<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Atopic individuals (e.g., atopic dermatitis, allergic rhinitis, asthma).<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Use within 6 months prior to baseline of oral retinoids (e.g., Accutane®) or therapeutic vitamin A supplements of greater than 10,000 units/day (multivitamins are allowed).&nbsp;<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Use for less than 3 months prior to baseline of estrogens or oral contraceptives.<u></u><u></u></p><p class=\"m_9063112386813480024gmail-m_7302842803294121513MsoListParagraph\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Use on the face within 1 month prior to baseline of 1) cryodestruction or chemodestruction, 2) dermabrasion, 3) photodynamic therapy, 4)&nbsp;<span class=\"il\">acne</span>&nbsp;surgery, 5) intralesional steroids, or 6) x-ray therapy.&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><u></u>&nbsp;<span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Respectfully,</span><br></p><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Shilo West</span><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Managing Director</span><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Administrative Clinical Study Start-up Services</span><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Conduct Clinical Trials</span><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-family: Verdana; font-size: 13.3333px;\">Shilo@<wbr>conductclinicaltrials.com</a><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1525200967777000&amp;usg=AFQjCNHQAjcZ8qSU_UOzHZ3zon8znrprqA\" style=\"color: rgb(17, 85, 204); font-family: Verdana; font-size: 13.3333px;\">www.<wbr>conductclinicaltrials.com</a><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><strong style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Conduct Clinical Trials</span><br style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</span></p></p></p>', null, 'a:3:{i:0;i:75;i:1;i:76;i:2;i:77;}', null, '28,83', '1', '0', null, '2018-04-30 19:10:59', '2018-04-30 19:10:59', 'BTC', '0');
INSERT INTO `trials` VALUES ('132', ' Accelovance - Cirrhosis Study Opportunity - limited information available ', ' Accelovance has a new potential study opportunity (Cirrhosis).&nbsp; We have very limited information right now and they\'re specifically looking for specialists in gastroenterology and hepatology.&nbsp; If you might be interested please answer the study questions on this application and we\'ll be sending your CV over to the sponsor. ', 'a:4:{i:0;i:111;i:1;i:112;i:2;i:113;i:3;i:114;}', null, '', '33,80,83', '1', '0', null, '2018-05-01 16:48:41', '2018-05-01 18:30:17', 'CCT BD - Shilo', '0');
INSERT INTO `trials` VALUES ('133', 'Galderma -Dermal Fillers-001-018', '<p style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><span style=\"font-size: 12pt;\">Happy Friday!</span><br></p><p dir=\"ltr\" style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 12pt;\"><br><p>Galderma is currently identifying sites for an upcoming study around&nbsp;<span class=\"il\">Dermal</span>&nbsp;<span class=\"il\">Fillers</span>&nbsp;slated to start up later this year.&nbsp; At this time no information is available, but they have asked that interested PIs submit metrics and CV, as they are looking for PIs with previous experience.&nbsp; If you are interested in learning more about this exciting opportunity, please respond with metrics and an updated CV&nbsp;</p><br><p><table width=\"574\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"width: 344.4pt;\"><tbody><tr height=\"100\" style=\"height: 60.2pt;\"><td width=\"128\" style=\"font-family: arial, sans-serif; margin: 0px; width: 77pt; height: 60.2pt; background-color: black; padding-right: 5.4pt; padding-left: 5.4pt; border: 1pt solid windowtext;\"><p style=\"margin: 0px;\"><font face=\"Calibri,sans-serif\" size=\"2\"><span style=\"font-size: 11pt;\"><font color=\"white\" size=\"2\"><span style=\"font-size: 10pt;\"><strong>Study Phase and Indication</strong></span></font></span></font></p></td><td width=\"71\" style=\"font-family: arial, sans-serif; margin: 0px; width: 42.9pt; height: 60.2pt; background-color: black; padding-right: 5.4pt; padding-left: 5.4pt; border-width: 1pt; border-style: solid solid solid none; border-color: windowtext;\"><p style=\"margin: 0px;\"><font face=\"Calibri,sans-serif\" size=\"2\"><span style=\"font-size: 11pt;\"><font color=\"white\" size=\"2\"><span style=\"font-size: 10pt;\"><strong>Enrollment Goal</strong></span></font></span></font></p></td><td width=\"84\" style=\"font-family: arial, sans-serif; margin: 0px; width: 50.75pt; height: 60.2pt; background-color: black; padding-right: 5.4pt; padding-left: 5.4pt; border-width: 1pt; border-style: solid solid solid none; border-color: windowtext;\"><p style=\"margin: 0px;\"><font face=\"Calibri,sans-serif\" size=\"2\"><span style=\"font-size: 11pt;\"><font color=\"white\" size=\"2\"><span style=\"font-size: 10pt;\"><strong># of Patients Screened</strong></span></font></span></font></p></td><td width=\"89\" style=\"font-family: arial, sans-serif; margin: 0px; width: 53.85pt; height: 60.2pt; background-color: black; padding-right: 5.4pt; padding-left: 5.4pt; border-width: 1pt; border-style: solid solid solid none; border-color: windowtext;\"><p style=\"margin: 0px;\"><font face=\"Calibri,sans-serif\" size=\"2\"><span style=\"font-size: 11pt;\"><font color=\"white\" size=\"2\"><span style=\"font-size: 10pt;\"><strong># of Patients Enrolled</strong></span></font></span></font></p></td><td width=\"93\" style=\"font-family: arial, sans-serif; margin: 0px; width: 56pt; height: 60.2pt; background-color: black; padding-right: 5.4pt; padding-left: 5.4pt; border-width: 1pt; border-style: solid solid solid none; border-color: windowtext;\"><p style=\"margin: 0px;\"><font face=\"Calibri,sans-serif\" size=\"2\"><span style=\"font-size: 11pt;\"><font color=\"white\" size=\"2\"><span style=\"font-size: 10pt;\"><strong># of Patients Completed</strong></span></font></span></font></p></td><td width=\"106\" style=\"font-family: arial, sans-serif; margin: 0px; width: 63.9pt; height: 60.2pt; background-color: black; padding-right: 5.4pt; padding-left: 5.4pt; border-width: 1pt; border-style: solid solid solid none; border-color: windowtext;\"><p style=\"margin: 0px;\"><font face=\"Calibri,sans-serif\" size=\"2\"><span style=\"font-size: 11pt;\"><font color=\"white\" size=\"2\"><span style=\"font-size: 10pt;\"><strong>Length of Enrollment Period/ specify if competitive enrollment</strong></span></font></span></font></p></td></tr><tr height=\"20\" style=\"height: