INSERT INTO `trials` VALUES ('134', 'Access Biologicals - Cushing\'s Sample Collection-001-018', '<p><span style=\"font-family: arial, sans-serif; font-size: 12.8px; color: rgb(68, 68, 68);\"><strong><font size=\"4\" face=\"georgia, serif\"><u><em>Good Morning,</em></u></font></strong></span></p><br style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\"><p><font color=\"#444444\" face=\"Arial, Verdana, Helvetica, Segoe UI Emoji, Segoe UI Symbol, sans-serif\"><span style=\"font-size: 13px;\">Access Biological\'s&nbsp;have received a request for the following types of&nbsp;</span></font><span class=\"il\" style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\">samples</span><font color=\"#444444\" face=\"Arial, Verdana, Helvetica, Segoe UI Emoji, Segoe UI Symbol, sans-serif\"><span style=\"font-size: 13px;\">. If your site could potentially contribute to this&nbsp;</span></font><span class=\"il\" style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\">collection</span><font color=\"#444444\" face=\"Arial, Verdana, Helvetica, Segoe UI Emoji, Segoe UI Symbol, sans-serif\"><span style=\"font-size: 13px;\">, please provide us with the information below. Please let me know if you are interested in pursuing providing the estimated number of&nbsp;</span></font><span class=\"il\" style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\">samples</span><font color=\"#444444\" face=\"Arial, Verdana, Helvetica, Segoe UI Emoji, Segoe UI Symbol, sans-serif\"><span style=\"font-size: 13px;\">&nbsp;and time frame for all listed below.</span></font></p><br style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\"><br style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\"><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\"><span class=\"il\">CUSHING</span>’S DISEASE</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\">· ESTIMATED NUMBER OF PATIENTS	</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\">· TIME FRAME TO COLLECT&nbsp;<span class=\"il\">SAMPLES</span>	</span></p><br style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\"><br style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\"><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\">ADDISON’S DISEASE</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\">· ESTIMATED NUMBER OF PATIENTS	</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Verdana, Helvetica, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, sans-serif; font-size: 13px;\">· TIME FRAME TO COLLECT&nbsp;<span class=\"il\">SAMPLES</span>	</span></p><br style=\"color: rgb(68, 68, 68); font-