INSERT INTO `trials` VALUES ('136', 'ICON/Pfizer Atopic Dermatitis-004-018 (B7451013- 9002/0550) Phase 3 Atopic Dermatitis Study -Adolescents & Adults', '<p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">ICON is working with Pfizer on an upcoming phase 3 moderate to severe atopic dermatitis study. To be included in the feasibility process, ICON will need to submit your information to Pfizer for sponsor approval.<u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><strong><u><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u><span style=\"text-decoration-line: none;\">&nbsp;</span><u></u></span></font></u></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Study Title:</span></font></strong><strong><font size=\"2\" color=\"black\" face=\"Arial\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\">&nbsp;</span></font></strong><font color=\"black\">A PHASE 3 RANDOMIZED WITHDRAWAL, DOUBLE-BLIND, PLACEBO-CONTROLLED, MULTI-CENTER STUDY INVESTIGATING THE EFFICACY AND SAFETY OF PF-04965842 IN SUBJECTS AGED 12 YEARS AND OVER, WITH MODERATE TO SEVERE ATOPIC DERMATITIS WITH THE OPTION OF RESCUE TREATMENT IN FLARING SUBJECTS</font><font size=\"2\" color=\"black\" face=\"Arial\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\"><u></u><u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Primary Objective:&nbsp;</span></font></strong>To evaluate and compare the maintenance of effect of two doses of PF-04965842 (200 mg and 100 mg once daily [QD]) and placebo in subjects aged 12 and above with moderate to severe atopic dermatitis who respond to an initial open-label run-in treatment of 200 mg PF-04965842 QD.<strong><u></u><u></u></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Study Treatments:&nbsp;</span></font></strong>All enrolled subjects receive 12 weeks of 200 mg PF-04965842 QD during the open-label<strong>&nbsp;</strong>run-in induction period. At the end of the 12 weeks, subjects responding to treatment as<strong>&nbsp;</strong>described above are randomized to receive double-blind maintenance treatment with 100 mg<strong>&nbsp;</strong>PF-04965842 QD, 200 mg PF-04965842 QD, or placebo (1:1:1 randomization ratio) for<strong>&nbsp;</strong>40-weeks. In the event of flare during blinded treatment, subjects enter a 12-week open-label<strong>&nbsp;</strong>rescue period and receive 200 mg PF-04965842 QD with concomitant topical therapy per<strong>&nbsp;</strong>SOC.<strong><u></u><u></u></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Inclusion Criteria:</span></font></strong><u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Evidence of a personally signed and dated informed consent document indicating that the subject or their parent(s)/legal guardian, if applicable, have been informed of all pertinent aspects of the study.<strong><u></u><u></u></strong></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><strong>Male or female subjects of 12 years of age or older</strong>, at the time of informed consent and body weight 40 kg. Adolescent subjects below the age of 18 years old (or country-specific age of majority) will only be enrolled in this study if instructed by the sponsor and approved by the country or regulatory/health authority. If these approvals have not been granted, only subjects aged 18 years (or country-specific age of majority) and older will be enrolled.<strong><u></u><u></u></strong></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Meet all the following atopic dermatitis criteria:<strong><u></u><u></u></strong></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Clinical diagnosis of chronic atopic dermatitis (also known as atopic eczema) for at least 1 year prior to Day 1 and has confirmed atopic dermatitis at the screening and baseline visits according to Hanifin and Rajka criteria of AD<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Documented recent history (within 6 months before the screening visit) of inadequate response to treatment with topical medications for at least 4 weeks, or for whom topical treatments are inadequate, or who have required systemic therapies for control of their diseases.<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Moderate to severe AD (affected BSA &nbsp;<u>&gt;</u>10%, IGA &nbsp;<u>&gt;</u>3, EASI&nbsp;<u>&gt;</u>&nbsp;16 and pruritus NRS&nbsp;<u>&gt;</u>4 at the baseline visit).<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Willing and able to comply with scheduled visits, treatment plan, laboratory tests and other study procedures.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Exclusion Criteria:<u></u><u></u></span></font></strong></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Other acute or chronic medical or psychiatric condition including recent (within the past year) or active suicidal ideation or behavior or laboratory abnormality that may increase the risk associated with study participation or investigational product administration or may interfere with the interpretation of study results and, in the judgment of the investigator, would make the subject inappropriate for entry into this study.<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Any psychiatric condition including recent or active suicidal ideation or behavior that meets any of the following criteria:<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Suicidal ideation associated with actual intent and a method or plan in the past year: “Yes” answers on items 4 or 5 of the Columbia suicide severity rating scale (C-SSRS) (Section 7.5; Appendix 15);<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Previous history of suicidal behaviors in the past 5 years: “Yes” answer (for events that occurred in the past 5 years) to any of the suicidal behavior items of the C-SSRS;<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Suicidal behaviors questionnaire – revised (SBQ-R) total score 8 (Appendix 16);<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Any lifetime history of serious or recurrent suicidal behavior;<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Clinically significant depression: patient health questionnaire – 8 items (PHQ-8) total score 15 (Appendix 17);<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>The presence of any current major psychiatric disorder that is not explicitly permitted in the inclusion/exclusion criteria;<u></u><u></u></p><p class=\"m_-5800404093161092730m_-194343342233615288m_-1073376586383860856m_-290532294992933326MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; margin-left: 1in;\"><u></u><font size=\"2\" face=\"Courier New\"><span style=\"font-size: 11pt;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>In the opinion of the investigator or Pfizer (or designee) exclusion is required.</p>', null, null, '1519776000', '28,83', '1', '0', null, '2018-05-01 22:22:50', '2018-05-01 22:22:50', 'BTC', '1');
INSERT INTO `trials` VALUES ('137', 'Catalyst Pharmaceuticals-MuSK + Myasthenia Gravis', '<dl><dt style=\"line-height: 1.42857;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px;\"><em>Good Morning/ Afternoon,</em></span></dt><dt style=\"line-height: 1.42857;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><br></span></dt><dt style=\"line-height: 1.42857;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><br></span></dt><dt style=\"line-height: 1.42857;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Ages Eligible for Study: 18+</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Inclusion Criteria:</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Willing and able to provide written informed consent after the nature of the study has been explained and before the start of any research-related procedures.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Male or female ≥18 years of age.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Positive serologic test for anti-MuSK antibodies or anti-AChR antibodies as confirmed at Screening or by previous antibody test, with report available.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Confirmatory EMG or EMG report.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Myasthenia Gravis Foundation of America (MGFA) Class II to IV at Screening.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">MG-ADL score of ≥6 at Screening, with more than 50% of this score attributed to non-ocular items.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Patients receiving steroids or pyridostigmine should not have any modification of drug regimen during the month before Screening.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Female patients of childbearing potential must have a negative pregnancy test (serum human chorionic gonadotropin [HCG] at screening); and must practice an effective, reliable contraceptive regimen during the study and for up to 30 days following discontinuation of treatment.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Ability to participate in the study based on overall health of the patient and disease prognosis, as applicable, in the opinion of the Investigator; and able to comply with all requirements of the protocol, including completion of study questionnaires.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Exclusion Criteria:</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Epilepsy and currently on medication.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Concomitant use of medicinal products with a known potential to cause QTc prolongation.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Patients with long QT syndromes.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">History of thymectomy&nbsp;</span><span class=\"aBn\" data-term=\"goog_1229767827\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 12 months</span></span><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">&nbsp;before Screening.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">An electrocardiogram (ECG)&nbsp;</span><span class=\"aBn\" data-term=\"goog_1229767828\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 6 months</span></span><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">&nbsp;before starting treatment that shows clinically significant abnormalities, in the opinion of the Investigator.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Breastfeeding or pregnant at Screening or planning to become pregnant at any time during the study.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Patients receiving immunomodulatory treatment (e.g. plasma exchange [PE], therapeutic plasma exchange [TPE], intravenous immunoglobulin G [IVIG]) should not have any treatment in the previous 4 weeks prior to Randomization or at any time during the study.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Use of rituximab or other similar biologic medications for immunomodulation&nbsp;</span><span class=\"aBn\" data-term=\"goog_1229767829\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 6 months</span></span><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">&nbsp;prior to Screening.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Treatment with an investigational drug (other than amifampridine) or device&nbsp;</span><span class=\"aBn\" data-term=\"goog_1229767830\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 30 days</span></span><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">&nbsp;before Screening or while participating in this study.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">Any medical condition that, in the opinion of the Investigator, might interfere with the patient\'s participation in the study, poses an added risk for the patient, or confound the assessment of the patient.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">History of drug allergy to any pyridine-containing substances or any amifampridine excipient(s).</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13.3333px; font-weight: 400;\">As always, please reach out with any questions you may have.</span><br></dt></dl>', null, null, null, '53,83', '1', '0', null, '2018-05-02 16:12:26', '2018-05-02 16:12:26', 'Western ', '0');
INSERT INTO `trials` VALUES ('138', 'Inpatient Ph2 DFU-003-017 - Tissue Tech', '<p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; margin-top: 12pt; margin-bottom: 12pt;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif; color: black;\"><strong>Site selection is closed!</strong></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif; color: black;\"><strong><br></strong></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif; color: black;\">Tissue Tech is seeking sites with inpatient capabilities for a Phase 2 Non-Complex Diabetic Foot Ulcer Study with clinical suspicion of osteomyelitis. Unfortunately there is limited information at this time, but if you are interested in learning more, please advise on PI by&nbsp;<strong>COB&nbsp;<span class=\"aBn\" data-term=\"goog_2060939957\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">June 20th</span></span></strong>&nbsp;along with a completed feasibility .<u></u><u></u></span></p></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">Protocol:&nbsp;</span></strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">&nbsp;A Multicenter, Open Label Phase 2 Pilot Trial of Subjects with Complex Non-healing Diabetic Foot Ulcers Treated with Standard Care plus Cryopreserved Umbilical Cord Allograft (TTAX01)<u></u><u></u></span></p></p><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">&nbsp;<u></u><u></u></span><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">Primary Objective:</span></strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">&nbsp;The primary objective is to examine the safety and efficacy of TTAX01 plus standard care in achieving complete wound closure of complex non-healing DFUs with high risk factors of {1} ulcer depth indicating exposed bone, tendon, muscle, and/or joint space and {2} clinical suspicion of osteomyelitis. It is hypothesized that application at 4-week intervals of the human placental umbilical cord tissue TTAX01 to the surface of a well debrided, complex diabetic foot ulcer will, with concomitant management of infection, result in a higher proportion of wounds showing complete healing&nbsp;<span class=\"aBn\" data-term=\"goog_2060939958\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within 16 weeks</span></span>&nbsp;of initiating therapy. This open label pilot study provides a framework for a larger, randomized controlled pivotal phase 3 trial we are working on with FDA.<u></u><u></u></span></p></p><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: rgb(31, 73, 125);\">&nbsp;</span><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\"><u></u><u></u></span><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">Purpose:</span></strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">&nbsp;The purpose for conducting this phase 2 pilot trial is to evaluate the functionality of the protocol, and to obtain an estimate of product safety and efficacy when applied according to the protocol instructions, and measured according to the stated endpoints.<u></u><u></u></span></p></p><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">&nbsp;<u></u><u></u></span><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">Indication:&nbsp;</span></strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">To promote healing of complex non-healing diabetic foot ulcers with high risk factors of (1) ulcer depth indicating exposed bone, tendon, muscle and/or joint capsule and (2) clinically suspicious osteomyelitis, so as to reduce the likelihood of ulcer-related complications including limb amputation.<u></u><u></u></span></p></p><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">&nbsp;<u></u><u></u></span><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">&nbsp;</span></strong><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\"><u></u><u></u></span></p></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">Respectfully,<br><br>Shilo West<u></u><u></u></span></p></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">Managing Director<br>Administrative Clinical Study Start-up Services&nbsp;<br>Conduct Clinical Trials<u></u><u></u></span></p></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-439-9215<br>E:&nbsp;<a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\"><u><span style=\"color: blue;\">Shilo@conductclinicaltrials.<wbr>com</span></u></a><u></u><u></u></span></p></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\">Internet Site:&nbsp;<a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com&amp;source=gmail&amp;ust=1525364932409000&amp;usg=AFQjCNHK-utYuIVshsU_AX-7iTUq-J7P5g\" style=\"color: rgb(17, 85, 204);\"><u><span style=\"color: blue;\">www.conductclinicaltrials.com</span></u></a><u></u><u></u></span></p></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black;\"><br><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</span></p></p>', null, null, '1501459200', '55,83,', '1', '0', null, '2018-05-02 16:40:03', '2018-05-02 16:40:03', 'BTC', '1');
INSERT INTO `trials` VALUES ('139', '   PPD-T1DM-001-018   ', '   <p style=\"margin-bottom: 0px; font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 16px;\"><span style=\"font-size: 12pt;\">Good afternoon/morning ,</span><br></p><p dir=\"ltr\" style=\"font-family: Calibri, Arial, Helvetica, sans-serif; font-size: 12pt;\"></p><p dir=\"ltr\" style=\"font-size: 12pt;\"></p><p dir=\"ltr\" style=\"font-size: 12pt;\"></p><p dir=\"ltr\" style=\"font-size: 12pt;\"><br></p><p>PPD is seeking sites for an upcoming Type 1 Diabetes Mellitus trial. Not much information is available at this time, but if you are interested, please respond to this email .&nbsp;</p><p>Please feel free to reach out with any questions!&nbsp;<br></p><br><p>Best,&nbsp;</p><p></p><p></p><p></p><p></p>   ', null, null, '', '31,83,32,38', '1', '0', null, '2018-05-02 16:41:33', '2018-05-02 19:03:10', 'BTC', '0');
INSERT INTO `trials` VALUES ('140', 'PPD Pre-Award - BC#83764-01 - Gonorrhea', 'This is a pre-award, please review attached synopsis and if interested complete the questions below and click apply.', 'a:7:{i:0;i:115;i:1;i:116;i:2;i:117;i:3;i:118;i:4;i:119;i:5;i:120;i:6;i:121;}', 'a:1:{i:0;i:86;}', '1533081600', '46,32,83,37', '1', '0', null, '2018-05-07 17:26:00', '2018-05-07 17:26:00', 'CCT BD - Ron', '0');
INSERT INTO `trials` VALUES ('141', ' PPD Pediatric Migraine ', ' <p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><span style=\"font-size: 9.5pt;\">Duration of Treatment and Study Duration:</span></strong><em><span style=\"font-size: 9.5pt;\">&nbsp;</span></em><span style=\"font-size: 9.5pt;\">Subject duration on study: up to 52 weeks</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Protocol Title: A Double-Blind, Randomized, Placebo-Controlled, Sequential Parallel Comparison Design Trial to Evaluate the Efficacy and Safety of STUDY DRUG as a Therapy for the Prevention of Migraine in Pediatric Patients Ages 6-11<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-family: Arial, sans-serif;\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Indication: Episodic Migraine<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;<u></u><u></u></p><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\">FPI is Dec 2018<u></u><u></u></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;<u></u><u></u></p><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\">30 US only sites<u></u><u></u></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;<u></u><u></u></p><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\">Screen 240 to randomize 180<u></u><u></u></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;<u></u><u></u></p><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; margin-top: 0in;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\">Enrollment period is 9 mos.<u></u><u></u></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0px; margin-left: 0.5in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 3pt; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; text-align: justify;\"><strong><span style=\"font-size: 9.5pt;\">Criteria for Inclusion:</span></strong><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 9.5pt;\">Male and female subjects, 6-11 years of age, diagnosed with episodic migraine with or without aura (per ICHD-3 beta); parents/caregivers and subjects able to give consent/assent and follow the protocol requirements of the study; baseline migraine frequency of 3-12 migraine episodes per month; PedMIDAS disability score between 10 (mild disruption) and 140 (extreme disability); weight within the 50<sup>th</sup>&nbsp;and 95<sup>th</sup>&nbsp;percentile range for age and gender</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 9.5pt;\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 3pt; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; text-align: justify;\"><strong><span style=\"font-size: 9.5pt;\">Criteria for Exclusion:</span></strong><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 9.5pt;\">Patients unable to distinguish migraines from other headache types; chronic migraine (&gt;14 headache-days per month); patients with history or presence of significant diseases (e.g., pre-existing neurological or psychiatric conditions, prohibited medications, pregnancy, suicidality, history of illnesses that preclude the use of topiramate); patients with a diminished potential to respond to the study medication (e.g., acute medication overuse; previously failed therapies; refusal to discontinue non-pharmacological approaches; obesity); patients with an increased risk of AEs (low weight; previous allergic reactions; history of conditions contraindicated in topiramate therapy); any reason that could interfere with the subject’s participation in the study as determined by Investigator.</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 9.5pt;\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 9.5pt; background: yellow;\">A comprehensive ophthalmologic exam is required at screening; routine follow up at subsequent visits to evaluate visual acuity.</span><span style=\"font-size: 9.5pt;\">&nbsp;A<em><span style=\"background: yellow;\">&nbsp;separate ophthalmologist’s visit&nbsp;</span>is required.</em></span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 6pt; margin-left: 0.5in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; line-height: 14.72px; break-after: avoid;\"><a name=\"m_5892601508901999640_m_-8543748719677154363__Toc509503505\" style=\"color: rgb(34, 34, 34);\"><strong><span style=\"font-family: Arial, sans-serif;\">Ophthalmologic Exam</span></strong></a><strong><span style=\"font-family: Arial, sans-serif;\"><u></u><u></u></span></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Acute myopia, secondary angle closure glaucoma, and visual field defects are among most frequently occurred ocular side effects of XXX and must be closely monitored.&nbsp; Symptoms typically occur&nbsp;<span class=\"aBn\" data-term=\"goog_1421022662\" tabindex=\"0\" style=\"border-bottom: 1px dashed rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">within one month</span></span>&nbsp;of initiating XXX therapy and are often resolved after treatment cessation.&nbsp;&nbsp;<u><span style=\"background: yellow;\">A comprehensive ophthalmologic exam is required prior to the study and following any reports of changes in vision.</span>&nbsp;</u><span style=\"background: yellow;\">An abbreviated&nbsp; assessment of visual acuity will be performed during post-randomization study visits in the absence of treatment-related ocular effects.</span>&nbsp; Subjects presenting with blurry vision, ocular pain, and visual field defects subjects will be discontinued early and closely followed to ensure a prompt resolution of ocular AEs.&nbsp;&nbsp;<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"color: rgb(31, 73, 125);\">The synopsis/protocol is attached to assist you in determining interest in participation.&nbsp;<u></u><u></u></span></p><span style=\"color: rgb(31, 73, 125);\"><u></u>&nbsp;<u></u></span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong style=\"font-size: 12.8px;\"><em><u><span style=\"color: rgb(31, 73, 125);\">This proprietary and confidential information is being provided under the master CDA in place with PPD, and is not to be shared</span></u></em><span style=\"color: rgb(31, 73, 125);\">.</span></strong><br></p> ', null, 'a:1:{i:0;i:87;}', '1525910400', '84,44,83,54', '1', '0', null, '2018-05-08 12:56:52', '2018-05-09 13:54:20', 'CCT BD - Ron', '0');
INSERT INTO `trials` VALUES ('142', 'NAFLD-001-017 Healthy Patients', '<p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(33, 33, 33);\">We\'re working with Nutrasource’s&nbsp; on the&nbsp;<span class=\"il\">NAFLD</span>&nbsp;trial! Nutrasource has recently made amendments to the protocol, these amendments are pending approval from the ethics board but it is likely that this is the finalized version. Please review the new protocol and the summary of amendments. If you are still interested in this opportunity, please let me know.</span></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(33, 33, 33); font-size: 12pt;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(33, 33, 33); font-size: 12pt;\">It would also be helpful if you could provide answers to the study questions that you provided originally, to confirm the information based on the amendments.</span></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Study Title:</span></strong><span style=\"font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">&nbsp;</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">A Randomized, Double-Blind, Double-Dummy, Placebo-Controlled Study to Assess the Relationship Between Daily Dosing of EH301 and Changes in Liver Fat in Healthy Volunteers</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Investigational Product:&nbsp;</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">The investigational product is the commercially available dietary supplement EH301 with each capsule containing 125 mg nicotinamide riboside (NR) and 25 mg pterostilbene (Pter).</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span></strong><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Purpose:&nbsp;</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">To determine if there’s a relationship between daily consumption of EH301, over a six-month (26-week) period, and changes in liver fat accumulation, compared to placebo and change from Baseline in healthy volunteers. In addition, an exploratory assessment of markers of inflammation and liver fat metabolism will be examined.</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span></strong><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Population:&nbsp;</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Otherwise healthy men or women between 18 and 70 years of age who have fat accumulating in their liver but with no evidence of hepatocellular injury or hepatocyte ballooning.</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span></strong><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"color: rgb(33, 33, 33);\">Abbreviated Inclusion Criteria:</span></strong><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">1. MRI-PDFF of at least 15%, as measured at Visit 2 (Baseline).</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">2. Men or women between the ages of 18 and 70 years.</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">3. BMI between 25.0 and 39.9 kg/m</span><span style=\"font-size: 7pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">2</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">.</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">4. Non-smokers (&gt;3 months of non-smoking).</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">5. If on a statin regimen, history (&gt; 1 month) of stable dose.</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"color: rgb(33, 33, 33);\">Abbreviated Exclusion Criteria:</span></strong><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">1. Diagnosis of NASH (Non-Alcoholic Steatohepatitis).</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">2. Bilirubin &gt;2x ULN</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">3. Other causes of liver inflammation including Hepatitis A, B or C, HIV, confirmed or suspected cirrhosis, Wilson’s disease, autoimmune hepatitis, hemochromatosis, alcoholic steatohepatitis, pancreatitis, or prescription medications known to cause liver damage, or known to be hepatotoxic. (Evidence of hepatocellular injury or hepatocyte ballooning.)</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">4. Subjects with a history of bariatric surgery.</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">5. Significant weight loss (&gt; 5% body weight) or rapid weight loss (&gt; 1.6kg/week), within six (6) months of the Screening Visit.</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">6. Current or recent (within six (6) months of the Screening Visit) history of significant gastrointestinal, renal, pulmonary, hepatic or biliary disease, endocrine diseases (Type II Diabetes permitted) or other invasive weight loss treatments.</span><u></u><u></u></p><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span>', null, null, '1525132800', '38,83,33,32', '0', '0', '1525797037', '2018-05-08 16:30:11', '2018-05-08 16:30:37', 'BTC', '0');
