: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><strong><span style=\"font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Investigational Product:&nbsp;</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">The investigational product is the commercially available dietary supplement EH301 with each capsule containing 125 mg nicotinamide riboside (NR) and 25 mg pterostilbene (Pter).</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><strong><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span></strong><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><strong><span style=\"font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Purpose:&nbsp;</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">To determine if there’s a relationship between daily consumption of EH301, over a six-month (26-week) period, and changes in liver fat accumulation, compared to placebo and change from Baseline in healthy volunteers. In addition, an exploratory assessment of markers of inflammation and liver fat metabolism will be examined.</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><strong><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span></strong><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><strong><span style=\"font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Population:&nbsp;</span></strong><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">Otherwise healthy men or women between 18 and 70 years of age who have fat accumulating in their liver but with no evidence of hepatocellular injury or hepatocyte ballooning.</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><strong><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span></strong><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><strong><span style=\"color: rgb(33, 33, 33);\">Abbreviated Inclusion Criteria:</span></strong><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">1. MRI-PDFF of at least 15%, as measured at Visit 2 (Baseline).</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">2. Men or women between the ages of 18 and 70 years.</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">3. BMI between 25.0 and 39.9 kg/m</span><span style=\"font-size: 7pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">2</span><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">.</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">4. Non-smokers (&gt;3 months of non-smoking).</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">5. If on a statin regimen, history (&gt; 1 month) of stable dose.</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 0px; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><strong><span style=\"color: rgb(33, 33, 33);\">Abbreviated Exclusion Criteria:</span></strong><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">1. Diagnosis of NASH (Non-Alcoholic Steatohepatitis).</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">2. Bilirubin &gt;2x ULN</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">3. Other causes of liver inflammation including Hepatitis A, B or C, HIV, confirmed or suspected cirrhosis, Wilson’s disease, autoimmune hepatitis, hemochromatosis, alcoholic steatohepatitis, pancreatitis, or prescription medications known to cause liver damage, or known to be hepatotoxic. (Evidence of hepatocellular injury or hepatocyte ballooning.)</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">4. Subjects with a history of bariatric surgery.</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">5. Significant weight loss (&gt; 5% body weight) or rapid weight loss (&gt; 1.6kg/week), within six (6) months of the Screening Visit.</span><u></u><u></u></p><p class=\"m_-4945923332381405505m-2707091841282306994m-784700879155036016m-6262577073406481790default\" style=\"margin-right: 0in; margin-left: 0in; font-size: 12pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(34,=\"\" 34,=\"\" 34);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(33, 33, 33);\">6. Current or recent (within six (6) months of the Screening Visit) history of significant gastrointestinal, renal, pulmonary, hepatic or biliary disease, endocrine diseases (Type II Diabetes permitted) or other invasive weight loss treatments.</span><u></u><u></u></p><span style=\"color: rgb(33, 33, 33);\">&nbsp;</span>     ', null, null, '1526428800', '38,83,33,32', '1', '0', null, '2018-05-08 16:30:15', '2018-05-09 16:01:08', 'BTC', '0');
INSERT INTO `trials` VALUES ('144', '  Worldwide/Vivus - Tacrolimus VI-0106 in Subjects with Group 1 PAH-Upcoming Ph2 Pulmonary Arterial Hypertension - (PAH-002-018)  ', '  <p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 11pt; font-family: Calibri;\">We\'re working with Worldwide Clinical Trials to identify sites for their upcoming&nbsp;</span><strong>Phase 2 trial in subjects with Group 1 Pulmonary Hypertension and Functional Class 3 or 4 Status Despite Optimized Therapy with Available&nbsp;<span class=\"il\">PAH</span>&nbsp;Medications</strong><span style=\"font-size: 11pt; font-family: Calibri;\">. Not much information is available at this time, but if you are interested, please&nbsp;</span><u style=\"font-size: 11pt; font-family: Calibri;\">complete and sign the attached CDA template</u><span style=\"font-size: 11pt; font-family: Calibri;\">&nbsp;and return to me by&nbsp;</span><strong><span style=\"background: yellow;\">4pm EST on Tuesday, February 20<sup>th</sup></span></strong><span style=\"font-size: 11pt; font-family: Calibri;\">. A feasibility link with protocol will be sent following submission.</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">If you have any questions, please feel free to reach out.<u></u><u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\"></p><p class=\"m_-1925680806748759363gmail_signature\"></p><p dir=\"ltr\"></p><p dir=\"ltr\"></p><p dir=\"ltr\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@<wbr>conductclinicaltrials.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1525967173562000&amp;usg=AFQjCNEQkCZ68Mbhoh8gr-tEaqwdZj4U5w\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.<wbr>conductclinicaltrials.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\"></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p></p><p></p><p></p><p></p><p></p>  ', null, 'a:5:{i:0;i:89;i:1;i:90;i:2;i:91;i:3;i:92;i:4;i:93;}', '1526428800', '83,26,38,57', '1', '0', null, '2018-05-09 15:59:08', '2018-05-09 16:16:52', 'BTC', '0');
INSERT INTO `trials` VALUES ('145', 'HTN-003-017 (email reflects Hypertension-002-017)', '<p class=\"MsoNormal\" style=\"margin-bottom: 0px;\">&nbsp;<u></u></p><p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Good afternoon,</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Idorsia is currently seeking sites for an upcoming Phase 3 Resistant Hypertension study!</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">They are looking for investigators with cardiology/internal med/family med private practices (with research arms) that have access to their patient’s medical records and history of documented longstanding resistant hypertension. &nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Little information is known at this time however FPI is anticipated for late Q1 early Q2. A feasibility document will be available to us within the next couple weeks.</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">If you are interested in receiving more information please respond to the questions below&nbsp;</span><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"m_-8003144864886791195m_2405902034310442398gmail-m-7483027903002773102msolistparagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; margin-left: 1in;\"><span style=\"font-size: 10pt; font-family: &quot;Courier New&quot;; color: black;\">o</span><span style=\"font-size: 7pt; font-family: &quot;Times New Roman&quot;, serif; color: black;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Existing Patient Panel/Database:</span><u></u><u></u></p><p class=\"m_-8003144864886791195m_2405902034310442398gmail-m-7483027903002773102msolistparagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif