INSERT INTO `trials` VALUES ('147', 'Medline - chronic wound-001-018', '<p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 11pt; font-family: Calibri;\">Medline is seeking sites for an Upcoming Honey Impregnated Dressing at Removing Necrotic Tissue From&nbsp;<span class=\"il\">Chronic</span>&nbsp;Wounds Study. Medline would love the opportunity to reach out directly to all sites who have a nursing home or hospital affiliation to discuss this &nbsp;trial opportunity in &nbsp;further details. If you are interested after reviewing study criteria below, please let me know&nbsp;</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></strong></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 6pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Inclusion Criteria:<u></u><u></u></span></font></strong></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Male or female at least 18 years of age<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Subject has a qualified&nbsp;<span class=\"il\">chronic</span>&nbsp;foot or ankle&nbsp;<span class=\"il\">wound</span>, sized 1cm2 to 25 cm2 for ≥ 4 weeks in duration<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Must have necrotic tissue at least 25% of&nbsp;<span class=\"il\">wound</span>&nbsp;area<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>The&nbsp;<span class=\"il\">wound</span>&nbsp;type matches one of the indicated wounds listed on the product labeling:<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Leg ulcers<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Pressure ulcers<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Diabetic foot ulcers<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>First and second degree burns<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Surgical wounds<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Trauma wounds<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-right: 0in; margin-bottom: 3pt; margin-left: 0in; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 10pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Subject has adequate circulation as demonstrated by biphasic or triphasic Doppler waveform, consistent with 