dy participation, such as the subject is likely to be non-compliant with study requirements<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><a href=\"http://ct.gov/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://CT.GOV&amp;source=gmail&amp;ust=1526051910372000&amp;usg=AFQjCNExcpt5Ez4WkU0m_cSB1ex0HsthRg\" style=\"color: rgb(17, 85, 204);\">CT.GOV</a>: &nbsp;<a href=\"https://clinicaltrials.gov/ct2/show/study/NCT03412929?term=medline&amp;rank=9\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://clinicaltrials.gov/ct2/show/study/NCT03412929?term%3Dmedline%26rank%3D9&amp;source=gmail&amp;ust=1526051910372000&amp;usg=AFQjCNFpkUBNm56i_aCFgzrxjiIcNsS2lQ\" style=\"color: rgb(17, 85, 204);\">https://clinicaltrials.gov/ct<wbr>2/show/study/NCT03412929?term=<wbr>medline&amp;rank=9</a><u></u><u></u></span></font></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></strong></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"m_-7034436236252376192gmail_signature\"><p dir=\"ltr\"><p dir=\"ltr\"><p dir=\"ltr\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@<wbr>conductclinicaltrials.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1526051910372000&amp;usg=AFQjCNFH0Tj6jFHT2QKr92o1Ypl9Ff_YSQ\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.<wbr>conductclinicaltrials.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\"><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p></p></p></p></p></p>', null, null, '1526515200', '83,55,31', '1', '0', null, '2018-05-10 15:50:13', '2018-05-10 15:50:13', 'BTC', '0');
INSERT INTO `trials` VALUES ('149', '  Intralink -  Spine Device for Lower Back Pain - (LBP-001-017)  ', '  <br><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"color: rgb(33, 33, 33);\">Good Afternoon,</span><span style=\"font-size: 12pt; color: black;\"><u></u><u></u></span></p><span style=\"color: rgb(33, 33, 33);\"><u></u>&nbsp;<u></u></span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(33, 33, 33);\">Intralink Spine is seeking &nbsp;two&nbsp;sites for their&nbsp; Buffered GEnipin Microinvasive Device for Treatment of Lower Back Pain from Degenerative Disc Disease.&nbsp; Please find PI brochure and synopsis attached for your review. If you are &nbsp;interested in pursuing this study,&nbsp;<span style=\"background: yellow;\">please respond to the questions below </span><strong>.</strong>&nbsp;Feel free to reach out to me with any questions!<u></u><u></u></span></p><span style=\"color: rgb(33, 33, 33);\"><u></u>&nbsp;<u></u></span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(33, 33, 33);\">The appropriate investigators for this trial opportunity&nbsp;would be a pain internationalist&nbsp;and orthopedic surgeons that do ESIs, RF and other minimally invasive treatments for lower back pain specifically from degenerative disc disease. Sites would be expected to recruit 5-10 patients who haven\'t undergone spinal fusions, surgery, braces, or brackets. (Corticosteroid Injections are acceptable)<u></u><u></u></span></p><span style=\"color: rgb(33, 33, 33);\"><u></u>&nbsp;<u></u></span><p class=\"m_-1188068372893828383gmail-m_3304827501682798877default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"font-size: 11pt; color: rgb(33, 33, 33);\">Purpose:&nbsp;</span></strong><span style=\"font-size: 11pt; color: rgb(33, 33, 33);\">The purpose of this study is to evaluate the safety and efficacy of the Réjuve System (medical device) when treating low back (lumbar) pain due to degenerative disc disease (DDD) in symptomatic adults.&nbsp;Rejuve is a medical device that &nbsp;acts locally in the collagen of the inter vertebral&nbsp;disc to restore cross links&nbsp;and&nbsp;</span><span style=\"font-size: 11pt;\">immediately</span><span style=\"font-size: 11pt; color: rgb(33, 33, 33);\">&nbsp;structurally reinforces the disc tissue to treat lower back pain.&nbsp;<span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">The injection for this study&nbsp;is done under fluoroscopic imaging.</span></span><u></u><u></u></p><span style=\"font-size: 11pt; color: rgb(33, 33, 33);\">&nbsp;</span><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span><p class=\"m_-1188068372893828383gmail-m_3304827501682798877default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"font-size: 11pt; color: rgb(33, 33, 33);\">Study Title:&nbsp;</span></strong><span style=\"font-size: 11pt; color: rgb(33, 33, 33);\">Prospective, Multicenter, Single Arm with Literature Control, Clinical Study to evaluate the safety and preliminary effectiveness of Réjuve with standard of care conservative management, including epidural steroid injection used for treating lower back pain (LPB) in symptomatic adults age&nbsp;<strong>18-60&nbsp;</strong>years with degenerative disc disease, who have failed to respond to standard nonsurgical therapies&nbsp;.</span><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span></p><span style=\"color: black;\">&nbsp;</span><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span><span style=\"color: black;\">&nbsp;</span><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"color: black;\">Inclusion:</span></strong><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span></p><span style=\"color: black;\">&nbsp;</span><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1<span style=\"color: black;\">. Adults 18-60 years old</span><span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">2. Degenerative Disc Disease at 1 or 2 levels between L2/3 and L5/S1 confirmed by:<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">a. Clinical presentation of discogenic pain, back &gt; leg pain, with or without radiation to leg,<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">b. MRI correlative to the affected segment, and/or<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">c. discography with concordant pain within 6 months.<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">3. Failed non-operative treatment which may include injections or radiofrequency denervation of medial lumbar and lateral sacral branches (failed response is considered when pain relief lasted ≤ 3 months)<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">4. Preoperative Numeric Rating Scale (NRS) score for back pain ≥ 5 or Visual Analog Score for back pain ≥ 40 mm.<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">5. Preoperative Oswestry Disability Index (ODI) score ≥ 40%<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">6. Documented symptoms for a cumulative minimum of 3 months<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">7. Patient is competent to sign the informed consent<span style=\"font-size: 12pt;\"><u></u><u></u></span></li></ul><span style=\"color: black;\">&nbsp;</span><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"color: black;\">Exclusion</span></strong><span style=\"color: rgb(33, 33, 33);\"><u></u><u></u></span></p><span style=\"color: rgb(33, 33, 33);\">&nbsp;<u></u><u></u></span><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1. Symptomatic DDD at more than 2 levels<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">2. Less than 3 months of back pain<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">3. Previous diagnosed Paget\'s disease, osteomalacia, other metabolic bone disease or insulin-dependent diabetes<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">4. Evidence of spinal osteopenia or osteoporosis (radiographic or DEXA)<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">5. Active systemic or spine infection<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">6. Previous device or therapeutic interventions on the target disc (excluding those listed in the Inclusion Criteria)<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">7. Any surgery at the index level and any extensive surgery (fusion, laminectomy, artificial disc) at any level<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">8. Chronic steroid use (except for inhaled steroids)<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">9. Other diagnosed causes of back pain such as vertebral fracture, facet joint or vertebral arch (spondylolysis) generated pain, rheumatoid arthritis, and sacroiliac joint pain.<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">10. Previous treatment of target disc level with steroid injection in past 3 months.<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">11. Active malignancy<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">12. Spinal tumor<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">13. Immune compromised patients<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">14. Lumbar scoliosis &gt; 15 degrees<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">15. Disc Herniation &gt; 5mm, symptomatic with radicular pain (neurological examination is abnormal, excluding diminished pin prick test)<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">16. Symptomatic spinal stenosis<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">17. Congenital or degenerative spondylolisthesis (grade 2 and 3)<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">18. Severe uncontrolled psychological comorbidities (e.g., depression, anxiety, PTSD, borderline PD, schizophrenia, substance abuse)<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">19. Anticipated compliance problems (e.g., transportation, dementia, computer illiteracy)<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">20. Currently participating in another investigational study that could interfere with the outcome measurements of this study<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">21. Known anaphylactic reaction to contrast dye<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">22. Opioid daily intake &gt; 90 MEQ<span style=\"font-size: 12pt;\"><u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">23. Not able to communicate with study center staff sufficiently to complete study questionnaires<span style=\"font-size: 12pt;\"><u></u><u></u></span></li></ul><span style=\"color: rgb(33, 33, 33);\"><u></u>&nbsp;<u></u></span><span style=\"color: rgb(33, 33, 33);\"><u></u>&nbsp;<u></u></span><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(33, 33, 33); font-family: Khula, sans-serif; font-size: 20px;\">&nbsp;</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\"><u></u>&nbsp;</span><span style=\"color: rgb(0, 0, 0); font-family: Verdana; font-size: 13.3333px;\">Respectfully,</span></p><p><br style=\"font-family: Verdana; font-size: 13.3333px;\"><span style=\"font-family: Verdana; font-size: 13.3333px;\">Shilo West</span><br style=\"font-family: Verdana; font-size: 13.3333px;\"><br style=\"font-family: Verdana; font-size: 13.3333px;\"><span style=\"font-family: Verdana; font-size: 13.3333px;\">Managing Director</span><br style=\"font-family: Verdana; font-size: 13.3333px;\"><span style=\"font-family: Verdana; font-size: 13.3333px;\">Administrative Clinical Study Start-up Services</span><br style=\"font-family: Verdana; font-size: 13.3333px;\"><span style=\"font-family: Verdana; font-size: 13.3333px;\">Conduct Clinical Trials</span><br style=\"font-family: Verdana; font-size: 13.3333px;\"><br style=\"font-family: Verdana; font-size: 13.3333px;\"><span style=\"font-family: Verdana; font-size: 13.3333px;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br style=\"font-family: Verdana; font-size: 13.3333px;\"><span style=\"font-family: Verdana; font-size: 13.3333px;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclin