INSERT INTO `trials` VALUES ('150', 'INC/Inventiv/Summit Therapeutics - 1009190_91 - (C.diff-008-017)', '<p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">INC&nbsp;Research/inVentiv Health is currently working with Summit Therapeutics to identify investigators for a Clostridium difficile infection (CDI) treatment study, aimed to start patient enrollment in early 2018. Sites will need to have clinical research experience in running infectious disease studies along with a strong site infrastructure to enable rapid identification and enrollment of patients with CDI prior to 24-h or more of antimicrobial therapy being administered. Close collaboration with the institution microbiology laboratory will be important!<u></u><u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">This is a Phase 3, randomized, double-blind, active controlled study to compare the efficacy and safety of ridinilazole for 10 days with vancomycin for 10 days in the treatment of Clostridium difficile infection (CDI). Please see the known information below. If you’re interested in being included in the feasibility process,&nbsp;<strong>please send me your PI’s name.</strong><u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><u></u>&nbsp;<u></u></strong></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong>Study Criteria:<u></u><u></u></strong></p><p class=\"m_3147312414505586044gmail-m_-3660780801783009648MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>For entry into the study, patients must have the presence of toxin A and/or B of&nbsp;<span class=\"il\">C</span>. difficile in the stool as confirmed by a positive Alere&nbsp;<span class=\"il\">C</span>.&nbsp;<span class=\"il\">DIFF</span>&nbsp;QUIK CHEK COMPLETE® rapid test and not have had more than one prior episode of CDI in the previous 3 months.<u></u><u></u></p><p class=\"m_3147312414505586044gmail-m_-3660780801783009648MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Subjects can be randomised into the study if they are on other antibiotics – about one-third of CDI patients are on antibiotics for other infections. The only antibiotics that are excluded are those that could be considered to possibly be useful in treating CDI and could therefore confound the ability to determine whether the study drugs worked.<u></u><u></u></p><p class=\"m_3147312414505586044gmail-m_-3660780801783009648MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Each patient will be enrolled in this study for approximately 100 days. This consists of a 1-day screening period, a 10-day treatment period, and a 90- day follow-up period (including an assessment of cure at day 12).<u></u><u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><u></u>&nbsp;<u></u></strong></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong>Ridinilazole (study drug):<u></u><u></u></strong></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Ridinilazole is an orally administered small molecule antibiotic that Summit is developing specifically for the treatment of CDI. In preclinical efficacy studies, ridinilazole exhibited a narrow spectrum of activity and had a potent bactericidal effect against a variety of&nbsp;<span class=\"il\">C</span>. difficile clinical isolates, including less frequently isolated strains, hyper-virulent strains, and isolates with varying antimicrobial resistance phenotypes.<u></u><u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong>Phase 2 Results:<u></u><u></u></strong></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">In a recently published Phase 2 proof-of-concept trial in CDI patients, ridinilazole showed non-inferiority (15% margin) in sustained clinical response (SCR) rates compared to the standard of care, vancomycin, with SCR being defined as clinical cure at end of treatment (EOT) and no recurrence of CDI within 30 days of the end of therapy. Furthermore, Ridinilazole also demonstrated statistical superiority on SCR at the pre-specified 10% level maintained across patient subgroups including those categorized on the basis of age, baseline CDI severity, history of recurrent CDI, and use of concomitant antibiotics at baseline. Ridinilazole was well tolerated and had an adverse event profile similar to that of vancomycin.<u></u><u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Subsequent analyses of fecal microbiota in participants in the Phase 2 study using stool samples collected at multiple study time points and employing quantitative polymerase chain reaction (qPCR) and high-throughput sequencing have revealed that ridinilazole has a significantly lower impact on the overall taxonomic composition of the gut microbiota than vancomycin.<u></u><u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">These encouraging Phase 2 data illustrate to the potential of ridinilazole to emerge as an effective and safe treatment for both primary and recurrent episodes of CDI. A positive Phase 3 outcome demonstrating the superiority of ridinilazole has the potential to support its approval as the new treatment of choice to treat initial CDI and minimise subsequent recurrence.<u></u><u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong>Primary endpoint for Phase 3:<u></u><u></u></strong></p><p class=\"m_3147312414505586044gmail-m_-3660780801783009648MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Clinical cure is defined as the resolution of diarrhea, ≤3 unformed bowel movements (UBMs) in the 24-h period immediately prior to EOT, that is maintained for 48 h after EOT.<u></u><u></u></p><p class=\"m_3147312414505586044gmail-m_-3660780801783009648MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Recurrence is defined as a new episode of diarrhea (&gt;3 UBMs in a 24-h period) with a positive&nbsp;<span class=\"il\">C</span>. difficile–free toxin test.<u></u><u></u></p><p class=\"m_3147312414505586044gmail-m_-3660780801783009648MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; margin-bottom: 12pt;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>A UBM is defined as a Type 5, 6, or 7 bowel movement on the Bristol Stool Chart.<u></u><u></u></p><p class=\"m_3147312414505586044gmail-MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"m_3147312414505586044gmail_signature\"><p dir=\"ltr\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0); font-size: 10pt;\">Respectfully,<br><br>Shilo West<br><br>Managing Director<br>Administrative Clinical Study Start-up Services<br>Conduct Clinical Trials<br><br>T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323<br>E:&nbsp;<a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">Shilo@<wbr>conductclinicaltrials.com</a><br><br>Internet Site:&nbsp;<a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1526056549461000&amp;usg=AFQjCNG-QRDG35kUt9Kcqcdz1c5kmsGx4A\" style=\"color: rgb(17, 85, 204);\">www.<wbr>conductclinicaltrials.com</a><br><br><strong><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br>Conduct Clinical Trials<br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</span></p></p></p>', null, null, null, '83,33', '1', '0', null, '2018-05-10 16:41:52', '2018-05-10 16:41:52', 'BTC', '0');
INSERT INTO `trials` VALUES ('151', 'DiaSorin  - Stool Collection-001-018', '<p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-size: 11pt; font-family: Calibri;\">DiaSorin is looking for GIs to participate in an&nbsp;</span><strong>ongoing observational&nbsp;<span class=\"il\">stool</span>&nbsp;<span class=\"il\">collection</span>&nbsp;study</strong><span style=\"font-size: 11pt; font-family: Calibri;\">. They are looking to collect samples from patients 22+ years old, who have IBD, IBS, UC, Crohn’s Disease, Celiac, and other GI disorders. Looking for sites that can enroll 15-30 patients by May 2018. Study information can be found below. If you are interested in being considered for this study, please&nbsp;</span><u style=\"font-size: 11pt; font-family: Calibri;\">answer the questions below (including metrics)</u><span style=\"font-size: 11pt; font-family: Calibri;\">&nbsp;and return to me by&nbsp;</span><strong><u>3pm EST on Friday, January 12<sup>th</sup></u></strong><span style=\"font-size: 11pt; font-family: Calibri;\">.</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><u><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Objective</span></font></u></strong>: The primary objective is to obtain&nbsp;<span class=\"il\">stool</span>&nbsp;samples from subjects with symptoms of an undiagnosed gastrointestinal disorder. All subjects enrolled in the study will undergo a colonoscopy.&nbsp;<strong>(The colonoscopy/biopsy will need to be done per standard of care. Sponsor not likely to reimburse)</strong><u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><u><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Inclusion Criteria:<u></u><u></u></span></font></u></strong></p><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Either gender ≥ 22 years<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject undergoing Colonoscopy for diagnosing IBD, IBS or other gastrointestinal diseases.<u></u><u></u></span></font></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><u><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Post Colonoscopy:<u></u><u></u></span></font></u></strong></p><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject with a new diagnosis of IBD based on Colonoscopy and confirmed by histological examination of biopsy<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject with a new diagnosis of IBS based on negative Colonoscopy and the Rome III Criteria.<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject with a new diagnosis of a gastrointestinal disease, other than IBD and IBS, based on negative Colonoscopy.<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Not currently taking NSAIDS (non-steroidal anti-inflammatory drugs, i.e. ibuprofen, Advil, Motrin, Naproxen, Aleve including regular dose and low dose aspirin) within 7 days of sample&nbsp;<span class=\"il\">collection</span><u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Not currently taking oral steroids or within 7 days of sample&nbsp;<span class=\"il\">collection</span><u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">No antibiotics within 7 days of colonoscopy and/or sample&nbsp;<span class=\"il\">collection</span><u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">No over the counter or prescription proton pump inhibitors (i.e. Aciphex, Axid, Nexium, Pepcid, Prevacid, Prilosec, Protonix, Tagamet, Tums, Zantac, Zegerid etc.) within 7 days of colonoscopy and/or sample&nbsp;<span class=\"il\">collection</span>.<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject is willing and able to sign the IRB approved Informed Consent form or able to provide Informed Consent in accordance with 21 CFR 50 CFR 50 Subpart B.<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject is able to understand and follow study sample&nbsp;<span class=\"il\">collection</span>&nbsp;procedure<u></u><u></u></span></font></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><u><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Exclusion Criteria:<u></u><u></u></span></font></u></strong></p><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Any subject that does not meet the inclusion criteria<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject previously diagnosed with IBD, IBS, and/or a Gastrointestinal Disease<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject who has had any gastric surgery<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Chronic use of NSAIDS, Antibiotics, PPIs, and steroids.<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject with known upper gastrointestinal disease<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject who has taken immunomodulators or biologic therapies within the previous 6 months<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject who is currently pregnant or lactating<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Subject is unable or unwilling to follow informed consent<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Inability or unwilling to perform required study procedures<u></u><u></u></span></font></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 15px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Failure to obtain a diagnosis of IBD, IBS or Other GI disorder.<u></u><u></u></span></font></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><br></p><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0); font-size: 10pt;\">Respectfully,<br><br>Shilo West<br><br>Managing Director<br>Administrative Clinical Study Start-up Services<br>Conduct Clinical Trials<br><br>T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323<br>E:&nbsp;<a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">Shilo@<wbr>conductclinicaltrials.com</a><br><br>Internet Site:&nbsp;<a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1526057067729000&amp;usg=AFQjCNG3tM0oRDl0hnpw5fqWtoNajjLnwA\" style=\"color: rgb(17, 85, 204);\">www.<wbr>conductclinicaltrials.com</a><br><br><strong><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br>Conduct Clinical Trials<br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0); font-size: 10pt;\"><br></span><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p style=\"color: rgb(0, 0, 0); font-size: 13.3333px;\"><font face=\"verdana, sans-serif\"><strong style=\"font-size: 13.3333px;\">TrialPulse</strong><span style=\"font-size: 16px; color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0); font-size: 13.3333px;\"><span style=\"font-size: small;\"><font face=\"verdana, sans-serif\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></span></p></p>', null, null, null, '83,33,38', '1', '0', null, '2018-05-10 17:00:25', '2018-05-10 17:00:25', 'BTC', '0');
INSERT INTO `trials` VALUES ('152', 'Endo/Chiltern - Phase 3 Cellulite-003-017', '<p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p><span style=\"font-family: Verdana; color: rgb(0, 0, 0); font-size: 10pt;\"><blockquote id=\"m_8992324640050484634m_-5900453282761494492replyBlockquote\" style=\"border-left-width: 2px; border-left-color: blue; margin-left: 8px; padding-left: 8px; font-size: 10pt; font-family: verdana;\"><p id=\"m_8992324640050484634m_-5900453282761494492wmQuoteWrapper\"><p class=\"m_8992324640050484634m_-5900453282761494492WordSection1\"><blockquote id=\"m_8992324640050484634m_-5900453282761494492replyBlockquote\" style=\"border-top: none; border-right: none; border-bottom: none; border-image: initial; border-left-width: 1.5pt; border-left-color: blue; padding: 0in 0in 0in 6pt; margin-left: 6pt; margin-top: 5pt; margin-bottom: 5pt;\"><p id=\"m_8992324640050484634m_-5900453282761494492wmQuoteWrapper\"><p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">Endo Pharmaceuticals is working with Chiltern on identifying sites for an upcoming Phase 3&nbsp;<span class=\"il\">Cellulite</span>&nbsp;study.<u></u><u></u></span></p></p><p><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;<u></u><u></u></span></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">Please see the additional study information listed below and synopsis attached for further information. If you are interested in pursuing this study,&nbsp;</span><strong><u><span style=\"font-size: 12pt; font-family: Verdana, sans-serif; color: red; background: yellow;\">please let me know by COB Friday June 23<sup>rd</sup></span></u></strong><span style=\"font-size: 12pt; font-family: Verdana, sans-serif; color: red; background: yellow;\">.</span><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;Let me know if you have any questions.<u></u><u></u></span></p></p><p><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;<u></u><u></u></span></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><strong><u><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">Study Title:</span></u></strong><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;A Phase 3, Randomized, Double-Blind, Placebo-Controlled Study of EN3835 in the Treatment of Edematous Fibrosclerotic Panniculopathy<u></u><u></u></span></p></p><p><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;<u></u><u></u></span></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><strong><u><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">Primary Objective:</span></u></strong><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;To assess the efficacy and safety of EN3835 in the treatment of edematous fibrosclerotic panniculopathy (EFP), commonly known as&nbsp;<span class=\"il\">cellulite</span>, in adult women.<u></u><u></u></span></p></p><p><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;<u></u><u></u></span></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><strong><u><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">Inclusion Criteria:</span></u></strong><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\"><u></u><u></u></span></p></p><p><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;<u></u><u></u></span></p><ol start=\"1\" type=\"1\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Voluntarily sign and date an informed consent agreement<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Be a female ≥18 years of age<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">At Screening visit, have at least 1 quadrant having:<u></u><u></u></span></li></ol><ol start=\"3\" type=\"1\"><ol start=\"1\" type=\"a\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">a score of 3 or 4 (moderate or severe) as reported by the subject (PR-PCSS), and<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">a score of 3 or 4 (moderate or severe) as reported by the Investigator (CR-PCSS), and<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">a Hexsel CSS score no greater than 13<u></u><u></u></span></li></ol></ol><ol start=\"4\" type=\"1\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">At Day 1 visit, have assigned quadrant having:<u></u><u></u></span></li></ol><ol start=\"4\" type=\"1\"><ol start=\"1\" type=\"a\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">a score of 3 or 4 (moderate or severe) as reported by the subject (PR-PCSS), and<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">a score of 3 or 4 (moderate or severe) as reported by the Investigator (CR-PCSS), and<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">a Hexsel CSS score no greater than 13<u></u><u></u></span></li></ol></ol><ol start=\"5\" type=\"1\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Be willing to apply sunscreen to the assigned treatment quadrant before each exposure to the sun while participating in the study (ie, Screening through end of study)<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Be judged to be in good health, based upon the results of a medical history, physical examination, and laboratory profile at Screening&nbsp;<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Have a negative urine pregnancy test at Screening and before injection of study drug and be using an effective contraception method (eg, abstinence, intrauterine device [IUD], hormonal [estrogen/progestin] contraceptives, or double barrier method) for at least 1 menstrual cycle prior to study enrollment and for the duration of the study; or be menopausal defined as 12 months of amenorrhea in the absence of other biological or physiological causes, as determined by the Investigator; or post-menopausal for at least 1 year; or be surgically sterile<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Be willing and able to cooperate with the requirements of the study<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Be able to read, complete and understand the patient-reported outcomes rating instruments in English<u></u><u></u></span></li></ol><p><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;<u></u><u></u></span></p><p><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;<u></u><u></u></span></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><strong><u><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">Exclusion Criteria:</span></u></strong><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\"><u></u><u></u></span></p></p><p><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;<u></u><u></u></span></p><ol start=\"1\" type=\"1\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Has any of the following systemic conditions:<u></u><u></u></span></li></ol><ol start=\"9\" type=\"1\"><ol start=\"1\" type=\"a\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Coagulation disorder<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Evidence or history of malignancy (other than excised basal-cell carcinoma) unless there has been no recurrence in at least 5 years<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">History of keloidal scarring or abnormal wound healing<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Concurrent diseases or conditions that might interfere with the conduct of the study, confound the interpretation of the study results, or endanger the subject’s well-being.&nbsp; Any questions about concurrent diseases should be discussed with the Medical Monitor.<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Evidence of body weight loss that might interfere with the conduct of the study, confound the interpretation of the study results, or endanger the subject\'s well-being<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Evidence of clinically significant abnormalities on physical examination, vital signs, electrocardiogram (ECG), or clinical laboratory values.<u></u><u></u></span></li></ol></ol><ol start=\"2\" type=\"1\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Has any of the following local conditions in the area to be treated:<u></u><u></u></span></li></ol><ol start=\"2\" type=\"1\"><ol start=\"1\" type=\"a\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">History of lower extremity thrombosis or post-thrombosis syndrome<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Vascular disorder (eg, varicose veins) in area to be treated<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Inflammation or active infection<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Active cutaneous alteration including rash, eczema, psoriasis, or skin cancer<u></u><u></u></span></li><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Has a tattoo located within 2 cm of the site of injection<u></u><u></u></span></li></ol></ol><ol start=\"3\" type=\"1\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Requires the following concomitant medications before or during participation in the trial:<u></u><u></u></span></li></ol><ol start=\"3\" type=\"1\"><ol start=\"1\" type=\"a\"><li class=\"MsoNormal\" style=\"margin: 0px 0px 0px 0in;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Anticoagulant or antiplatelet medication or has received anticoagulant or antiplatelet medication (except for ≤150 mg aspirin daily) within 7 days before injection of study drug.<u></u><u></u></span></li></ol></ol><p><span style=\"font-size: 12pt; font-family: Verdana, sans-serif;\">&nbsp;<u></u><u></u></span></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Respectfully,<br><br>Shilo West<u></u><u></u></span></p></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Managing Director<br>Administrative Clinical Study Start-up Services&nbsp;<br>Conduct Clinical Trials<u></u><u></u></span></p></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-439-9215<br>E:&nbsp;<a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">Shilo@conductclinicaltrials.co<wbr>m</a><u></u><u></u></span></p></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\">Internet Site:&nbsp;<a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com&amp;source=gmail&amp;ust=1526058144006000&amp;usg=AFQjCNH-DDnh69Eyr1z54ybZCaL2W1X0EQ\" style=\"color: rgb(17, 85, 204);\">www.conductclinicaltrials.com</a><u></u><u></u></span></p></p><p><p class=\"MsoNormal\" style=\"margin: 0px; font-size: 12pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\"><br><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.<u></u><u></u></span></p><span style=\"font-size: 10pt; font-family: Verdana, sans-serif;\"><br></span><p class=\"yj6qo\"><div class=\"yj6qo\"></div></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></blockquote><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></p><p class=\"adL\"><div class=\"adL\"></div></p></blockquote></span></p><p class=\"adL\"><div class=\"adL\"></div></p></p>', null, 'a:1:{i:0;i:98;}', '1521072000', '83,72,28', '1', '0', null, '2018-05-10 17:14:50', '2018-05-10 17:14:52', 'BTC', '1');
