font-family: Calibri, sans-serif; line-height: 15.4px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt; line-height: 15.4px;\">&nbsp;</span></font></p></td></tr></tbody></table><p class=\"m_8256312296757646204m_-243985636053199922m_-8770415838881675365x_MsoNormal\" style=\"margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">&nbsp;</span></font></p><p style=\"margin: 0in 0in 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"></span></font></p></p></p></blockquote></p></p></p><p dir=\"ltr\" style=\"font-size: small;\"><span style=\"font-family: Verdana;\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@conductclinicaltrials<wbr>.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1526058950859000&amp;usg=AFQjCNH_YksACVgMJ__xQZ1LXWYOZ5kUpA\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.conductclinicaltrial<wbr>s.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana;\"><font size=\"2\"><br></font></span><p dir=\"ltr\" style=\"font-size: small;\"><p><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong>™<br></font></p><p><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p></p><p class=\"yj6qo\"><div class=\"yj6qo\"></div></p><br></p><p class=\"adL\"><div class=\"adL\"></div></p></p></p></blockquote>', null, null, null, '55,79,32,83', '1', '0', null, '2018-05-10 17:38:19', '2018-05-10 17:38:19', 'BTC', '0');
INSERT INTO `trials` VALUES ('154', 'Luitpold Pharmaceutical, Inc. - pediatric iron-deficiency anemia (IDA)', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; color: rgb(34, 34, 34); text-align: justify; vertical-align: baseline; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-size: 11pt; color: black;\">Would you be interested in participating in a Phase III, open-label clinical trial using an investigational<strong>&nbsp;intravenous&nbsp;<span class=\"il\">iron</span>&nbsp;compound to treat&nbsp;<span class=\"il\">iron</span>&nbsp;<span class=\"il\">deficiency</span>&nbsp;<span class=\"il\">anemia</span>&nbsp;in&nbsp;<span class=\"il\">pediatric</span>&nbsp;patient’s ages 1 to 17 yrs. old</strong>?&nbsp;&nbsp;Eligible patients must have&nbsp;<span class=\"il\">iron</span>&nbsp;<span class=\"il\">deficiency</span>&nbsp;<span class=\"il\">anemia</span>&nbsp;and a screening hemoglobin &lt;</span><span style=\"font-size: 11pt;\">11.0 g/dL.&nbsp;&nbsp;</span></p><span style=\"font-size: 11pt;\"><span style=\"color: black;\"><br></span></span><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; color: rgb(34, 34, 34); text-align: justify; vertical-align: baseline; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-size: 11pt;\"><span style=\"color: black;\">Patients requiring dialysis for the treatment of chronic kidney disease</span>&nbsp;should not be considered for this study.&nbsp;&nbsp;Patients that received intravenous&nbsp;<span class=\"il\">iron</span>&nbsp;or blood transfusion 4 weeks prior to the Screening visit should not be considered for this study.&nbsp;&nbsp;The duration of this clinical trial is approximately 6 weeks.</span></p><span style=\"font-size: 11pt;\"><br></span><p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt; color: rgb(34, 34, 34); text-align: justify; vertical-align: baseline; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-size: 11pt;\">If yes please complete the attached questionnaire and send it back to me for submission.</span></p><br clear=\"all\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><p class=\"m_-8499181598977652019gmail_signature\" data-smartmail=\"gmail_signature\"><p dir=\"ltr\"><p dir=\"ltr\"><p dir=\"ltr\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical Study Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323</span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@conductclinicaltrials.<wbr>com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com&amp;source=gmail&amp;ust=1526060421730000&amp;usg=AFQjCNHMa1MEBBGqvTXJWxKZ9ufkiiZ0IQ\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.conductclinicaltrials.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana; color: rgb(0, 0, 0);\"><font size=\"2\"><br></font></span><p dir=\"ltr\"><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p></p></p></p></p></p>', null, 'a:1:{i:0;i:99;}', null, '54,83,32', '1', '0', null, '2018-05-10 17:55:21', '2018-05-10 17:55:22', 'CCT BD - Shilo', '0');
INSERT INTO `trials` VALUES ('155', ' Janssen - Heart Failure in Diabetics (HF-009-017) ', ' <p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Good afternoon,<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 12pt; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">Janssen is in the early stages of planning for an upcoming phase 3 heart failure in diabetic patients trial. They are still working on the study design so little information is known. Please see below what we have thus far. If you’d be interested in being considered for this upcoming opportunity, please let me know <strong>.</strong><u></u><u></u></p><p class=\"m_2158394213303176012gmail-m_630914292103113870MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Seeking Cardiologists as PI - if you are not a cardiologist do you work with one?<u></u></p><p class=\"m_2158394213303176012gmail-m_630914292103113870MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>Study drug is a diabetes treatment<u></u><u></u></p><p class=\"m_2158394213303176012gmail-m_630914292103113870MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>FPI Dec 2018<u></u><u></u></p><p class=\"m_2158394213303176012gmail-m_630914292103113870MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>The study will enroll approximately 600 patients overall, 300 patients in the U.S.<u></u><u></u></p><p class=\"m_2158394213303176012gmail-m_630914292103113870MsoListParagraph\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><u></u>They’re looking for approximately 75 sites<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">As always, let me know if you have any questions!<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><u></u>&nbsp;<u></u></p><br><p style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"></p><p class=\"m_2158394213303176012gmail_signature\"></p><p dir=\"ltr\"><span style=\"font-family: Verdana; color: rgb(0, 0, 0); font-size: 10pt;\">Respectfully,<br><br>Shilo West<br><br>Managing Director<br>Administrative Clinical Study Start-up Services<br>Conduct Clinical Trials<br><br>T: 888-635-0552 - F: 888-979-8260 - M: 702-720-7323<br>E:&nbsp;<a href=\"mailto:Shilo@conductclinicaltrials.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">Shilo@<wbr>conductclinicaltrials.com</a><br><br>Internet Site:&nbsp;<a href=\"http://www.conductclinicaltrials.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1526061581151000&amp;usg=AFQjCNHRW_c9293A9LvRx7pVRACAvNgz-A\" style=\"color: rgb(17, 85, 204);\">www.<wbr>conductclinicaltrials.com</a><br><br><strong><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number 702-720-7323</span></strong><br><br>Conduct Clinical Trials<br>Niche Service Provider specialized in Administrative Clinical Study Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</span></p><p></p><p></p> ', null, 'a:1:{i:0;i:100;}', '1522022400', '83,26,38', '1', '0', null, '2018-05-10 18:18:48', '2018-05-10 18:21:41', 'BTC', '0');
INSERT INTO `trials` VALUES ('156', '    Syneos Health - Phase 3 Early Alzheimer\'s Disease Study (Alzheimer\'s-001-018)    ', '    <blockquote type=\"cite\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\"><p dir=\"ltr\"></p><p class=\"gmail_quote\"></p><p lang=\"EN-US\"></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142WordSection1\"></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><span style=\"font-size: 11pt; font-family: Calibri;\"><span class=\"il\">Syneos</span>&nbsp;Health is conducting feasibility to identify sites for a Phase 3 Early Alzheimer’s Disease Study.</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Please see the additional study information listed below. If you are interested in pursuing the study, please respond with interest and completed questionnaire that\'s attached<u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Study Title:&nbsp;</span></font></strong>Phase III Beta-secretas Inhibitor (BACE Inhibitor) Study in subjects with Early Alzheimer’s Disease.<u></u><u></u></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></strong></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142SynopsisBullet\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Study information:</span></font></strong>&nbsp;<span lang=\"EN-GB\">This study is a global, multicenter, single-dose, double-blind, placebo-controlled, parallel group study. The subject’s participation in the study is approximately 29 months, and consists of three periods:</span><span lang=\"EN-CA\"><u></u><u></u></span></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142SynopsisBulletCxSpMiddle\" style=\"margin-left: 0.5in;\"><u></u><font size=\"2\" face=\"Symbol\"><span lang=\"EN-CA\" style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><span lang=\"EN-GB\">Screening up to 50 days (with additional 30 day window, if necessary),</span><span lang=\"EN-CA\"><u></u><u></u></span></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142SynopsisBulletCxSpMiddle\" style=\"margin-left: 0.5in;\"><u></u><font size=\"2\" face=\"Symbol\"><span lang=\"EN-CA\" style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><span lang=\"EN-GB\">On study drug for 24 months</span><span lang=\"EN-CA\"><u></u><u></u></span></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142SynopsisBulletCxSpLast\" style=\"margin-left: 0.5in;\"><u></u><font size=\"2\" face=\"Symbol\"><span lang=\"EN-CA\" style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><span lang=\"EN-GB\">Post study drug FU 12 weeks after last dose of study drug</span><span lang=\"EN-CA\"><u></u><u></u></span></p><p><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">This study will evaluate a BACE inhibitor for the treatment of early Alzheimer’s disease (EAD) including subjects with mild cognitive impairment (MCI) due to AD and the early stages of mild AD who have confirmed amyloid based upon amyloid PET scan or Cerebrospinal fluid (CSF) results.&nbsp; The primary outcome measure will be the change from baseline in the Clinical Dementia Rating-Sum Of Boxes (CDR-SB) at 24 months.&nbsp; The study drug is a tablet formulation, taken orally, once per day.</span></font><font size=\"2\" face=\"Calibri\"><span lang=\"EN-GB\" style=\"font-size: 11pt; font-family: Calibri, sans-serif;\"><u></u><u></u></span></font></p><p><font size=\"2\" face=\"Calibri\"><span lang=\"EN-GB\" style=\"font-size: 11pt; font-family: Calibri, sans-serif;\">The study enrolment period is approximately 18 months to enroll 1330 subjects at multiple sites worldwide. The study is expected to run from Q3/4 of 2016 to Q2/3 of 2018.<u></u><u></u></span></font></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142SynopsisBullet\"><strong><font size=\"2\" face=\"Calibri\"><span lang=\"EN-CA\" style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></strong></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px;\"><strong><font size=\"2\" face=\"Calibri\"><span style=\"font-size: 11pt;\">Inclusion Criteria:<u></u><u></u></span></font></strong></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142Default\" style=\"margin-left: 0.75in;\"><u></u><font size=\"2\" color=\"black\" face=\"Symbol\"><span lang=\"EN-GB\" style=\"font-size: 11pt; color: windowtext;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\" color=\"black\" face=\"Calibri\"><span lang=\"EN-GB\" style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: windowtext;\">MCI due to Alzheimer’s disease or Mild Alzheimer’s disease including:<u></u><u></u></span></font></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142Default\" style=\"margin-left: 1.25in;\"><u></u><font size=\"2\" color=\"black\" face=\"Courier New\"><span lang=\"EN-GB\" style=\"font-size: 11pt; color: windowtext;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\" color=\"black\" face=\"Calibri\"><span lang=\"EN-GB\" style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: windowtext;\">MMSE score equal to or greater than 24<u></u><u></u></span></font></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142Default\" style=\"margin-left: 1.25in;\"><u></u><font size=\"2\" color=\"black\" face=\"Courier New\"><span lang=\"EN-GB\" style=\"font-size: 11pt; color: windowtext;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\" color=\"black\" face=\"Calibri\"><span lang=\"EN-GB\" style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: windowtext;\">MMSE score equal to or greater than 24<u></u><u></u></span></font></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142Default\" style=\"margin-left: 1.25in;\"><u></u><font size=\"2\" color=\"black\" face=\"Courier New\"><span lang=\"EN-GB\" style=\"font-size: 11pt; color: windowtext;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\" color=\"black\" face=\"Calibri\"><span lang=\"EN-GB\" style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: windowtext;\">CDR global score of 0.5<u></u><u></u></span></font></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142Default\" style=\"margin-left: 1.25in;\"><u></u><font size=\"2\" color=\"black\" face=\"Courier New\"><span lang=\"EN-GB\" style=\"font-size: 11pt; color: windowtext;\">o<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\" color=\"black\" face=\"Calibri\"><span lang=\"EN-GB\" style=\"font-size: 11pt; font-family: Calibri, sans-serif; color: windowtext;\">CDR Memory Box score of 0.5 or greater<u></u><u></u></span></font></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142Default\" style=\"margin-left: 0.75in;\"><u></u><font size=\"2\" color=\"black\" face=\"Symbol\"><span lang=\"EN-GB\" style=\"font-size: 11pt; color: windowtext;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></fo