ariant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Subjects with a history of seizures within 5 years of Screening or subjects with disturbance likely to be due to seizures within 5 years of Screening.<u></u><u></u></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.75in;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>History of transient ischemia attacks (TIA) or stroke within 12 months of Screening.<u></u><u></u></p><p class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142MsoListParagraphCxSpLast\" style=\"margin-left: 0.75in;\"><u></u><font size=\"2\" face=\"Symbol\"><span style=\"font-size: 11pt;\">·<font size=\"1\" face=\"Times New Roman\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>More in synopsis.</p><table class=\"m_-5589781281884615596m_1023429854059417391m_-3340473822627242423gmail-m_6576340089980737142MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"0\" style=\"background-color: rgb(238, 238, 238); font-family: Khula, sans-serif; font-size: 20px; width: 435.1pt;\"></table><p></p><p></p><p></p><p></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; line-height: 13.44px;\"><strong><font size=\"2\" color=\"black\" face=\"Calibri\"><span style=\"font-size: 10pt; line-he