"Calibri\"><span style=\"font-size: 10pt; line-height: 14px;\"># of patients completed:</span></font></strong><u></u><u></u></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; line-height: 13.44px;\"><strong><font size=\"2\" color=\"black\" face=\"Calibri\"><span style=\"font-size: 10pt; line-height: 14px;\">Enrollment Goal:</span></font></strong><u></u><u></u></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; line-height: 13.44px;\"><strong><font size=\"2\" color=\"black\" face=\"Calibri\"><span style=\"font-size: 10pt; line-height: 14px;\">Length of Enrollment:&nbsp; &nbsp;</span></font></strong></p></blockquote>    ', null, 'a:1:{i:0;i:101;}', '', '83,44', '1', '1', null, '2018-05-10 19:01:23', '2018-05-10 19:23:15', 'BTC', '0');
INSERT INTO `trials` VALUES ('157', 'Evolve CLIA Waiver Stool Sample Collection Study - Infant Stool Sample-001-018', '<p class=\"gmail_quote\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><blockquote class=\"gmail_quote\" style=\"margin-bottom: 0px; margin-left: 0.8ex; border-left-width: 1px; border-left-color: rgb(204, 204, 204); padding-left: 1ex;\"><font color=\"black\" size=\"2\" face=\"arial\"><p style=\"font-family: arial, helvetica; font-size: 10pt;\"><p id=\"m_1401261492938655363m_-8098405635903073998AOLMsgPart_1.2_a3b10716-0b04-4a20-8f58-583f8e639bdb\"><p class=\"m_1401261492938655363m_-8098405635903073998aolReplacedBody\"><p dir=\"ltr\"><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail_quote\"><p lang=\"EN-US\"><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548WordSection1\"><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">We\'re working with&nbsp;<span class=\"il\">Evolve</span>&nbsp;Biosystems on identifying potential sites for their upcoming&nbsp;<span class=\"il\">CLIA</span>&nbsp;<span class=\"il\">waiver</span>&nbsp;trial for a&nbsp;<span class=\"il\">stool</span>&nbsp;<span class=\"il\">sample</span>&nbsp;test in infants under 6 months of age. If you are interested in being considered for this trial, please complete the attached feasibility questionnaire and the&nbsp;<span class=\"il\">study</span>&nbsp;questions below, and return to me by&nbsp;<strong><span style=\"background: yellow;\">3pm EST on Tuesday, February 13<sup>th</sup></span></strong>. Attached above is information regarding the trial and I’ve included that information below as well.<u></u><u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><strong><u><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">Purpose of the&nbsp;<span class=\"il\">study</span>:</span></font></u></strong>&nbsp;Testing a new point-of-care screening test that will detect whether and&nbsp;<span class=\"il\">infant</span>&nbsp;<span class=\"il\">stool</span>&nbsp;<span class=\"il\">sample</span>&nbsp;has high or low levels of Bifidobacterium.<u></u><u></u></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><strong><u><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\"><span class=\"il\">Study</span>&nbsp;Population:</span></font></u></strong>&nbsp;Infants under 6 months of age. Testing to be done from a poopy diaper.<u></u><u></u></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><strong><u><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">Additional details:<u></u><u></u></span></font></u></strong></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548MsoListParagraph\"><u></u><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">-<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Testing will be conducted for 3 weeks, starting in March 2018.<u></u><u></u></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548MsoListParagraph\"><u></u><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">-<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Each site will be asked to obtain a set number of positive and negative results based on the test (approximately 20-40 poopy diapers during the 3-week testing period, divided by 3 operators)<u></u><u></u></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548Default\" style=\"margin-left: 0.5in;\"><u></u><font color=\"black\" face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">-<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\"><span style=\"font-size: 11pt;\"><span class=\"il\">Stool</span>&nbsp;from each diaper will be tested with the device and swabbed for confirmatory testing back at&nbsp;<span class=\"il\">Evolve</span>.<u></u><u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548Default\" style=\"margin-left: 0.5in;\"><u></u><font color=\"black\" face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">-<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\"><span style=\"font-size: 11pt;\">You will also be provided with a panel of&nbsp;<span class=\"il\">stool</span>&nbsp;samples for testing by each operator.<u></u><u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548Default\" style=\"margin-left: 0.5in;\"><u></u><font color=\"black\" face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">-<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\"><span style=\"font-size: 11pt;\">You will record the result obtained by the device for each&nbsp;<span class=\"il\">stool</span>.<u></u><u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548Default\" style=\"margin-left: 0.5in;\"><u></u><font color=\"black\" face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">-<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\"><span style=\"font-size: 11pt;\">At the end of the testing period, each operator will complete an Ease of Use Questionnaire.<u></u><u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548Default\" style=\"margin-left: 0.5in;\"><u></u><font color=\"black\" face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">-<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"2\"><span style=\"font-size: 11pt;\">Participating sites will be provided with a start-up payment and will be paid for each diaper collected and tested during the testing period.<u></u><u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548Default\" style=\"margin-left: 0.5in;\"><u></u><font color=\"black\" face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">-<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u><font size=\"3\"><span style=\"font-size: 11.5pt;\">Operators can be anyone in your office who would typically do this type of test (medical assistants, office managers, receptionists, technicians, nurses, lactation consultants)&nbsp;<strong>except for physicians.</strong></span></font><font size=\"2\"><span style=\"font-size: 11pt;\"><u></u><u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\"><u></u>&nbsp;<u></u></span></font></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><strong><u><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt; background-color: rgb(255, 255, 0);\"><span class=\"il\">Study</span>&nbsp;Questions:<u></u><u></u></span></font></u></strong></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548MsoListParagraph\"><span style=\"background-color: rgb(255, 255, 0);\"><u></u><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">1.<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Does your site have ample staff to meet the requirement of 3 operators (non-physicians) for testing?<u></u><u></u></span></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_gmail-m_1010192519510477548MsoListParagraph\"><span style=\"background-color: rgb(255, 255, 0);\"><u></u><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\">2.<font face=\"Times New Roman\" size=\"1\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 7pt; line-height: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></font></span></font><u></u>Do your physicians recommend Evivo, a&nbsp;<em>B. infantis</em>&nbsp;probiotic product, to breastfed infants?<u></u><u></u></span></p><p class=\"m_1401261492938655363m_-8098405635903073998aolmail_MsoNormal\"><font face=\"Calibri\" size=\"2\"><span style=\"font-size: 11pt;\"><span style=\"background-color: rgb(255, 255, 0);\"><u></u>&nbsp;</span><u></u></span></font></p><p dir=\"ltr\"><span style=\"font-family: Verdana;\"><span style=\"font-size: 10pt;\">Respectfully,</span><br><br><span style=\"font-size: 10pt;\">Shilo West</span><br><br><span style=\"font-size: 10pt;\">Managing Director</span><br><span style=\"font-size: 10pt;\">Administrative Clinical&nbsp;<span class=\"il\">Study</span>&nbsp;Start-up Services</span><br><span style=\"font-size: 10pt;\">Conduct Clinical Trials</span><br><br><span style=\"font-size: 10pt;\">T:&nbsp;<a href=\"tel:(888)%20635-0552\" value=\"+18886350552\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">888-635-0552</a>&nbsp;- F:&nbsp;<a href=\"tel:(888)%20979-8260\" value=\"+18889798260\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">888-979-8260</a>&nbsp;- M:&nbsp;<a href=\"tel:(702)%20720-7323\" value=\"+17027207323\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">702-720-7323</a></span><br><span style=\"font-size: 10pt;\">E:&nbsp;</span><a href=\"mailto:Shilo@conductclinicaltrials.com\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">Shilo@conductclinicaltrials<wbr>.com</a><br><br><span style=\"font-size: 10pt;\">Internet Site:&nbsp;</span><a href=\"http://www.conductclinicaltrials.com/\" rel=\"noopener noreferrer\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.conductclinicaltrials.com/&amp;source=gmail&amp;ust=1526068281083000&amp;usg=AFQjCNF3HuXOMwgl8FOp0WURHIkUaUwCPQ\" style=\"color: rgb(17, 85, 204); font-size: 10pt;\">www.conductclinicaltrial<wbr>s.com</a><br><br><strong style=\"font-size: 10pt;\"><span style=\"color: rgb(255, 0, 0);\">*Please note new mobile number&nbsp;<a href=\"tel:(702)%20720-7323\" value=\"+17027207323\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">702-720-7323</a></span></strong><br><br><font size=\"2\"><strong>Conduct Clinical Trials</strong><br>Niche Service Provider specialized in Administrative Clinical&nbsp;<span class=\"il\">Study</span>&nbsp;Start-up Value-Added Services to both Sponsors/CROs and Physicians and their private practice offices. Streamlining Processes, Minimizing Risks and Maximizing ROI.</font></span></p><span style=\"font-family: Verdana;\"><font size=\"2\"><br></font></span><p dir=\"ltr\"><p><font face=\"verdana, sans-serif\" size=\"2\"><strong>TrialPulse</strong><span style=\"color: rgb(34, 34, 34);\">™</span><br></font></p><p><font face=\"verdana, sans-serif\" size=\"2\">TrialPulse is a cloud based SaaS application that will revolutionize the way clinical trials are conducted.&nbsp; TrialPulse unifies clinical trial teams (Physicians, Pharmaceutical Companies and CROs) through a multisided platform.&nbsp; Most clinical teams work in many different systems and often without the benefit of direct collaboration between teams, both internally and externally. &nbsp; Our unified cloud system allow teams to work together to make clinical trials faster and smarter while minimizing errors and costly redundancies. &nbsp; Hence driving drug development and avoiding costly delays. Every day a drug is delayed cost the pharmaceutical company $1 million dollars and costs society the loss of human lives.</font></p><p><font face=\"verdana, sans-serif\" size=\"2\"><br></font></p></p></p></p></p></p></p></p></p></font></blockquote></p><p class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><div class=\"yj6qo\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"></div></p>', null, null, '1514764800', '54,83', '1', '0', null, '2018-05-10 19:58:53', '2018-05-10 19:58:53', 'BTC', '1');
